INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (1, 'Hindi/ Delhi', 'Hindi-Delhi', 'MTONGUE', '10', 1, '/hindi-delhi-matrimony-matrimonials', 'Y', 'L1_MT_1', 'Delhi is the capital city of India where people of various communities and religion co-exist together. Hindi is known to majority of the people while other Hindi dialects like Khadiboli, Bhojpuri and Braj are also spoken by the Delhites.  \n\nAccording to 2001 census report, 81% of the population is Hindu and 10% is Muslim. Sikhs, Jains and Christians also have significant population.  Hindi is the official language of Delhi and is spoken by settlers belonging to other states like Punjab as well. \n', 'Hindi Delhi Matrimony - Hindi Delhi Matrimonial - Hindi Delhi Matrimonials - Hindi Delhi Marriage - Online Hindi Delhi Matrimonials - Matrimonial Services', 'Search Hindi Delhi Matrimony, Hindi Delhi Matrimonial, Hindi Delhi Matrimonials, Hindi Delhi Marriage, Hindi Delhi Matrimonial Profiles in the leading Hindi Delhi Matrimonials site for Indian and NRI Hindi Delhi Marriage. Join Free &amp; Add your Hindi Delhi Matrimonial Profile Now! Find suitable Indian &amp; NRI Hindi Delhi brides and grooms from our online Hindi Delhi matrimonial and matchmaking services.', 'Hindi-Delhi matrimony, Hindi-Delhi matrimonials, Hindi-Delhi matrimonial, matrimonials, matrimony, matrimony services, online Hindi-Delhi matrimonials, Indian marriage, match making, matchmaker, Hindi-Delhi profiles, marriage bureau , Hindi-Delhi marriage bureau, matchmaking services, matrimonial profiles, Hindi-Delhi bride, Hindi-Delhi groom, matrimony classified, brides, grooms', 'Hindi-Delhi Matrimonials ', 'Y', 'hindi-delhi-matrimonials.jpg', 'Hindi Delhi Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (2, 'Marathi/ Maharashtra', 'Marathi', 'MTONGUE', '20', 1, '/matrimonials/marathi-matrimonial/', 'Y', 'L1_MT_2', 'The Marathi people or Maharashtrians inhabit the Maharashtra region and state of western India. The language spoken by them is known as Marathi which is a part of southern group of Indo-Aryan languages. Though their history goes back more than a millennium, the community got its due recognition when Maratha warriors under Shivaji Maharaj established the Maratha Empire (1674).\n\nOriginally, Marathi people are the former Indo-Aryan Kshatriya Kunbi caste and commonly call themselves as Marathi Manoos.\n', 'Marathi Matrimony - Marathi Matrimonial - Marathi Matrimonials -Marathi Marriage - Online Marathi Matrimonials - Matrimonial Services', 'Search Marathi Matrimony, Marathi Matrimonial, Marathi Matrimonials, Marathi Marriage, Marathi Matrimonial Profiles in the leading Marathi Matrimonials site for Indian and NRI Marathi Marriage. Join Free &amp; Add your Marathi Matrimonial Profile Now! Find suitable Indian &amp; NRI Marathi brides and grooms from our online Marathi matrimonial and matchmaking services.', 'Marathi matrimony, Marathi matrimonials, Marathi matrimonial, matrimonials, matrimony, matrimony services, online Marathi matrimonials, Indian marriage, match making, matchmaker, Marathi profiles, marriage bureau , Marathi marriage bureau, matchmaking services, matrimonial profiles, Marathi bride, Marathi groom, matrimony classified, brides, grooms', 'Marathi Matrimonials ', 'Y', 'marathi-matrimonials.jpg', 'Marathi Matrimony\r');
