INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (4, 'Punjabi', 'Punjabi', 'MTONGUE', '27', 1, '/matrimonials/punjabi-matrimonial/', 'Y', 'L1_MT_4', 'Punjabi community is the most wide spread community which is spread all over the world. Punjabis originally belong to Punjab region of India, which forms the present Indian state of Punjab. Within India, Punjabis represent about 3% of the total population.\n \nThey believe in the theory of Ã¢â‚¬Ëœwork is worshipÃ¢â‚¬â„¢ and are broad-minded people that believe in transforming themselves with changing times. They follow Sikhism as their religion and celebrate all the festivals and specially weddings with zeal. \n', 'Punjabi Matrimony - Punjabi Matrimonial - Punjabi Matrimonials -Punjabi Marriage - Online Punjabi Matrimonials - Matrimonial Services', 'Search Punjabi Matrimony, Punjabi Matrimonial, Punjabi Matrimonials, Punjabi Marriage, Punjabi Matrimonial Profiles in the leading Punjabi Matrimonials site for Indian and NRI Punjabi Marriage. Join Free &amp; Add your Punjabi Matrimonial Profile Now! Find suitable Indian &amp; NRI Punjabi brides and grooms from our online Punjabi matrimonial and matchmaking services.', 'Punjabi matrimony, Punjabi matrimonials, Punjabi matrimonial, matrimonials, matrimony, matrimony services, online Punjabi matrimonials, Indian marriage, match making, matchmaker, Punjabi profiles, marriage bureau , Punjabi marriage bureau, matchmaking services, matrimonial profiles, Punjabi bride, Punjabi groom, matrimony classified, brides, grooms', 'Punjabi Matrimonials ', 'Y', 'punjabi-matrimonials.jpg', 'Punjabi Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (5, 'Telugu/Andhra Pradesh', 'Telugu', 'MTONGUE', '3', 1, '/matrimonials/telugu-matrimonial/', 'Y', 'L1_MT_5', 'The Telugu people or Telugus are an ethnic group of India. The people of Andhra Pradesh are the native speakers of the Telugu language. It is one of the 22 languages of India and is the most commonly spoken language after Hindi and Bengali. A significant population in Pondicherry, Tamil Nadu, Karnataka, Maharashtra and Orissa also speak Telugu language.\nIt is a Dravidian language written in a Telugu script and adapted from the Bhattiprolu script. The language has Hindu and Muslim influences.\n', 'Telugu Matrimony - Telugu Matrimonial - Telugu Matrimonials -Telugu Marriage - Online Telugu Matrimonials - Matrimonial Services', 'Search Telugu Matrimony, Telugu Matrimonial, Telugu Matrimonials, Telugu Marriage, Telugu Matrimonial Profiles in the leading Telugu Matrimonials site for Indian and NRI Telugu Marriage. Join Free &amp; Add your Telugu Matrimonial Profile Now! Find suitable Indian &amp; NRI Telugu brides and grooms from our online Telugu matrimonial and matchmaking services.', 'Telugu matrimony, Telugu matrimonials, Telugu matrimonial, matrimonials, matrimony, matrimony services, online Telugu matrimonials, Indian marriage, match making, matchmaker, Telugu profiles, marriage bureau , Telugu marriage bureau, matchmaking services, matrimonial profiles, Telugu bride, Telugu groom, matrimony classified, brides, grooms', 'Telugu Matrimonials ', 'Y', 'telugu-matrimonials.jpg', 'Telugu Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (6, 'Bengali', 'Bengali', 'MTONGUE', '6', 1, '/matrimonials/bengali-matrimonial/', 'Y', 'L1_MT_6', 'Bengalis are an ethnic community and natives to the historic region of Bengal in India. The Bengali community speaks Bengali (Bangla), which is an Indo-Aryan language of the eastern Indian subcontinent and has evolved from the Magadhi Prakrit and Sanskrit languages.  \n\nBengalis are, mainly, concentrated in the states of West Bengal and Tripura in India, and in Bangladesh. Besides that, there are a number of Bengali communities scattered in North-East India, New Delhi, and other Indian states. \n\n', 'Bengali Matrimony - Bengali Matrimonial - Bengali Matrimonials -Bengali Marriage - Online Bengali Matrimonials - Matrimonial Services', 'Search Bengali Matrimony, Bengali Matrimonial, Bengali Matrimonials, Bengali Marriage, Bengali Matrimonial Profiles in the leading Bengali Matrimonials site for Indian and NRI Bengali Marriage. Join Free &amp; Add your Bengali Matrimonial Profile Now! Find suitable Indian &amp; NRI Bengali brides and grooms from our online Bengali matrimonial and matchmaking services.', 'Bengali matrimony, Bengali matrimonials, Bengali matrimonial, matrimonials, matrimony, matrimony services, online Bengali matrimonials, Indian marriage, match making, matchmaker, Bengali profiles, marriage bureau , Bengali marriage bureau, matchmaking services, matrimonial profiles, Bengali bride, Bengali groom, matrimony classified, brides, grooms', 'Bengali Matrimonials ', 'Y', 'bengali-matrimonials.jpg', 'Bengali Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (7, 'Tamil', 'Tamil', 'MTONGUE', '31', 1, '/matrimonials/tamil-matrimonial/', 'Y', 'L1_MT_7', 'Tamilians are an ethnic and native group of Tamil Nadu and the north-eastern region of Sri Lanka. Besides that, emigrant Tamil communities are found across the world. Tamils are largely Hindus with sizeable Christian and Muslim populations.\n\nTamil is the first Indian language to be given a classical status. Amongst other Dravidian languages, it has the oldest extant literature. The art and architecture of the Tamil people encompass some of the remarkable contributions from India to the art world.\n', 'Tamil Matrimony - Tamil Matrimonial - Tamil Matrimonials -Tamil Marriage - Online Tamil Matrimonials - Matrimonial Services', 'Search Tamil Matrimony, Tamil Matrimonial, Tamil Matrimonials, Tamil Marriage, Tamil Matrimonial Profiles in the leading Tamil Matrimonials site for Indian and NRI Tamil Marriage. Join Free &amp; Add your Tamil Matrimonial Profile Now! Find suitable Indian &amp; NRI Tamil brides and grooms from our online Tamil matrimonial and matchmaking services.', 'Tamil matrimony, Tamil matrimonials, Tamil matrimonial, matrimonials, matrimony, matrimony services, online Tamil matrimonials, Indian marriage, match making, matchmaker, Tamil profiles, marriage bureau , Tamil marriage bureau, matchmaking services, matrimonial profiles, Tamil bride, Tamil groom, matrimony classified, brides, grooms', 'Tamil Matrimonials ', 'Y', 'tamil-matrimonials.jpg', 'Tamil Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (8, 'Gujarati / Kutchi', 'Gujarati', 'MTONGUE', '12', 1, '/matrimonials/gujarati-matrimonial/', 'Y', 'L1_MT_8', 'Gujarati is an indo-Aryan ethnic language evolved from Sanskrit. It is the native language of Indian state of Gujarat. GujaratiÃ¢â‚¬â„¢s are mainly Hindus with a significant number of Muslim populations as well.\r\n\r\nGujaratis, mainly live in the northwestern part of the Indian subcontinent, in the Gujarat state. Besides that, they are inhabited in the Indian states of Rajasthan, Maharashtra and Madhya Pradesh as well as in the Indian union trritories of New Delhi, Daman and Diu, Dadra and Nagar Haveli.\r\n', 'Gujarati Matrimony - Gujarati Matrimonial - Gujarati Matrimonials -Gujarati Marriage - Online Gujarati Matrimonials - Matrimonial Services', 'Search Gujarati Matrimony, Gujarati Matrimonial, Gujarati Matrimonials, Gujarati Marriage, Gujarati Matrimonial Profiles in the leading Gujarati Matrimonials site for Indian and NRI Gujarati Marriage. Join Free &amp; Add your Gujarati Matrimonial Profile Now! Find suitable Indian &amp; NRI Gujarati brides and grooms from our online Gujarati matrimonial and matchmaking services.', 'Gujarati  matrimony, Gujarati  matrimonials, Gujarati  matrimonial, matrimonials, matrimony, matrimony services, online Gujarati  matrimonials, Indian marriage, match making, matchmaker, Gujarati  profiles, marriage bureau , Gujarati  marriage bureau, matchmaking services, matrimonial profiles, Gujarati  bride, Gujarati  groom, matrimony classified, brides, grooms', 'Gujarati  Matrimonials ', 'Y', 'gujarati-matrimonials.jpg', 'Gujarati Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (9, 'Malayalee/Keralite', 'Malayalam', 'MTONGUE', '17', 1, '/matrimonials/malayalee-matrimonial/', 'Y', 'L1_MT_9', 'The Malayalees are a group of people or community that speaks Malayalam language originated from Kerala. Malyalam has originated from the words mala and alam that means land along side the mountain. A large number of Hindus and Christians are Malayalees. Malayalees are very educated and strictly follow their traditions\n \nThough the majority of Malayalis belong to Kerala, significant populations also exist in other parts of India like Karnatake and Delhi, the Middle East, Europe and North America. \n', 'Malayalee Matrimony - Malayalee Matrimonial - Malayalee Matrimonials -Malayalee Marriage - Online Malayalee Matrimonials - Matrimonial Services', 'Search Malayalee Matrimony, Malayalee Matrimonial, Malayalee Matrimonials, Malayalee Marriage, Malayalee Matrimonial Profiles in the leading Malayalee Matrimonials site for Indian and NRI Malayalee Marriage. Join Free &amp; Add your Malayalee Matrimonial Profile Now! Find suitable Indian &amp; NRI Malayalee brides and grooms from our online Malayalee matrimonial and matchmaking services.', 'Malayalee matrimony, Malayalee matrimonials, Malayalee matrimonial, matrimonials, matrimony, matrimony services, online Malayalee matrimonials, Indian marriage, match making, matchmaker, Malayalee profiles, marriage bureau , Malayalee marriage bureau, matchmaking services, matrimonial profiles, Malayalee bride, Malayalee groom, matrimony classified, brides, grooms', 'Malayalee Matrimonials ', 'Y', 'malayalee-matrimonials.jpg', 'Malayalee Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (10, 'Kannada/Karnataka', 'Kannada', 'MTONGUE', '16', 1, '/matrimonials/kannada-matrimonial/', 'Y', 'L1_MT_10', 'Kannadiga or Kannadati is a reference to the group of people or community who natively speak the Kannada language. Kannadigas are mostly located in the state of Karnataka in India, and in the adjacent states of Andhra Pradesh, Tamil Nadu, Kerala, Goa and Maharashtra.  \n\nKannada is a Dravidian language that has been spoken for about 2500 years and has been highly influenced by Sanskrit vocabulary and literary style. There are around 20 dialects of Kannada that includes Hayaka, Kodava, Kunda etc.', 'Kannada Matrimony - Kannada Matrimonial - Kannada Matrimonials -Kannada Marriage - Online Kannada Matrimonials - Matrimonial Services', 'Search Kannada Matrimony, Kannada Matrimonial, Kannada Matrimonials, Kannada Marriage, Kannada Matrimonial Profiles in the leading Kannada Matrimonials site for Indian and NRI Kannada Marriage. Join Free &amp; Add your Kannada Matrimonial Profile Now! Find suitable Indian &amp; NRI Kannada brides and grooms from our online Kannada matrimonial and matchmaking services.', 'Kannada matrimony, Kannada matrimonials, Kannada matrimonial, matrimonials, matrimony, matrimony services, online Kannada matrimonials, Indian marriage, match making, matchmaker, Kannada profiles, marriage bureau , Kannada marriage bureau, matchmaking services, matrimonial profiles, Kannada bride, Kannada groom, matrimony classified, brides, grooms', 'Kannada Matrimonials ', 'Y', 'kannada-matrimonials.jpg', 'Kannada Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (11, 'Hindi /Madhya Pradesh / Bundelkhand / Chattisgarhi', 'Hindi-MP', 'MTONGUE', '19', 1, '/hindi-mp-matrimony-matrimonials', 'Y', 'L1_MT_11', 'Madhya Pradesh often called the Ã¢â‚¬ËœHeart of IndiaÃ¢â‚¬â„¢ is a medley of ethnic groups and tribes, castes and communities. The population of MP includes indigenous people and migrants from other states of India. According to census of 2000, 91% people are Hindus and rest includes Muslims, Jains, Christians, Buddhists and Sikhs. \n\nHindi and dialects of Hindi like Malvi, Nimadi, Bundeli, Bagheli and Avadhi are widely spoken in the state. Tribal groups, Marathis and migrants speak their own native languages.\n', 'Hindi MP Matrimony - Hindi MP Matrimonial - Hindi MP Matrimonials -Hindi MP Marriage - Online Hindi MP Matrimonials - Matrimonial Services', 'Search Hindi MP Matrimony, Hindi MP Matrimonial, Hindi MP Matrimonials, Hindi MP Marriage, Hindi MP Matrimonial Profiles in the leading Hindi MP Matrimonials site for Indian and NRI Hindi MP Marriage. Join Free &amp; Add your Hindi MP Matrimonial Profile Now! Find suitable Indian &amp; NRI Hindi MP brides and grooms from our online Hindi MP matrimonial and matchmaking services.', 'Hindi MP matrimony, Hindi MP matrimonials, Hindi MP matrimonial, matrimonials, matrimony, matrimony services, online Hindi MP matrimonials, Indian marriage, match making, matchmaker, Hindi MP profiles, marriage bureau , Hindi MP marriage bureau, matchmaking services, matrimonial profiles, Hindi MP bride, Hindi MP groom, matrimony classified, brides, grooms', 'Hindi-MP Matrimonials', 'Y', 'hindi-mp-matrimonials.jpg', 'Hindi MP Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (12, 'Bihari/Maithili/Magahi', 'Bihari', 'MTONGUE', '7', 1, '/matrimonials/bihari-matrimonial/', 'Y', 'L1_MT_12', 'The Biharis, an ethnic group originating from the state of Bihar in India, have a history going back three millennia. Biharis speak Bihari languages such as Magahi, Bhojpuri, Maithili, besides other local dialects. They also speak Hindi or Urdu. They show some admixture with the early Munda inhabitants of the region as well as Indo-Aryans.\n\nOther than Bihar, Biharis can be found throughout North India, West Bengal, Maharashtra and also in the neighbouring countries of Pakistan and Bangladesh.\n', 'Bihari Matrimony - Bihari Matrimonial - Bihari Matrimonials -Bihari Marriage - Online Bihari Matrimonials - Matrimonial Services', 'Search Bihari Matrimony, Bihari Matrimonial, Bihari Matrimonials, Bihari Marriage, Bihari Matrimonial Profiles in the leading Bihari Matrimonials site for Indian and NRI Bihari Marriage. Join Free &amp; Add your Bihari Matrimonial Profile Now! Find suitable Indian &amp; NRI Bihari brides and grooms from our online Bihari matrimonial and matchmaking services.', 'Bihari matrimony, Bihari matrimonials, Bihari matrimonial, matrimonials, matrimony, matrimony services, online Bihari matrimonials, Indian marriage, match making, matchmaker, Bihari profiles, marriage bureau , Bihari marriage bureau, matchmaking services, matrimonial profiles, Bihari bride, Bihari groom, matrimony classified, brides, grooms', 'Bihari Matrimonials ', 'Y', 'bihari-matrimonials.jpg', 'Bihari Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (13, 'Rajasthani / Marwari / Malwi / Jaipuri', 'Rajasthani', 'MTONGUE', '28', 1, '/matrimonials/rajasthani-matrimonial/', 'Y', 'L1_MT_13', 'Rajasthani people are subgroup of larger Indo-Aryan ethnic group that inhabit the Rajasthan region of India. The whole Rajasthani community is known as marwaris throughout Indian subcontinent.\n\nThe people belonging to the state of Rajasthan come from varied ethnic, religious, social and economic sections making it an anthropological jungle. It is difficult to classify Rajasthanis into a specific ethnic or social group as a number of clans, castes and sub castes inhabit the state of Rajasthan.\n', 'Rajasthani Matrimony - Rajasthani Matrimonial - Rajasthani Matrimonials -Rajasthani Marriage - Online Rajasthani Matrimonials - Matrimonial Services', 'Search Rajasthani Matrimony, Rajasthani Matrimonial, Rajasthani Matrimonials, Rajasthani Marriage, Rajasthani Matrimonial Profiles in the leading Rajasthani Matrimonials site for Indian and NRI Rajasthani Marriage. Join Free &amp; Add your Rajasthani Matrimonial Profile Now! Find suitable Indian &amp; NRI Rajasthani brides and grooms from our online Rajasthani matrimonial and matchmaking services.', 'Rajasthani matrimony, Rajasthani matrimonials, Rajasthani matrimonial, matrimonials, matrimony, matrimony services, online Rajasthani matrimonials, Indian marriage, match making, matchmaker, Rajasthani profiles, marriage bureau , Rajasthani marriage bureau, matchmaking services, matrimonial profiles, Rajasthani bride, Rajasthani groom, matrimony classified, brides, grooms', 'Rajasthani Matrimonials ', 'Y', 'rajasthani-matrimonials.jpg', 'Rajasthani Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (14, 'Oriya', 'Oriya', 'MTONGUE', '25', 1, '/matrimonials/oriya-matrimonial/', 'Y', 'L1_MT_14', 'The Oriya, traditionally known in various names Odiya, Odri, Utkaliya, Kalingi, Dakhini, Kosli etc. are an ethnic group or community of eastern India and of eastern Indo-Aryan stock. They are found mainly in the coastal province of Orissa with minority populations in Andhra Pradesh, West Bengal, Jharkhand and Chhattisgarh. \n\nThe Oriya people are famous for their long history of worshipping the Sun. And probably this is why Orissa is home to some of the oldest Sun temples in India including Konark. \n\n', 'Oriya Matrimony - Oriya Matrimonial - Oriya Matrimonials -Oriya Marriage - Online Oriya Matrimonials - Matrimonial Services', 'Search Oriya Matrimony, Oriya Matrimonial, Oriya Matrimonials, Oriya Marriage, Oriya Matrimonial Profiles in the leading Oriya Matrimonials site for Indian and NRI Oriya Marriage. Join Free &amp; Add your Oriya Matrimonial Profile Now! Find suitable Indian &amp; NRI Oriya brides and grooms from our online Oriya matrimonial and matchmaking services.', 'Oriya matrimony, Oriya matrimonials, Oriya matrimonial, matrimonials, matrimony, matrimony services, online Oriya matrimonials, Indian marriage, match making, matchmaker, Oriya profiles, marriage bureau , Oriya marriage bureau, matchmaking services, matrimonial profiles, Oriya bride, Oriya groom, matrimony classified, brides, grooms', 'Oriya Matrimonials ', 'Y', 'oriya-matrimonials.jpg', 'Oriya Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (15, 'Sindhi', 'Sindhi', 'MTONGUE', '30', 1, '/matrimonials/sindhi-matrimonial/', 'N', 'L1_MT_15', 'Sindhis, a Sindhi speaking socio-ethnic group, have originated from Sindh, a province of Pakistan. Sindhis that live in Pakistan at present belong to various religious denominations including but not limited to Muslim, Zorastrian, Hindus and Christians. \n\nWhen the partition of India took place in 1947, a large number of Indian Muslim refugees (Muhajirs) flocked into Pakistan and settled in the prosperous Sindh region. At the same time, Sindhi Hindus migrated to India in remarkably large numbers. \n', 'Sindhi Matrimony - Sindhi Matrimonial - Sindhi Matrimonials -Sindhi Marriage - Online Sindhi Matrimonials - Matrimonial Services', 'Search Sindhi Matrimony, Sindhi Matrimonial, Sindhi Matrimonials, Sindhi Marriage, Sindhi Matrimonial Profiles in the leading Sindhi Matrimonials site for Indian and NRI Sindhi Marriage. Join Free &amp; Add your Sindhi Matrimonial Profile Now! Find suitable Indian &amp; NRI Sindhi brides and grooms from our online Sindhi matrimonial and matchmaking services.', 'Sindhi matrimony, Sindhi matrimonials, Sindhi matrimonial, matrimonials, matrimony, matrimony services, online Sindhi matrimonials, Indian marriage, match making, matchmaker, Sindhi profiles, marriage bureau , Sindhi marriage bureau, matchmaking services, matrimonial profiles, Sindhi bride, Sindhi groom, matrimony classified, brides, grooms', 'Sindhi Matrimonials ', 'N', 'sindhi-matrimonials.jpg', 'sindhi matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (16, 'Konkani', 'Konkani', 'MTONGUE', '34', 1, '/konkani-matrimony-matrimonials', 'Y', 'L1_MT_16', 'Konkani people form an ethnic group primarily found in the Konkan Coast of western India who speak the Konkani language natively.\nThe word Konkani derives from kum, meaning &#039;Mother Earth&#039; and kana, meaning &#039;piece/part&#039; thereby meaning a strip of land. Thus, the land along the western Indian coast beyond the Western Ghat Mountains is called Konkan. Both the language and the people take their names from the region where it originated. Konkanis are found in Konkan Division, Goa, Canara and Kerala.\n', 'Konkani Matrimony - Konkani Matrimonial - Konkani Matrimonials -Konkani Marriage - Online Konkani Matrimonials - Matrimonial Services', 'Search Konkani Matrimony, Konkani Matrimonial, Konkani Matrimonials, Konkani Marriage, Konkani Matrimonial Profiles in the leading Konkani Matrimonials site for Indian and NRI Konkani Marriage. Join Free &amp; Add your Konkani Matrimonial Profile Now! Find suitable Indian &amp; NRI Konkani brides and grooms from our online Konkani matrimonial and matchmaking services.', 'Konkani matrimony, Konkani matrimonials, Konkani matrimonial, matrimonials, matrimony, matrimony services, online Konkani matrimonials, Indian marriage, match making, matchmaker, Konkani profiles, marriage bureau , Konkani marriage bureau, matchmaking services, matrimonial profiles, Konkani bride, Konkani groom, matrimony classified, brides, grooms', 'Konkani Matrimonials ', 'Y', 'konkani-matrimonials.jpg', 'Konkani Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (17, 'Himachali/Pahari', 'Himachali', 'MTONGUE', '14', 1, '/himachali-matrimony-matrimonials', 'Y', 'L1_MT_17', 'Himachal Pradesh, a multi-religional, multi-cultural and multi-lingual state has remained largely untouched by external customs. Some of the most commonly spoken languages in HP include Hindi, Punjabi, Pahari, Dogri, Kangri, Gojri and Kinnauri. \n\nThe Hindu caste communities residing in Himachal are Brahmins, Rajputs, Gujjars, Gaddis, Grith (Choudhary), Kannets (Rajputs), Rathis and Kolis. There are also tribal population in the state mainly comprising Kinnars, Pangawals, Sulehria and Lahaulis. \n\n', 'Himachali Matrimony - Himachali Matrimonial - Himachali Matrimonials -Himachali Marriage - Online Himachali Matrimonials - Matrimonial Services', 'Search Himachali Matrimony, Himachali Matrimonial, Himachali Matrimonials, Himachali Marriage, Himachali Matrimonial Profiles in the leading Himachali Matrimonials site for Indian and NRI Himachali Marriage. Join Free &amp; Add your Himachali Matrimonial Profile Now! Find suitable Indian &amp; NRI Himachali brides and grooms from our online Himachali matrimonial and matchmaking services.', 'Himachali matrimony, Himachali matrimonials, Himachali matrimonial, matrimonials, matrimony, matrimony services, online Himachali matrimonials, Indian marriage, match making, matchmaker, Himachali profiles, marriage bureau , Himachali marriage bureau, matchmaking services, matrimonial profiles, Himachali bride, Himachali groom, matrimony classified, brides, grooms', 'Himachali Matrimonials', 'Y', 'himachali-matrimonials.jpg', 'Himachali Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (18, 'Haryanvi', 'Haryanvi', 'MTONGUE', '13', 1, '/haryanvi-matrimony-matrimonials', 'Y', 'L1_MT_18', 'The people of Haryana are commonly referred to as Haryanvis. Haryanvis have preserved their rich cultural heritage, age old customs and traditions through means of folklore, religious festivals, popular art, music and poetry. Haryanvi is also the dominant language of the region while Punjabi is the second official language. \n\nHaryanvi is the northernmost dialect of the Hindi language most widely spoken in the North Indian states of Haryana and Delhi particularly by Jats, Rors, Gujjars and Kambojs.\n', 'Haryanvi Matrimony - Haryanvi Matrimonial - Haryanvi Matrimonials -Haryanvi Marriage - Online Haryanvi Matrimonials - Matrimonial Services', 'Search Haryanvi Matrimony, Haryanvi Matrimonial, Haryanvi Matrimonials, Haryanvi Marriage, Haryanvi Matrimonial Profiles in the leading Haryanvi Matrimonials site for Indian and NRI Haryanvi Marriage. Join Free &amp; Add your Haryanvi Matrimonial Profile Now! Find suitable Indian &amp; NRI Haryanvi brides and grooms from our online Haryanvi matrimonial and matchmaking services.', 'Haryanvi matrimony, Haryanvi matrimonials, Haryanvi matrimonial, matrimonials, matrimony, matrimony services, online Haryanvi matrimonials, Indian marriage, match making, matchmaker, Haryanvi profiles, marriage bureau , Haryanvi marriage bureau, matchmaking services, matrimonial profiles, Haryanvi bride, Haryanvi groom, matrimony classified, brides, grooms', 'Haryanvi Matrimonials', 'Y', 'haryanvi-matrimonials.jpg', 'Haryanvi Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (19, 'Assamese', 'Assamese', 'MTONGUE', '5', 1, '/matrimonials/assamese-matrimonial/', 'Y', 'L1_MT_19', 'Assamese people are often defined as a subgroup of People of Assam. They are also known as Assamese-speaking Indo-Aryans of the Brahmaputra valley. They inhabit a multi-ethnic, multi-linguistic and multi-religious society. They speak languages that belong to three major language groups: Austro-Asiatic, Tibeto-Burman and Indo-Aryan.  \n\nHistorically, Tai-Ahoms were the dominant ethnic group of Assam but recently, the Assamese language speaking group has been associated with the term &quot;Assamese&quot;. \n\n', 'Assamese Matrimony - Assamese Matrimonial - Assamese Matrimonials -Assamese Marriage - Online Assamese Matrimonials - Matrimonial Services', 'Search Assamese Matrimony, Assamese Matrimonial, Assamese Matrimonials, Assamese Marriage, Assamese Matrimonial Profiles in the leading Assamese Matrimonials site for Indian and NRI Assamese Marriage. Join Free &amp; Add your Assamese Matrimonial Profile Now! Find suitable Indian &amp; NRI Assamese brides and grooms from our online Assamese matrimonial and matchmaking services.', 'Assamese matrimony, Assamese matrimonials, Assamese matrimonial, matrimonials, matrimony, matrimony services, online Assamese matrimonials, Indian marriage, match making, matchmaker, Assamese profiles, marriage bureau , Assamese marriage bureau, matchmaking services, matrimonial profiles, Assamese bride, Assamese groom, matrimony classified, brides, grooms', 'Assamese Matrimonials ', 'Y', 'assamese-matrimonials.jpg', 'Assamese Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (20, 'Kashmiri/J&K/Dogri/Ladacki', 'Kashmiri', 'MTONGUE', '15', 1, '/kashmiri-matrimony-matrimonials', 'Y', 'L1_MT_20', 'Kashmiri people are a Dardic ethnic group living in the Indian state of Jammu and Kashmir and parts of the Pakistani territory of Azad Kashmir. They speak Kashmiri, Ã¢â‚¬Ëœa Northwestern Dardic language of the Indo-Aryan branch of the Indo-Iranian subfamily of the Indo-European language familyÃ¢â‚¬â„¢ also known as Koshur and hence those speaking it are Dardic people.\n\nKashmiri people are now classified into Kashmiri Muslims and Kashmiri Pandits though they were mostly Buddhist, Hindu, and Pagan originally. \n', 'Kashmiri Matrimony - Kashmiri Matrimonial - Kashmiri Matrimonials -Kashmiri Marriage - Online Kashmiri Matrimonials - Matrimonial Services', 'Search Kashmiri Matrimony, Kashmiri Matrimonial, Kashmiri Matrimonials, Kashmiri Marriage, Kashmiri Matrimonial Profiles in the leading Kashmiri Matrimonials site for Indian and NRI Kashmiri Marriage. Join Free &amp; Add your Kashmiri Matrimonial Profile Now! Find suitable Indian &amp; NRI Kashmiri brides and grooms from our online Kashmiri matrimonial and matchmaking services.', 'Kashmiri matrimony, Kashmiri matrimonials, Kashmiri matrimonial, matrimonials, matrimony, matrimony services, online Kashmiri matrimonials, Indian marriage, match making, matchmaker, Kashmiri profiles, marriage bureau , Kashmiri marriage bureau, matchmaking services, matrimonial profiles, Kashmiri bride, Kashmiri groom, matrimony classified, brides, grooms', 'Kashmiri Matrimonials', 'Y', 'kashmiri-matrimonials.jpg', 'Kashmiri Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (21, 'Sikkim/ Nepali/ Lepcha/ Bhutia/ Limbu', 'Sikkim/Nepali', 'MTONGUE', '29', 1, '/sikkim-nepali-matrimony-matrimonials', 'Y', 'L1_MT_21', 'Nepali people are descendants of migrants from parts of earlier Greater Nepal, Tibet, India and parts of Burma and Yunnan along with native tribal population. \n\nNepali or Nepalese is a language in the Indo-Aryan branch of the Indo-European language family. Nepal&#039;s diverse linguistic heritage evolved from major language groups: Indo-Aryan, Tibeto-Burman, Mongolian and various indigenous language isolates. Some of the languages spoken in Nepal are Maithili, Bhojpuri, Tharu and Tamang among others. \n', 'Sikkim Nepali Matrimony - Sikkim Nepali Matrimonial - Sikkim Nepali Matrimonials -Sikkim Nepali Marriage - Online Sikkim Nepali Matrimonials - Matrimonial Services', 'Search Sikkim Nepali Matrimony, Sikkim Nepali Matrimonial, Sikkim Nepali Matrimonials, Sikkim Nepali Marriage, Sikkim Nepali Matrimonial Profiles in the leading Sikkim Nepali Matrimonials site for Indian and NRI Sikkim Nepali Marriage. Join Free &amp; Add your Sikkim Nepali Matrimonial Profile Now! Find suitable Indian &amp; NRI Sikkim Nepali brides and grooms from our online Sikkim Nepali matrimonial and matchmaking services.', 'Sikkim Nepali matrimony, Sikkim Nepali matrimonials, Sikkim Nepali matrimonial, matrimonials, matrimony, matrimony services, online Sikkim Nepali matrimonials, Indian marriage, match making, matchmaker, Sikkim Nepali profiles, marriage bureau , Sikkim Nepali marriage bureau, matchmaking services, matrimonial profiles, Sikkim Nepali bride, Sikkim Nepali groom, matrimony classified, brides, grooms', 'Sikkim Nepali Matrimonials ', 'Y', 'sikkim-nepali-matrimonials.jpg', 'Sikkim Nepali Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (22, 'Software', 'IT Software', 'OCCUPATION', '20', 1, '/it-software-engineers-matrimony-matrimonials', 'Y', 'L1_OC_22', 'IT Software prefers to be in matrimony with a person belonging to the similar occupational field. In IT job, a person has particular working hours and spends a crucial amount of time outside the home. The men usually wants a working and independent wife with good educational background. The girl on the other hand, wants a life partner that has a good job and salary with a reputed company. Inter-caste marriage is a common affair between IT professionals as they give more stress on education.', 'IT Software Engineers Matrimony - IT Software Engineers Matrimonial - IT Software Engineers Matrimonials - IT Software Engineers Marriage - Online IT Software Engineers Matrimonials - Matrimonial Services', 'Search IT Software Engineers Matrimony, IT Software Engineers Matrimonial, IT Software Engineers Matrimonials, IT Software Engineers Marriage, IT Software Engineers Matrimonial Profiles in the leading IT Software Engineers Matrimonials site for Indian and NRI IT Software Engineers Marriage. Join Free &amp; Add your IT Software Engineers Matrimonial Profile Now! Find suitable Indian &amp; NRI IT Software Engineers brides and grooms from our online IT Software Engineers matrimonial and matchmaking services.', 'IT Software Engineers matrimony, IT Software Engineers matrimonials, IT Software Engineers matrimonial, matrimonials, matrimony, matrimony services, online IT Software Engineers matrimonials, Indian marriage, match making, matchmaker, IT Software Engineers profiles, marriage bureau , IT Software Engineers marriage bureau, matchmaking services, matrimonial profiles, IT Software Engineers bride, IT Software Engineers groom, matrimony classified, brides, grooms', 'IT Software Engineer Matrimonials', 'Y', 'it-software-engineers-matrimonials.jpg', 'IT Software Engineers Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (23, 'Teaching', 'Teacher', 'OCCUPATION', '31', 1, '/teachers-matrimony-matrimonials', 'Y', 'L1_OC_23', 'A teacher facilitates education for an individual that may be related to literacy, craftsmanship, vocational training, arts, religion or spirituality. They usually require professional education and special knowledge of code of ethics and monitoring to impart formal training. \n\nThe matrimony between two teachers can be really interesting as wedding planners are coming up with novel ideas to make the occasion memorable. Parents looking for working girls for their sons generally prefer teachers. \n', 'Teachers Matrimony - Teachers Matrimonial - Teachers Matrimonials -Teachers Marriage - Online Teachers Matrimonials - Matrimonial Services', 'Search Teachers Matrimony, Teachers Matrimonial, Teachers Matrimonials, Teachers Marriage, Teachers Matrimonial Profiles in the leading Teachers Matrimonials site for Indian and NRI Teachers Marriage. Join Free &amp; Add your Teachers Matrimonial Profile Now! Find suitable Indian &amp; NRI Teachers brides and grooms from our online Teachers matrimonial and matchmaking services.', 'Teachers matrimony, Teachers matrimonials, Teachers matrimonial, matrimonials, matrimony, matrimony services, online Teachers matrimonials, Indian marriage, match making, matchmaker, Teachers profiles, marriage bureau , Teachers marriage bureau, matchmaking services, matrimonial profiles, Teachers bride, Teachers groom, matrimony classified, brides, grooms', 'Teachers Matrimonials', 'Y', 'teachers-matrimonials.jpg', 'Teachers Matrimony\r');
