INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (60, 'New Delhi', '', 'CITY', 'DE00', 1, '/matrimonials/delhi-matrimonials/', 'Y', 'L1_CI_60', 'Marriages in Delhi are a grand and festive affair where the groom and the bride wear beautiful attires and look at their best. Delhites usually prefer to wed their sons/daughters within the city of within the NCR region. The marriages take place within the community and numerous guests are invited.  Most of the life partners are found with the help of matrimonial sites and through relatives.  Delhi is a cosmopolitan city and one can experience various kinds of marriages and their unique rituals.', 'Delhi Matrimony - Delhi Matrimonial - Delhi Matrimonials - Delhi Marriage - Online Delhi Matrimonials - Matrimonial Services', 'Search Delhi Matrimony, Delhi Matrimonial, Delhi Matrimonials, Delhi Marriage, Delhi Matrimonial Profiles in the leading Delhi Matrimonials site for Indian and NRI Delhi Marriage. Join Free &amp; Add your Delhi Matrimonial Profile Now! Find suitable Indian &amp; NRI Delhi brides and grooms from our online Delhi matrimonial and matchmaking services.', 'Delhi matrimony, Delhi matrimonials, Delhi matrimonial, matrimonials, matrimony, matrimony services, online Delhi matrimonials, Indian marriage, match making, matchmaker, Delhi profiles, marriage bureau , Delhi marriage bureau, matchmaking services, matrimonial profiles, Delhi bride, Delhi groom, matrimony classified, brides, grooms', 'Delhi Matrimonials', 'Y', 'delhi-matrimonials.jpg', 'Delhi Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (61, 'Mumbai', '', 'CITY', 'MH04', 1, '/matrimonials/mumbai-matrimonial/', 'Y', 'L1_CI_61', 'Weddings in the stylish city of Mumbai have become the epitome of flamboyance and wonder. Located on the coast of Arabian Sea, it hosts lakhs of weddings every year uniting couples into an eternal bond. As known worldwide, Indian marriages are a glitzy affair with a lot of money and hoopla involved. Matrimonial celebrations are immensely enriched with cultural and traditional rituals making it a week long event. This largest metro of the country revels in the institution of marriage at its best.', 'Mumbai Matrimony - Mumbai Matrimonial - Mumbai Matrimonials -Mumbai Marriage - Online Mumbai Matrimonials - Matrimonial Services', 'Search Mumbai Matrimony, Mumbai Matrimonial, Mumbai Matrimonials, Mumbai Marriage, Mumbai Matrimonial Profiles in the leading Mumbai Matrimonials site for Indian and NRI Mumbai Marriage. Join Free &amp; Add your Mumbai Matrimonial Profile Now! Find suitable Indian &amp; NRI Mumbai brides and grooms from our online Mumbai matrimonial and matchmaking services.', 'Mumbai matrimony, Mumbai matrimonials, Mumbai matrimonial, matrimonials, matrimony, matrimony services, online Mumbai matrimonials, Indian marriage, match making, matchmaker, Mumbai profiles, marriage bureau , Mumbai marriage bureau, matchmaking services, matrimonial profiles, Mumbai bride, Mumbai groom, matrimony classified, brides, grooms', 'Mumbai Matrimonials', 'Y', 'mumbai-matrimonials.jpg', 'Mumbai Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (62, 'Bangalore', '', 'CITY', 'KA02', 1, '/matrimonials/bangalore-matrimonial/', 'Y', 'L1_CI_62', 'Bangalore, the Silicon Valley of India, is one of the major economic hubs and the fastest growing cities in the country. People of Bangalore are broad minded and do not hesitate in experimenting new things for life. Bangalore is also the main classical music and dance centre of Indian. A large number of Bangalore people, prefer doing love marriages and look for partners from technology background. The beauty of the city adds essence and feel to the preparations of the marriages in Bangalore. ', 'Bangalore Matrimony - Bangalore Matrimonial - Bangalore Matrimonials -Bangalore Marriage - Online Bangalore Matrimonials - Matrimonial Services', 'Search Bangalore Matrimony, Bangalore Matrimonial, Bangalore Matrimonials, Bangalore Marriage, Bangalore Matrimonial Profiles in the leading Bangalore Matrimonials site for Indian and NRI Bangalore Marriage. Join Free &amp; Add your Bangalore Matrimonial Profile Now! Find suitable Indian &amp; NRI Bangalore brides and grooms from our online Bangalore matrimonial and matchmaking services.', 'Bangalore matrimony, Bangalore matrimonials, Bangalore matrimonial, matrimonials, matrimony, matrimony services, online Bangalore matrimonials, Indian marriage, match making, matchmaker, Bangalore profiles, marriage bureau , Bangalore marriage bureau, matchmaking services, matrimonial profiles, Bangalore bride, Bangalore groom, matrimony classified, brides, grooms', 'Bangalore Matrimonials', 'Y', 'bangalore-matrimonials.jpg', 'Bangalore Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (63, 'Pune', '', 'CITY', 'MH08', 1, '/matrimonials/pune-matrimonial/', 'Y', 'L1_CI_63', 'Pune is the city famous for its education institutes and IT parks. The city mainly inhabits Marathi people but due various opportunities people from different cities have migrated here. Marathi weddings are celebrated in Pune with lot of simplicity and customs. The Marathi bride and groom dress themselves in traditional clothes where the bride wears a green color saree and the groom wears kurta along with dhoti. Inter-caste marriages are widely practiced due to matching compatibility in Pune.', 'Pune Matrimony - Pune Matrimonial - Pune Matrimonials -Pune Marriage - Online Pune Matrimonials - Matrimonial Services', 'Search Pune Matrimony, Pune Matrimonial, Pune Matrimonials, Pune Marriage, Pune Matrimonial Profiles in the leading Pune Matrimonials site for Indian and NRI Pune Marriage. Join Free &amp; Add your Pune Matrimonial Profile Now! Find suitable Indian &amp; NRI Pune brides and grooms from our online Pune matrimonial and matchmaking services.', 'Pune matrimony, Pune matrimonials, Pune matrimonial, matrimonials, matrimony, matrimony services, online Pune matrimonials, Indian marriage, match making, matchmaker, Pune profiles, marriage bureau , Pune marriage bureau, matchmaking services, matrimonial profiles, Pune bride, Pune groom, matrimony classified, brides, grooms', 'Pune Matrimonials', 'Y', 'pune-matrimonials.jpg', 'Pune Matrimony\r');
