INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (65, 'Kolkata', '', 'CITY', 'WB05', 1, '/matrimonials/kolkata-matrimonial/', 'Y', 'L1_CI_65', 'Kolkata, the cultural capital of India, is counted among the metropolitan cities of India. Kolkata has the maximum number of Bengali population and therefore, Bengali weddings are prominently practised in Kolkata. The people of Kolkata, prefer marrying Bengalis, due to which, their marriages are filled with the cultures, rituals and practices of Bengali. Kolkata matrimonies begin with the pure voice of the conch shell and matches are based on the intellectuality of the individual and his family. ', 'Kolkata Matrimony - Kolkata Matrimonial - Kolkata Matrimonials -Kolkata Marriage - Online Kolkata Matrimonials - Matrimonial Services', 'Search Kolkata Matrimony, Kolkata Matrimonial, Kolkata Matrimonials, Kolkata Marriage, Kolkata Matrimonial Profiles in the leading Kolkata Matrimonials site for Indian and NRI Kolkata Marriage. Join Free &amp; Add your Kolkata Matrimonial Profile Now! Find suitable Indian &amp; NRI Kolkata brides and grooms from our online Kolkata matrimonial and matchmaking services.', 'Kolkata matrimony, Kolkata matrimonials, Kolkata matrimonial, matrimonials, matrimony, matrimony services, online Kolkata matrimonials, Indian marriage, match making, matchmaker, Kolkata profiles, marriage bureau , Kolkata marriage bureau, matchmaking services, matrimonial profiles, Kolkata bride, Kolkata groom, matrimony classified, brides, grooms', 'Kolkata Matrimonials', 'Y', 'kolkata-matrimonials.jpg', 'Kolkata Matrimony\r');
