INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (71, 'Jaipur', '', 'CITY', 'RA07', 1, '/jaipur-matrimony-matrimonials', 'Y', 'L1_CI_71', 'Jaipur, the pink city of India, has the maximum population of Rajasthanis. The structure and the lifestyle of the people of Jaipur portray royalty and Rajput stature. A large number of traditional and modern industries are settled in Jaipur. People of Jaipur are mainly associated with the businesses of gold, stone and diamond jewellery. Marriages in Jaipur, largely take place within the community, whereas the choice of the life partner, differs according to the preferences of the individual. ', 'Jaipur Matrimony - Jaipur Matrimonial - Jaipur Matrimonials -Jaipur Marriage - Online Jaipur Matrimonials - Matrimonial Services', 'Search Jaipur Matrimony, Jaipur Matrimonial, Jaipur Matrimonials, Jaipur Marriage, Jaipur Matrimonial Profiles in the leading Jaipur Matrimonials site for Indian and NRI Jaipur Marriage. Join Free &amp; Add your Jaipur Matrimonial Profile Now! Find suitable Indian &amp; NRI Jaipur brides and grooms from our online Jaipur matrimonial and matchmaking services.', 'Jaipur matrimony, Jaipur matrimonials, Jaipur matrimonial, matrimonials, matrimony, matrimony services, online Jaipur matrimonials, Indian marriage, match making, matchmaker, Jaipur profiles, marriage bureau , Jaipur marriage bureau, matchmaking services, matrimonial profiles, Jaipur bride, Jaipur groom, matrimony classified, brides, grooms', 'Jaipur Matrimonials', 'Y', 'jaipur-matrimonials.jpg', 'Jaipur Matrimony\r');
