INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (85, 'Hindu', '', 'RELIGION', '1', 1, '/matrimonials/hindu-matrimonial/', 'Y', 'L1_RE_85', 'Hindus are adherents of Hinduism, a set of religious, philosophical and cultural systems that originated in the Indian subcontinent. Hindu scriptures, which are divided into Sruti (revealed) and Smriti (remembered) lay the foundation of Hindu beliefs which mainly include dharma, karma, ahimsa and samsara.  \n\nHinduism is the world&#039;s third largest religion with more than a billion adherents. Majority of Hindus, nearly 900 million, live in India while others are spread in southern and Southeast Asia.\n\n', 'Hindu Matrimony - Hindu Matrimonial - Hindu Matrimonials - Hindu Marriage - Online Hindu Matrimonials - Matrimonial Services', 'Search Hindu Matrimony, Hindu Matrimonial, Hindu Matrimonials, Hindu Marriage, Hindu Matrimonial Profiles in the leading Hindu Matrimonials site for Indian and NRI Hindu Marriage. Join Free &amp; Add your Hindu Matrimonial Profile Now! Find suitable Indian &amp; NRI Hindu brides and grooms from our online Hindu matrimonial and matchmaking services.', 'Hindu matrimony, Hindu matrimonials, Hindu matrimonial, matrimonials, matrimony, matrimony services, online Hindu matrimonials, Indian marriage, match making, matchmaker, Hindu profiles, marriage bureau , Hindu marriage bureau, matchmaking services, matrimonial profiles, Hindu bride, Hindu groom, matrimony classified, brides, grooms', 'Hindu Matrimonials ', 'Y', 'hindu-matrimonials.jpg', 'Hindu Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (86, 'Muslim', '', 'RELIGION', '2', 1, '/matrimonials/muslim-matrimonial/', 'Y', 'L1_RE_86', 'A Muslim is the one who adheres to the religion of Islam. The female form is Muslimah. The literal meaning of the word is &quot;one who submits (to God)&quot;. They believe that there is only one God, translated in Arabic as Allah. \n\nMuslims may be divided into two sects- SunniÃ¢â‚¬â„¢s and ShiaÃ¢â‚¬â„¢s but Sunni is the largest branch of Islam comprising up to 90% of the total Muslim population of the world. An organized community, they follow one of the 4 schools of law (madhabs) - Hanafi, Maliki, ShafiÃ¢â‚¬â„¢i and Hanbali. \n', 'Muslim Matrimony - Muslim Matrimonial - Muslim Matrimonials -Muslim Marriage - Online Muslim Matrimonials - Matrimonial Services', 'Search Muslim Matrimony, Muslim Matrimonial, Muslim Matrimonials, Muslim Marriage, Muslim Matrimonial Profiles in the leading Muslim Matrimonials site for Indian and NRI Muslim Marriage. Join Free &amp; Add your Muslim Matrimonial Profile Now! Find suitable Indian &amp; NRI Muslim brides and grooms from our online Muslim matrimonial and matchmaking services.', 'Muslim matrimony, Muslim matrimonials, Muslim matrimonial, matrimonials, matrimony, matrimony services, online Muslim matrimonials, Indian marriage, match making, matchmaker, Muslim profiles, marriage bureau , Muslim marriage bureau, matchmaking services, matrimonial profiles, Muslim bride, Muslim groom, matrimony classified, brides, grooms', 'Muslim Matrimonials ', 'Y', 'muslim-matrimonials.jpg', 'Muslim Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (87, 'Christian', '', 'RELIGION', '3', 1, '/matrimonials/christian-matrimonial/', 'Y', 'L1_RE_87', 'A Christian is someone who adheres to Christianity, an Abrahamic, monotheistic, religion based on the life and teachings of Jesus of Nazareth. Christians believe that he was the Messiah (the Christ in Greek) prophesied in the Old Testament/Hebrew Bible, and the Son of God. Most Christians believe in the doctrine of the Trinity (&quot;tri-unity&quot;), a description of God as Father, as Son and as Holy Spirit. This includes Roman Catholicism, Orthodox Christianity and the vast majority of Protestantism. ', 'Christian Matrimony - Christian Matrimonial - Christian Matrimonials -Christian Marriage - Online Christian Matrimonials - Matrimonial Services', 'Search Christian Matrimony, Christian Matrimonial, Christian Matrimonials, Christian Marriage, Christian Matrimonial Profiles in the leading Christian Matrimonials site for Indian and NRI Christian Marriage. Join Free &amp; Add your Christian Matrimonial Profile Now! Find suitable Indian &amp; NRI Christian brides and grooms from our online Christian matrimonial and matchmaking services.', 'Christian matrimony, Christian matrimonials, Christian matrimonial, matrimonials, matrimony, matrimony services, online Christian matrimonials, Indian marriage, match making, matchmaker, Christian profiles, marriage bureau , Christian marriage bureau, matchmaking services, matrimonial profiles, Christian bride, Christian groom, matrimony classified, brides, grooms', 'Christian Matrimonials ', 'Y', 'christian-matrimonials.jpg', 'Christian Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (88, 'Sikh', '', 'RELIGION', '4', 1, '/matrimonials/sikh-matrimonial/', 'Y', 'L1_RE_88', 'A Sikh is an adherent of Sikhism. The term has Sanskrit origin in the term sisya (disciple or learner) or siksa (instruction). \n\nAs per &quot;Rehat Maryada&quot; (the Sikh code of conduct &amp; conventions), a Sikh is &quot;any human being who faithfully believes in One Immortal Being; ten Gurus, from Guru Nanak Dev to Sri Guru Gobind Singh; the Sri Guru Granth Sahib; the utterances and teachings of the ten Gurus and the baptism bequeathed by the tenth Guru; and who does not owe allegiance to any other religion&quot;.\n\n', 'Sikh Matrimony - Sikh Matrimonial - Sikh Matrimonials -Sikh Marriage - Online Sikh Matrimonials - Matrimonial Services', 'Search Sikh Matrimony, Sikh Matrimonial, Sikh Matrimonials, Sikh Marriage, Sikh Matrimonial Profiles in the leading Sikh Matrimonials site for Indian and NRI Sikh Marriage. Join Free &amp; Add your Sikh Matrimonial Profile Now! Find suitable Indian &amp; NRI Sikh brides and grooms from our online Sikh matrimonial and matchmaking services.', 'Sikh matrimony, Sikh matrimonials, Sikh matrimonial, matrimonials, matrimony, matrimony services, online Sikh matrimonials, Indian marriage, match making, matchmaker, Sikh profiles, marriage bureau , Sikh marriage bureau, matchmaking services, matrimonial profiles, Sikh bride, Sikh groom, matrimony classified, brides, grooms', 'Sikh Matrimonials ', 'Y', 'sikh-matrimonials.jpg', 'Sikh Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (89, 'Jain', '', 'RELIGION', '9', 1, '/matrimonials/jain-matrimonial/', 'Y', 'L1_RE_89', 'Jainism, an ancient dharmic religion from India, prescribes a path of non-violence for all forms of living beings in this world. Its philosophy and practice relies on self effort in moving the soul on the spiritual ladder to divine consciousness. \n\nJainism is referred to as Jain Dharma or Shraman Dharma or the religion of Nirgantha by ancient texts. The lineage of 24 enlightened ascetics called tirthankaras culminating with Parshva (9th century BCE) and Mahavira (6th century BCE) revived Jainism.\n\n', 'Jain Matrimony - Jain Matrimonial - Jain Matrimonials -Jain Marriage - Online Jain Matrimonials - Matrimonial Services', 'Search Jain Matrimony, Jain Matrimonial, Jain Matrimonials, Jain Marriage, Jain Matrimonial Profiles in the leading Jain Matrimonials site for Indian and NRI Jain Marriage. Join Free &amp; Add your Jain Matrimonial Profile Now! Find suitable Indian &amp; NRI Jain brides and grooms from our online Jain matrimonial and matchmaking services.', 'Jain matrimony, Jain matrimonials, Jain matrimonial, matrimonials, matrimony, matrimony services, online Jain matrimonials, Indian marriage, match making, matchmaker, Jain profiles, marriage bureau , Jain marriage bureau, matchmaking services, matrimonial profiles, Jain bride, Jain groom, matrimony classified, brides, grooms', 'Jain Matrimonials ', 'Y', 'jain-matrimonials.jpg', 'Jain Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (90, 'Buddhist', '', 'RELIGION', '7', 1, '/matrimonials/buddhist-matrimonial/', 'Y', 'L1_RE_90', 'Buddhists are the adherents of Buddhism. Buddhism is a path of salvation which is attained through insight into the ultimate nature of reality. Buddhism encompasses an array of traditions, beliefs and practices that are primarily based on the teachings of Siddhartha Gautama, who is commonly known as the Buddha.\n\nThey use various methods to liberate themselves and others from the suffering of worldly existence by following ethical conduct, meditation, devotional practices and other such methods. \n', 'Buddhist Matrimony - Buddhist Matrimonial - Buddhist Matrimonials -Buddhist Marriage - Online Buddhist Matrimonials - Matrimonial Services', 'Search Buddhist Matrimony, Buddhist Matrimonial, Buddhist Matrimonials, Buddhist Marriage, Buddhist Matrimonial Profiles in the leading Buddhist Matrimonials site for Indian and NRI Buddhist Marriage. Join Free &amp; Add your Buddhist Matrimonial Profile Now! Find suitable Indian &amp; NRI Buddhist brides and grooms from our online Buddhist matrimonial and matchmaking services.', 'Buddhist matrimony, Buddhist matrimonials, Buddhist matrimonial, matrimonials, matrimony, matrimony services, online Buddhist matrimonials, Indian marriage, match making, matchmaker, Buddhist profiles, marriage bureau , Buddhist marriage bureau, matchmaking services, matrimonial profiles, Buddhist bride, Buddhist groom, matrimony classified, brides, grooms', 'Buddhist Matrimonials ', 'Y', 'buddhist-matrimonials.jpg', 'Buddhist Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (91, 'Parsi', '', 'RELIGION', '5', 1, '/matrimonials/parsi-matrimonial/', 'Y', 'L1_RE_91', 'Parsis are the people who are said to hail from the two of the Zoroastrian communities, one living in South Asia and the other belonging to the Irani community. Parsis in India are said to have their habitat mainly in the regions of Gujarat and are known to be Gujaratis. Matrimony in Parsis takes place according to the Gujarati traditions and cultures in India. Their families are known to be highly educated and have been seen contributing to the development of different fields of the Indian society. ', 'Parsi Matrimony - Parsi Matrimonial - Parsi Matrimonials - Parsi Marriage - Online Parsi Matrimonials - Matrimonial Services', 'Search Parsi Matrimony, Parsi Matrimonial, Parsi Matrimonials, Parsi Marriage, Parsi Matrimonial Profiles in the leading Parsi Matrimonials site for Indian and NRI Parsi Marriage. Join Free & Add your Parsi Matrimonial Profile Now! Find suitable Indian & NRI Parsi brides and grooms from our online Parsi matrimonial and matchmaking services.', 'Parsi matrimony, Parsi matrimonials, Parsi matrimonial, matrimonials, matrimony, matrimony services, online Parsi matrimonials, Indian marriage, match making, matchmaker, Parsi profiles, marriage bureau , Parsi marriage bureau, matchmaking services, matrimonial profiles, Parsi bride, Parsi groom, matrimony classified, brides, grooms', 'Parsi Matrimonials ', 'N', 'parsi-matrimonials.jpg', 'parsi matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (92, 'Jewish', '', 'RELIGION', '6', 1, '/matrimonials/jewish-matrimonial/', 'Y', 'L1_RE_92', 'Jewish people believe in Judaism not only as their religion but also as a philosophy and way of life. Jewish population is found mostly in countries like United States, Argentina, Israel and South Africa.\r\n\r\nLike in all other religions in India, marriage is an extremely important event of life for Jewish people as well. Jewish matrimonial is solemnized under a wedding canopy called chupah which symbolizes a happy house. Sometimes, grooms wear Kittel, a white knee-length garment during the wedding.', 'Jewish Matrimony - Jewish Matrimonial - Jewish Matrimonials - Jewish Marriage - Online Jewish Matrimonials - Matrimonial Services', 'Search Jewish Matrimony, Jewish Matrimonial, Jewish Matrimonials, Jewish Marriage, Jewish Matrimonial Profiles in the leading Jewish Matrimonials site for Indian and NRI Jewish Marriage. Join Free & Add your Jewish Matrimonial Profile Now! Find suitable Indian & NRI Jewish brides and grooms from our online Jewish matrimonial and matchmaking services.', 'Jewish matrimony, Jewish matrimonials, Jewish matrimonial, matrimonials, matrimony, matrimony services, online Jewish matrimonials, Indian marriage, match making, matchmaker, Jewish profiles, marriage bureau , Jewish marriage bureau, matchmaking services, matrimonial profiles, Jewish bride, Jewish groom, matrimony classified, brides, grooms', 'Jewish Matrimonials ', 'N', 'jewish-matrimonials.jpg', 'jewish matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (93, 'Hindu: Brahmin', 'Brahmin', 'CASTE', '25', 1, '/matrimonials/brahmin-matrimonial/', 'Y', 'L1_CA_93', 'Brahmin, the class of educators, scholars and preachers, occupies the top position among the four varnas of Hinduism. These families mostly come under the priestly class and are divided into many castes and sub- castes. Brahmins follow the principles of Brahmanism and Sanatana Dharma, whose reflection can be found in most of the Hindu religions. Brahmanas are primarily supposed to perform three of the six occupational duties, namely, studying the Vedas, worshipping the Diety and giving charity. ', 'Brahmin Matrimony - Brahmin Matrimonial - Brahmin Matrimonials -Brahmin Marriage - Online Brahmin Matrimonials - Matrimonial Services', 'Search Brahmin Matrimony, Brahmin Matrimonial, Brahmin Matrimonials, Brahmin Marriage, Brahmin Matrimonial Profiles in the leading Brahmin Matrimonials site for Indian and NRI Brahmin Marriage. Join Free &amp; Add your Brahmin Matrimonial Profile Now! Find suitable Indian &amp; NRI Brahmin brides and grooms from our online Brahmin matrimonial and matchmaking services.', 'Brahmin matrimony, Brahmin matrimonials, Brahmin matrimonial, matrimonials, matrimony, matrimony services, online Brahmin matrimonials, Indian marriage, match making, matchmaker, Brahmin profiles, marriage bureau , Brahmin marriage bureau, matchmaking services, matrimonial profiles, Brahmin bride, Brahmin groom, matrimony classified, brides, grooms', 'Brahmin Matrimonials ', 'Y', 'brahmin-matrimonials.jpg', 'Brahmin Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (94, 'Muslim: Sunni', 'Sunni', 'CASTE', '152', 1, '/matrimonials/sunni-matrimonial/', 'Y', 'L1_CA_94', 'Sunni Islam, also referred to as Ahl as- Sunnah waÃ¢â‚¬â„¢l-JamÃ„ÂÃ¢â‚¬Ëœah or Ahl as-Sunnah, constitutes the largest Islamic denomination. The word Sunni has originated from the word Sunnah, which means the words and actions or example of the Islamic Prophet Muhammad. The term Sunni was established by the majority Muslim community after the minority of Muslims drifted to create the Shia sect. Sunni Islam comprises of around 90% of the Muslims and they consider Sahih al-Bukhari, as the most important hadith. ', 'Sunni Matrimony - Sunni Matrimonial - Sunni Matrimonials -Sunni Marriage - Online Sunni Matrimonials - Matrimonial Services', 'Search Sunni Matrimony, Sunni Matrimonial, Sunni Matrimonials, Sunni Marriage, Sunni Matrimonial Profiles in the leading Sunni Matrimonials site for Indian and NRI Sunni Marriage. Join Free &amp; Add your Sunni Matrimonial Profile Now! Find suitable Indian &amp; NRI Sunni brides and grooms from our online Sunni matrimonial and matchmaking services.', 'Sunni matrimony, Sunni matrimonials, Sunni matrimonial, matrimonials, matrimony, matrimony services, online Sunni matrimonials, Indian marriage, match making, matchmaker, Sunni profiles, marriage bureau , Sunni marriage bureau, matchmaking services, matrimonial profiles, Sunni bride, Sunni groom, matrimony classified, brides, grooms', 'Sunni Matrimonials ', 'Y', 'sunni-matrimonials.jpg', 'Sunni Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (95, 'Hindu: Kayastha', 'Kayastha', 'CASTE', '76', 1, '/matrimonials/kayastha-matrimonial/', 'Y', 'L1_CA_95', 'Kayasthas belong to the ethnic group of Hindus and are known to be the only direct descendants of a Vedic god. According to Vedas, Kayasthas enjoys a dual caste status, as Brahmins and Kshatriyas. They are mainly employed in the writing jobs. Kayasthas are basically the residents of the Northern India and are said to be the sub- sects of Brahmins. Kayastha is one of the religious castes, whose mention can be found in the many of the Vedic Hindu religious texts like Shrutis, Shrutis and Puranas. ', 'Kayastha Matrimony - Kayastha Matrimonial - Kayastha Matrimonials -Kayastha Marriage - Online Kayastha Matrimonials - Matrimonial Services', 'Search Kayastha Matrimony, Kayastha Matrimonial, Kayastha Matrimonials, Kayastha Marriage, Kayastha Matrimonial Profiles in the leading Kayastha Matrimonials site for Indian and NRI Kayastha Marriage. Join Free &amp; Add your Kayastha Matrimonial Profile Now! Find suitable Indian &amp; NRI Kayastha brides and grooms from our online Kayastha matrimonial and matchmaking services.', 'Kayastha matrimony, Kayastha matrimonials, Kayastha matrimonial, matrimonials, matrimony, matrimony services, online Kayastha matrimonials, Indian marriage, match making, matchmaker, Kayastha profiles, marriage bureau , Kayastha marriage bureau, matchmaking services, matrimonial profiles, Kayastha bride, Kayastha groom, matrimony classified, brides, grooms', 'Kayastha Matrimonials ', 'Y', 'kayastha-matrimonials.jpg', 'Kayastha Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (96, 'Hindu: Rajput', 'Rajput', 'CASTE', '116', 1, '/matrimonials/rajput-matrimonial/', 'Y', 'L1_CA_96', 'Rajputs, the sons-of-kings, are a sub-group of Hindu Kshatriya Varna. They are broadly divided into three major Vansh and 36 major clans including the Kumarpala Charita of Jayasimha, and Prithviraj Raso of Chand Bardai. Rajputs are highly dominant and royal warriors of the Indian Subcontinent and have ruled more than four hundred of the estimated six hundred princely states. Rajasthan is the hub of most of the Rajputs, who either serve the Indian army or are employed in their own business. ', 'Rajput Matrimony - Rajput Matrimonial - Rajput Matrimonials -Rajput Marriage - Online Rajput Matrimonials - Matrimonial Services', 'Search Rajput Matrimony, Rajput Matrimonial, Rajput Matrimonials, Rajput Marriage, Rajput Matrimonial Profiles in the leading Rajput Matrimonials site for Indian and NRI Rajput Marriage. Join Free &amp; Add your Rajput Matrimonial Profile Now! Find suitable Indian &amp; NRI Rajput brides and grooms from our online Rajput matrimonial and matchmaking services.', 'Rajput matrimony, Rajput matrimonials, Rajput matrimonial, matrimonials, matrimony, matrimony services, online Rajput matrimonials, Indian marriage, match making, matchmaker, Rajput profiles, marriage bureau , Rajput marriage bureau, matchmaking services, matrimonial profiles, Rajput bride, Rajput groom, matrimony classified, brides, grooms', 'Rajput Matrimonials ', 'Y', 'rajput-matrimonials.jpg', 'Rajput Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (97, 'Hindu: Maratha', 'Maratha', 'CASTE', '94', 1, '/maratha-matrimony-matrimonials', 'Y', 'L1_CA_97', 'Marathas are known to be the famous warriors of India. There are three related usages of Maratha: within the Marathi speaking region, Maratha is described as the dominant caste; outside Maharashtra, it can be referred as the entire regional population of Marathi-speaking people and historically, it is described as the Maratha Empire founded by Shivaji in the 17th century and then continued by his successors. The Maratha caste mainly comprises of rural cultivators, landowners, and soldiers. ', 'Maratha Matrimony - Maratha Matrimonial - Maratha Matrimonials -Maratha Marriage - Online Maratha Matrimonials - Matrimonial Services', 'Search Maratha Matrimony, Maratha Matrimonial, Maratha Matrimonials, Maratha Marriage, Maratha Matrimonial Profiles in the leading Maratha Matrimonials site for Indian and NRI Maratha Marriage. Join Free &amp; Add your Maratha Matrimonial Profile Now! Find suitable Indian &amp; NRI Maratha brides and grooms from our online Maratha matrimonial and matchmaking services.', 'Maratha matrimony, Maratha matrimonials, Maratha matrimonial, matrimonials, matrimony, matrimony services, online Maratha matrimonials, Indian marriage, match making, matchmaker, Maratha profiles, marriage bureau , Maratha marriage bureau, matchmaking services, matrimonial profiles, Maratha bride, Maratha groom, matrimony classified, brides, grooms', 'Maratha Matrimonials ', 'Y', 'maratha-matrimonials.jpg', 'Maratha Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (98, 'Hindu: Khatri', 'Khatri', 'CASTE', '78', 1, '/matrimonials/khatri-matrimonial/', 'Y', 'L1_CA_98', 'Khatri is the Punjabi adaptation of Kshatriya, a warrior tribe hailing from northern subcontinent. Traditionally, as administrators and rulers, Kshatriyas were assigned with protecting dharma, and serving humanity and world. However, with course of time, they also expanded into other occupations. The origin of the Khatri community is from Taxila, Potohar and Majha regions of the Punjab. Most of the Khatris are situated in northern parts of the country like Delhi, Chandigarh and Uttar Pradesh. ', 'Khatri Matrimony - Khatri Matrimonial - Khatri Matrimonials -Khatri Marriage - Online Khatri Matrimonials - Matrimonial Services', 'Search Khatri Matrimony, Khatri Matrimonial, Khatri Matrimonials, Khatri Marriage, Khatri Matrimonial Profiles in the leading Khatri Matrimonials site for Indian and NRI Khatri Marriage. Join Free &amp; Add your Khatri Matrimonial Profile Now! Find suitable Indian &amp; NRI Khatri brides and grooms from our online Khatri matrimonial and matchmaking services.', 'Khatri matrimony, Khatri matrimonials, Khatri matrimonial, matrimonials, matrimony, matrimony services, online Khatri matrimonials, Indian marriage, match making, matchmaker, Khatri profiles, marriage bureau , Khatri marriage bureau, matchmaking services, matrimonial profiles, Khatri bride, Khatri groom, matrimony classified, brides, grooms', 'Khatri Matrimonials ', 'Y', 'khatri-matrimonials.jpg', 'Khatri Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (99, 'Hindu: Aggarwal', 'Aggarwal', 'CASTE', '17', 1, '/matrimonials/agarwal-matrimonial/', 'Y', 'L1_CA_99', 'Aggarwal  is an influential caste of India, following the Hindu culture. The Aggarwals were traditionally a trading community in northern India, though these days they also follow other professions. Aggarwal, literally, means the people of Agroha, a city in ancient Kuru Panchala, near Hisar in Haryana region, which was founded by Agrasena. They are known to be playing significant roles in the economic development of the country, by establishing successful business firms in various industries. ', 'Aggarwal Matrimony - Aggarwal Matrimonial - Aggarwal Matrimonials -Aggarwal Marriage - Online Aggarwal Matrimonials - Matrimonial Services', 'Search Aggarwal Matrimony, Aggarwal Matrimonial, Aggarwal Matrimonials, Aggarwal Marriage, Aggarwal Matrimonial Profiles in the leading Aggarwal Matrimonials site for Indian and NRI Aggarwal Marriage. Join Free &amp; Add your Aggarwal Matrimonial Profile Now! Find suitable Indian &amp; NRI Aggarwal brides and grooms from our online Aggarwal matrimonial and matchmaking services.', 'Aggarwal matrimony, Aggarwal matrimonials, Aggarwal matrimonial, matrimonials, matrimony, matrimony services, online Aggarwal matrimonials, Indian marriage, match making, matchmaker, Aggarwal profiles, marriage bureau , Aggarwal marriage bureau, matchmaking services, matrimonial profiles, Aggarwal bride, Aggarwal groom, matrimony classified, brides, grooms', 'Aggarwal Matrimonials ', 'Y', 'agarwal-matrimonials.jpg', 'Agarwal Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (100, 'Hindu: Arora', 'Arora', 'CASTE', '18', 1, '/matrimonials/arora-matrimonials/', 'Y', 'L1_CA_100', 'Aroras, an Indo-Aryan community of Punjab and Sindh, are related to Brahmins. Most of the Aroras living in India have their bases in Punjab, Haryana, Himachal Pradesh, Delhi, Jammu, Rajasthan, Uttar Pradesh, Uttarakhand and Gujarat. They are known to be the educated class of the society and have many nobels and medallists in their clan. Aroras are very similar to Khatris in the type of rituals, occupations and traditional practises they follow and intermarriages are quite common between them. ', 'Arora Matrimony - Arora Matrimonial - Arora Matrimonials -Arora Marriage - Online Arora Matrimonials - Matrimonial Services', 'Search Arora Matrimony, Arora Matrimonial, Arora Matrimonials, Arora Marriage, Arora Matrimonial Profiles in the leading Arora Matrimonials site for Indian and NRI Arora Marriage. Join Free &amp; Add your Arora Matrimonial Profile Now! Find suitable Indian &amp; NRI Arora brides and grooms from our online Arora matrimonial and matchmaking services.', 'Arora matrimony, Arora matrimonials, Arora matrimonial, matrimonials, matrimony, matrimony services, online Arora matrimonials, Indian marriage, match making, matchmaker, Arora profiles, marriage bureau , Arora marriage bureau, matchmaking services, matrimonial profiles, Arora bride, Arora groom, matrimony classified, brides, grooms', 'Arora Matrimonials ', 'Y', 'arora-matrimonials.jpg', 'Arora Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (101, 'Buddhist', 'Buddhist', 'CASTE', '1', 1, '/matrimonials/buddhist-matrimonial/', 'N', 'L1_CA_101', 'Buddhism is the religion practiced by Buddhists. They follow the path of salvation, which can be achieved by gaining an insight into the ultimate reality of the nature. The religion is a collection of different believes and practices, which mainly hail from the teachings given by the Siddhartha Gautama, popularly known as Buddha. Buddhists use various ethics, ceremonies, devotional and meditation practices to set themselves free from the outer world, its sufferings and from the cycle of life. ', 'Buddhist Matrimony - Buddhist Matrimonial - Buddhist Matrimonials -Buddhist Marriage - Online Buddhist Matrimonials - Matrimonial Services', 'Search Buddhist Matrimony, Buddhist Matrimonial, Buddhist Matrimonials, Buddhist Marriage, Buddhist Matrimonial Profiles in the leading Buddhist Matrimonials site for Indian and NRI Buddhist Marriage. Join Free &amp; Add your Buddhist Matrimonial Profile Now! Find suitable Indian &amp; NRI Buddhist brides and grooms from our online Buddhist matrimonial and matchmaking services.', 'Buddhist matrimony, Buddhist matrimonials, Buddhist matrimonial, matrimonials, matrimony, matrimony services, online Buddhist matrimonials, Indian marriage, match making, matchmaker, Buddhist profiles, marriage bureau , Buddhist marriage bureau, matchmaking services, matrimonial profiles, Buddhist bride, Buddhist groom, matrimony classified, brides, grooms', 'Buddhist Matrimonials ', 'N', 'buddhist-matrimonials.jpg', 'buddhist matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (102, 'Hindu: Kshatriya', 'Kshatriya', 'CASTE', '82', 1, '/matrimonials/kshatriya-matrimonial/', 'Y', 'L1_CA_102', 'Kshatriya- the warriors, is one of the four varnas or social orders in the Hindu culture. They represent the military and ruling order of the traditional Vedic-Hindu social system as outlined by the Vedas and the Laws of Manu. In ancient Vedic society, the position of Kshatriya was achieved on the merits of a person&#039;s aptitude (guna), conduct (karma), and nature (swabhava). The earliest Vedic literature listed the Kshatriya as second in rank, after the Brahmins, before the Vaisya and the Sudra. ', 'Kshatriya Matrimony - Kshatriya Matrimonial - Kshatriya Matrimonials -Kshatriya Marriage - Online Kshatriya Matrimonials - Matrimonial Services', 'Search Kshatriya Matrimony, Kshatriya Matrimonial, Kshatriya Matrimonials, Kshatriya Marriage, Kshatriya Matrimonial Profiles in the leading Kshatriya Matrimonials site for Indian and NRI Kshatriya Marriage. Join Free &amp; Add your Kshatriya Matrimonial Profile Now! Find suitable Indian &amp; NRI Kshatriya brides and grooms from our online Kshatriya matrimonial and matchmaking services.', 'Kshatriya matrimony, Kshatriya matrimonials, Kshatriya matrimonial, matrimonials, matrimony, matrimony services, online Kshatriya matrimonials, Indian marriage, match making, matchmaker, Kshatriya profiles, marriage bureau , Kshatriya marriage bureau, matchmaking services, matrimonial profiles, Kshatriya bride, Kshatriya groom, matrimony classified, brides, grooms', 'Kshatriya Matrimonials ', 'Y', 'kshatriya-matrimonials.jpg', 'Kshatriya Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (103, 'Jain: Shwetamber', 'Shwetamber', 'CASTE', '175', 1, '/matrimonials/shwetamber-matrimonial/', 'Y', 'L1_CA_103', 'Shwetambara and Digambar are the two main sects of Jainism. Shwetambara means &quot;white-clad&quot; that describes its ascetics&#039; practice of wearing white clothes, which differentiates it from the Digambars (&quot;sky clad&quot;), whose ascetic practitioners wear no clothes. The Shwetambaras, follows the lineage of Acharya Sthulibhadra Suri. There are two sub-sects in Shwetambara, practitioners who worship images in temples- the Murtipujak or Mandirmargi and those who do not- the Sthanakvasis and the Terapanthis.', 'Shwetamber Matrimony - Shwetamber Matrimonial - Shwetamber Matrimonials -Shwetamber Marriage - Online Shwetamber Matrimonials - Matrimonial Services', 'Search Shwetamber Matrimony, Shwetamber Matrimonial, Shwetamber Matrimonials, Shwetamber Marriage, Shwetamber Matrimonial Profiles in the leading Shwetamber Matrimonials site for Indian and NRI Shwetamber Marriage. Join Free &amp; Add your Shwetamber Matrimonial Profile Now! Find suitable Indian &amp; NRI Shwetamber brides and grooms from our online Shwetamber matrimonial and matchmaking services.', 'Shwetamber matrimony, Shwetamber matrimonials, Shwetamber matrimonial, matrimonials, matrimony, matrimony services, online Shwetamber matrimonials, Indian marriage, match making, matchmaker, Shwetamber profiles, marriage bureau , Shwetamber marriage bureau, matchmaking services, matrimonial profiles, Shwetamber bride, Shwetamber groom, matrimony classified, brides, grooms', 'Shwetamber Matrimonials ', 'Y', 'shwetamber-matrimonials.jpg', 'Shwetamber Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (104, 'Hindu: Yadav', 'Yadav', 'CASTE', '146', 1, '/matrimonials/yadav-matrimonial/', 'Y', 'L1_CA_104', 'Yadavas are an Indian caste that traces origin from Yadu. Yadavs, generally follow the Vaishnav traditions and practice believes of the Dharmic religion. They have been mentioned as one of the panchjanya tribes in ancient Vedic texts. Historically, particularly with reference to the Vedic Period, the Yadavs were recognized for their bravery and diplomatic wisdom. Yadavs are known to be &quot;naturally&quot; inclined to fight and to govern. The people with Yadav caste are mostly found in Nepal and India. ', 'Yadav Matrimony - Yadav Matrimonial - Yadav Matrimonials -Yadav Marriage - Online Yadav Matrimonials - Matrimonial Services', 'Search Yadav Matrimony, Yadav Matrimonial, Yadav Matrimonials, Yadav Marriage, Yadav Matrimonial Profiles in the leading Yadav Matrimonials site for Indian and NRI Yadav Marriage. Join Free &amp; Add your Yadav Matrimonial Profile Now! Find suitable Indian &amp; NRI Yadav brides and grooms from our online Yadav matrimonial and matchmaking services.', 'Yadav matrimony, Yadav matrimonials, Yadav matrimonial, matrimonials, matrimony, matrimony services, online Yadav matrimonials, Indian marriage, match making, matchmaker, Yadav profiles, marriage bureau , Yadav marriage bureau, matchmaking services, matrimonial profiles, Yadav bride, Yadav groom, matrimony classified, brides, grooms', 'Yadav Matrimonials ', 'Y', 'yadav-matrimonials.jpg', 'Yadav Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (105, 'Hindu: Sindhi', 'Sindhi', 'CASTE', '123', 1, '/matrimonials/sindhi-matrimonial/', 'Y', 'L1_CA_105', 'Sindhis are a socio-ethnic group originating from Sindh, a province of Pakistan. Sindhis who reside in Pakistan belong to various religious denominations including Muslim, Zorastrian, Hindus and Christians. After the Partition of India, a large number of Indian Muslim refugees (Muhajirs) flocked into Pakistan and settled in the prosperous Sindh region and Sindhi Hindus migrated to India in huge numbers. Sindhi culture is highly influenced from Sufism and respects Jhulelal, the Sufi pioneer. ', 'Sindhi Matrimony - Sindhi Matrimonial - Sindhi Matrimonials -Sindhi Marriage - Online Sindhi Matrimonials - Matrimonial Services', 'Search Sindhi Matrimony, Sindhi Matrimonial, Sindhi Matrimonials, Sindhi Marriage, Sindhi Matrimonial Profiles in the leading Sindhi Matrimonials site for Indian and NRI Sindhi Marriage. Join Free &amp; Add your Sindhi Matrimonial Profile Now! Find suitable Indian &amp; NRI Sindhi brides and grooms from our online Sindhi matrimonial and matchmaking services.', 'Sindhi matrimony, Sindhi matrimonials, Sindhi matrimonial, matrimonials, matrimony, matrimony services, online Sindhi matrimonials, Indian marriage, match making, matchmaker, Sindhi profiles, marriage bureau , Sindhi marriage bureau, matchmaking services, matrimonial profiles, Sindhi bride, Sindhi groom, matrimony classified, brides, grooms', 'Sindhi Matrimonials ', 'Y', 'sindhi-matrimonials.jpg', 'Sindhi Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (106, 'Hindu: Bania', 'Bania', 'CASTE', '20', 1, '/matrimonials/bania-matrimonial/', 'Y', 'L1_CA_106', 'Bania is a general term that is used to refer to a diverse set of Hindu communities. It is derived from the Sanskrit word Banijya, which means trade and commerce. The modern usage of the term has been popularized by the Rajputs. Generally, Agarwals are considered as one of the largest and most influential of the Bania communities from northern India. Other large communities from the region include Khandelwals, Oswals and Parwars. Also, the merchant community of Gujarat is also known as Banias. ', 'Bania Matrimony - Bania Matrimonial - Bania Matrimonials -Bania Marriage - Online Bania Matrimonials - Matrimonial Services', 'Search Bania Matrimony, Bania Matrimonial, Bania Matrimonials, Bania Marriage, Bania Matrimonial Profiles in the leading Bania Matrimonials site for Indian and NRI Bania Marriage. Join Free &amp; Add your Bania Matrimonial Profile Now! Find suitable Indian &amp; NRI Bania brides and grooms from our online Bania matrimonial and matchmaking services.', 'Bania matrimony, Bania matrimonials, Bania matrimonial, matrimonials, matrimony, matrimony services, online Bania matrimonials, Indian marriage, match making, matchmaker, Bania profiles, marriage bureau , Bania marriage bureau, matchmaking services, matrimonial profiles, Bania bride, Bania groom, matrimony classified, brides, grooms', 'Bania Matrimonials ', 'Y', 'bania-matrimonials.jpg', 'Bania Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (107, 'Hindu: Scheduled Caste', 'Scheduled Caste', 'CASTE', '121', 1, '/matrimonials/scheduled-caste-matrimonial/', 'Y', 'L1_CA_107', 'Scheduled Castes and Scheduled Tribes are Indian population groupings that are, explicitly recognized by the Constitution of India. These sections were previously called the &quot;depressed classes&quot; by the British, and were known as untouchables. Some SCÃ¢â‚¬â„¢s in India are also called as Dalits and some ST people are also referred to as Adivasis. The ratio of Scheduled Castes and Scheduled Tribes in the India has been rising since independence. They also have many reservation privileges in the country.  ', 'Scheduled Caste Matrimony - Scheduled Caste Matrimonial - Scheduled Caste Matrimonials -Scheduled Caste Marriage - Online Scheduled Caste Matrimonials - Matrimonial Services', 'Search Scheduled Caste Matrimony, Scheduled Caste Matrimonial, Scheduled Caste Matrimonials, Scheduled Caste Marriage, Scheduled Caste Matrimonial Profiles in the leading Scheduled Caste Matrimonials site for Indian and NRI Scheduled Caste Marriage. Join Free &amp; Add your Scheduled Caste Matrimonial Profile Now! Find suitable Indian &amp; NRI Scheduled Caste brides and grooms from our online Scheduled Caste matrimonial and matchmaking services.', 'Scheduled Caste matrimony, Scheduled Caste matrimonials, Scheduled Caste matrimonial, matrimonials, matrimony, matrimony services, online Scheduled Caste matrimonials, Indian marriage, match making, matchmaker, Scheduled Caste profiles, marriage bureau , Scheduled Caste marriage bureau, matchmaking services, matrimonial profiles, Scheduled Caste bride, Scheduled Caste groom, matrimony classified, brides, grooms', 'Scheduled Caste Matrimonials ', 'Y', 'scheduled-caste-matrimonials.jpg', 'Scheduled Caste Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (108, 'Hindu: Nair', 'Nair', 'CASTE', '103', 1, '/matrimonials/nair-matrimonial/', 'Y', 'L1_CA_108', 'Nair is the name of a Hindu upward caste from Kerala. They are, basically, a Kshatriya caste belonging to the Nagavanshi order and are also called Nayars. Nairs have always been prominent politicians, government servants, and medical experts and have significant positions in education and law. They comprise of one of the most important sections among the Hindus of Kerala. They also contribute as the rulers, land owners and warriors to the land of kerela and are known for their martial history. ', 'Nair Matrimony - Nair Matrimonial - Nair Matrimonials -Nair Marriage - Online Nair Matrimonials - Matrimonial Services', 'Search Nair Matrimony, Nair Matrimonial, Nair Matrimonials, Nair Marriage, Nair Matrimonial Profiles in the leading Nair Matrimonials site for Indian and NRI Nair Marriage. Join Free &amp; Add your Nair Matrimonial Profile Now! Find suitable Indian &amp; NRI Nair brides and grooms from our online Nair matrimonial and matchmaking services.', 'Nair matrimony, Nair matrimonials, Nair matrimonial, matrimonials, matrimony, matrimony services, online Nair matrimonials, Indian marriage, match making, matchmaker, Nair profiles, marriage bureau , Nair marriage bureau, matchmaking services, matrimonial profiles, Nair bride, Nair groom, matrimony classified, brides, grooms', 'Nair Matrimonials ', 'Y', 'nair-matrimonials.jpg', 'Nair Matrimony\r');
