INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (110, 'Hindu: Jat', 'Jat', 'CASTE', '71', 1, '/matrimonials/jat-matrimonial/', 'Y', 'L1_CA_110', 'The Jat or Jatt people are an ethnic group residing largely in the Punjab region of northern India, Pakistan and in international countries like US, Canada, and UK. Jats in Pakistan are mostly found in Punjab. Jats in India are largely found in, Haryana, Punjab, Uttar Pradesh and Rajasthan. They were referred as martial race by the British. The Jat people are one of the most affluent groups in India on a per-capita basis. Traditionally also they have been a predominant political class in Punjab.', 'Jat Matrimony - Jat Matrimonial - Jat Matrimonials -Jat Marriage - Online Jat Matrimonials - Matrimonial Services', 'Search Jat Matrimony, Jat Matrimonial, Jat Matrimonials, Jat Marriage, Jat Matrimonial Profiles in the leading Jat Matrimonials site for Indian and NRI Jat Marriage. Join Free &amp; Add your Jat Matrimonial Profile Now! Find suitable Indian &amp; NRI Jat brides and grooms from our online Jat matrimonial and matchmaking services.', 'Jat matrimony, Jat matrimonials, Jat matrimonial, matrimonials, matrimony, matrimony services, online Jat matrimonials, Indian marriage, match making, matchmaker, Jat profiles, marriage bureau , Jat marriage bureau, matchmaking services, matrimonial profiles, Jat bride, Jat groom, matrimony classified, brides, grooms', 'Jat Matrimonials ', 'Y', 'jat-matrimonials.jpg', 'Jat Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (111, 'Christian: Catholic - Roman', 'Catholic - Roman', 'CASTE', '270', 1, '/roman-catholic-matrimony-matrimonials', 'Y', 'L1_CA_111', 'Catholic is a term derived from the Greek adjective katholikos, i.e., universal. In the context of Christian ecclesiology, Catholic has a strong history and several usages. For few, the term &quot;Catholic Church&quot; refers to the church in full communion with the Bishop of Rome, made up of the Latin Rite and the 22 Eastern Catholic Churches. Sometimes, Protestants use the term &quot;Catholic Church&quot; to refer to all believers in Jesus Christ across the world and the ages, regardless of denominational link', 'Roman Catholic Matrimony - Roman Catholic Matrimonial - Roman Catholic Matrimonials -Roman Catholic Marriage - Online Roman Catholic Matrimonials - Matrimonial Services', 'Search Roman Catholic Matrimony, Roman Catholic Matrimonial, Roman Catholic Matrimonials, Roman Catholic Marriage, Roman Catholic Matrimonial Profiles in the leading Roman Catholic Matrimonials site for Indian and NRI Roman Catholic Marriage. Join Free &amp; Add your Roman Catholic Matrimonial Profile Now! Find suitable Indian &amp; NRI Roman Catholic brides and grooms from our online Roman Catholic matrimonial and matchmaking services.', 'Roman Catholic matrimony, Roman Catholic matrimonials, Roman Catholic matrimonial, matrimonials, matrimony, matrimony services, online Roman Catholic matrimonials, Indian marriage, match making, matchmaker, Roman Catholic profiles, marriage bureau , Roman Catholic marriage bureau, matchmaking services, matrimonial profiles, Roman Catholic bride, Roman Catholic groom, matrimony classified, brides, grooms', 'Roman Catholic Matrimonials ', 'Y', 'roman-catholic-matrimonials.jpg', 'Roman Catholic Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (112, 'Hindu: Patel', 'Patel', 'CASTE', '109', 1, '/matrimonials/patel-matrimonial/', 'Y', 'L1_CA_112', 'Patel is a surname used by some of the agrarian castes predominant in the Western Indian state of Gujarat. Patel literally means the head or the chief of the village and same is the nature carried by the people with Patel as their surnames. Patel is one of the most common surnames of India and is found primarily in the Indian states of Gujarat, Rajasthan, Madhya Pradesh, Uttar Pradesh, and Orissa. Patel name is given by princely rulers in Gujarat and is derived from Patlikh, the record keeper. ', 'Patel Matrimony - Patel Matrimonial - Patel Matrimonials -Patel Marriage - Online Patel Matrimonials - Matrimonial Services', 'Search Patel Matrimony, Patel Matrimonial, Patel Matrimonials, Patel Marriage, Patel Matrimonial Profiles in the leading Patel Matrimonials site for Indian and NRI Patel Marriage. Join Free &amp; Add your Patel Matrimonial Profile Now! Find suitable Indian &amp; NRI Patel brides and grooms from our online Patel matrimonial and matchmaking services.', 'Patel matrimony, Patel matrimonials, Patel matrimonial, matrimonials, matrimony, matrimony services, online Patel matrimonials, Indian marriage, match making, matchmaker, Patel profiles, marriage bureau , Patel marriage bureau, matchmaking services, matrimonial profiles, Patel bride, Patel groom, matrimony classified, brides, grooms', 'Patel Matrimonials ', 'Y', 'patel-matrimonials.jpg', 'Patel Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (113, 'Jain: Digamber', 'Digamber', 'CASTE', '174', 1, '/matrimonials/digamber-matrimonial/', 'Y', 'L1_CA_113', 'Digambar is a sect of Jainism. This sect has influences of both indo-Aryan as well as Dravidian culture and languages. Digambar JainÃ¢â‚¬â„¢s are scattered all over India, but have dominant influence in South-West India in the states of Maharashtra and Karnataka. The popular surnames of this sect are Shah, Singhal, Khandelwal, and so on. It is a rich and business oriented community of India.\n\nThey support arranged marriage within the sect and find life partners through reference of family relatives. \n', 'Digamber Matrimony - Digamber Matrimonial - Digamber Matrimonials -Digamber Marriage - Online Digamber Matrimonials - Matrimonial Services', 'Search Digamber Matrimony, Digamber Matrimonial, Digamber Matrimonials, Digamber Marriage, Digamber Matrimonial Profiles in the leading Digamber Matrimonials site for Indian and NRI Digamber Marriage. Join Free &amp; Add your Digamber Matrimonial Profile Now! Find suitable Indian &amp; NRI Digamber brides and grooms from our online Digamber matrimonial and matchmaking services.', 'Digamber matrimony, Digamber matrimonials, Digamber matrimonial, matrimonials, matrimony, matrimony services, online Digamber matrimonials, Indian marriage, match making, matchmaker, Digamber profiles, marriage bureau , Digamber marriage bureau, matchmaking services, matrimonial profiles, Digamber bride, Digamber groom, matrimony classified, brides, grooms', 'Digamber Matrimonials ', 'Y', 'digamber-matrimonials.jpg', 'Digamber Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (114, 'Sikh: Jat', 'Jat', 'CASTE', '156', 1, '/sikh-jat-matrimony-matrimonials', 'Y', 'L1_CA_114', 'The Jat or Jatt people are an ethnic group residing largely in the Punjab region of northern India, Pakistan and in international countries like US, Canada, Australia and UK. Jats in India are largely found in, Haryana, Punjab, Uttar Pradesh and Rajasthan.\n\nThe Jat people are one of the most affluent groups in India on a per-capita basis. Traditionally also they have been a predominant political class in Punjab. They own acres of fertile land across North India and are professional farmers. \n', 'Sikh Jat Matrimony - Sikh Jat Matrimonial - Sikh Jat Matrimonials -Sikh Jat Marriage - Online Sikh Jat Matrimonials - Matrimonial Services', 'Search Sikh Jat Matrimony, Sikh Jat Matrimonial, Sikh Jat Matrimonials, Sikh Jat Marriage, Sikh Jat Matrimonial Profiles in the leading Sikh Jat Matrimonials site for Indian and NRI Sikh Jat Marriage. Join Free &amp; Add your Sikh Jat Matrimonial Profile Now! Find suitable Indian &amp; NRI Sikh Jat brides and grooms from our online Sikh Jat matrimonial and matchmaking services.', 'Sikh Jat matrimony, Sikh Jat matrimonials, Sikh Jat matrimonial, matrimonials, matrimony, matrimony services, online Sikh Jat matrimonials, Indian marriage, match making, matchmaker, Sikh Jat profiles, marriage bureau , Sikh Jat marriage bureau, matchmaking services, matrimonial profiles, Sikh Jat bride, Sikh Jat groom, matrimony classified, brides, grooms', 'Sikh Jat Matrimonials ', 'Y', 'sikh-jat-matrimonials.jpg', 'Sikh Jat Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (115, 'Hindu: Gupta', 'Gupta', 'CASTE', '64', 1, '/matrimonials/gupta-matrimonial/', 'Y', 'L1_CA_115', 'Gupta is one of the most common surnames in India that follow Hindu religion. According to famous historian Mr. R. C. Majumdar, it is a possibility that different families without any connection to a particular clan adopted this name at different times. \n\nBut it is believed that Gupta belongs to Kshatriya caste and Baniya community has adopted this surname in north India. In West Bengal vaid (physician) community has adopted this surname and is related to sengupta and dasgupta communities. \n', 'Gupta Matrimony - Gupta Matrimonial - Gupta Matrimonials -Gupta Marriage - Online Gupta Matrimonials - Matrimonial Services', 'Search Gupta Matrimony, Gupta Matrimonial, Gupta Matrimonials, Gupta Marriage, Gupta Matrimonial Profiles in the leading Gupta Matrimonials site for Indian and NRI Gupta Marriage. Join Free &amp; Add your Gupta Matrimonial Profile Now! Find suitable Indian &amp; NRI Gupta brides and grooms from our online Gupta matrimonial and matchmaking services.', 'Gupta matrimony, Gupta matrimonials, Gupta matrimonial, matrimonials, matrimony, matrimony services, online Gupta matrimonials, Indian marriage, match making, matchmaker, Gupta profiles, marriage bureau , Gupta marriage bureau, matchmaking services, matrimonial profiles, Gupta bride, Gupta groom, matrimony classified, brides, grooms', 'Gupta Matrimonials ', 'Y', 'gupta-matrimonials.jpg', 'Gupta Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (116, 'Christian: Catholic', 'Catholic', 'CASTE', '4', 1, '/matrimonials/catholic-matrimonial/', 'Y', 'L1_CA_116', 'Catholic is a term derived from the Greek adjective, which means universal. For some Christians, the term &quot;Catholic Church&quot; refers to the church in full communion with the Bishop of Rome, made up of the Latin Rite and the 22 Eastern Catholic Churches.\n\nAccording to Eastern Orthodox, Anglicans and Lutherans, their churches are catholic because they are in continuity with the original universal church founded by the Apostles. For others catholic is a term denoting to all believers in Jesus Christ. \n', 'Catholic Matrimony - Catholic Matrimonial - Catholic Matrimonials -Catholic Marriage - Online Catholic Matrimonials - Matrimonial Services', 'Search Catholic Matrimony, Catholic Matrimonial, Catholic Matrimonials, Catholic Marriage, Catholic Matrimonial Profiles in the leading Catholic Matrimonials site for Indian and NRI Catholic Marriage. Join Free &amp; Add your Catholic Matrimonial Profile Now! Find suitable Indian &amp; NRI Catholic brides and grooms from our online Catholic matrimonial and matchmaking services.', 'Catholic matrimony, Catholic matrimonials, Catholic matrimonial, matrimonials, matrimony, matrimony services, online Catholic matrimonials, Indian marriage, match making, matchmaker, Catholic profiles, marriage bureau , Catholic marriage bureau, matchmaking services, matrimonial profiles, Catholic bride, Catholic groom, matrimony classified, brides, grooms', 'Catholic Matrimonials ', 'Y', 'catholic-matrimonials.jpg', 'Catholic Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (117, 'Hindu: Teli', 'Teli', 'CASTE', '129', 1, '/matrimonials/teli-matrimonial/', 'Y', 'L1_CA_117', 'Teli is a business caste among Hindus. They are called Teli because of their ancestral profession of making Ã¢â‚¬Ëœedible oilÃ¢â‚¬â„¢. \n\nThey also called themselves as Sahu Vaishyas. Telis have various surnames such as Sa, Sahu, Bakane, Prusty, Jesty,Pradhan, Behera,Sav, Gupta, Nathile, Gulhane, Shirbhate, misurkar, sakarkar, wathghate, Mandal, Saha, Wanjari, Gorai, Sadhu-Khan, Das, Chothave,Kardile, Dehadray,Shinde, Ghodmare, Waghmare, Karpe, Bele, Teli, Lanjewar Asamwar, Prasad, Pise and others.\n\n', 'Teli Matrimony - Teli Matrimonial - Teli Matrimonials -Teli Marriage - Online Teli Matrimonials - Matrimonial Services', 'Search Teli Matrimony, Teli Matrimonial, Teli Matrimonials, Teli Marriage, Teli Matrimonial Profiles in the leading Teli Matrimonials site for Indian and NRI Teli Marriage. Join Free &amp; Add your Teli Matrimonial Profile Now! Find suitable Indian &amp; NRI Teli brides and grooms from our online Teli matrimonial and matchmaking services.', 'Teli matrimony, Teli matrimonials, Teli matrimonial, matrimonials, matrimony, matrimony services, online Teli matrimonials, Indian marriage, match making, matchmaker, Teli profiles, marriage bureau , Teli marriage bureau, matchmaking services, matrimonial profiles, Teli bride, Teli groom, matrimony classified, brides, grooms', 'Teli Matrimonials ', 'Y', 'teli-matrimonials.jpg', 'Teli Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (118, 'Hindu: Vishwakarma', 'Vishwakarma', 'CASTE', '143', 1, '/matrimonials/vishwakarma-matrimonial/', 'Y', 'L1_CA_118', 'VishwakarmaÃ¢â‚¬â„¢s are followers of Lord Vishwakarma. It is a Hindu caste or community that has adopted engineering, art and architecture professions in India. Vishwakarmas are mainly carpenter, metal craftsmen, stone-carver and goldsmith. They are gifted with creative skills.\n\nThey have descended from Brahmins and Hindu law permits them to wear the sacred thread, perform various priestly duties and accords them a position equal to that of Brahmins. That&#039;s why, they are also known as Vishwa Brahmin.\n', 'Vishwakarma Matrimony - Vishwakarma Matrimonial - Vishwakarma Matrimonials -Vishwakarma Marriage - Online Vishwakarma Matrimonials - Matrimonial Services', 'Search Vishwakarma Matrimony, Vishwakarma Matrimonial, Vishwakarma Matrimonials, Vishwakarma Marriage, Vishwakarma Matrimonial Profiles in the leading Vishwakarma Matrimonials site for Indian and NRI Vishwakarma Marriage. Join Free &amp; Add your Vishwakarma Matrimonial Profile Now! Find suitable Indian &amp; NRI Vishwakarma brides and grooms from our online Vishwakarma matrimonial and matchmaking services.', 'Vishwakarma matrimony, Vishwakarma matrimonials, Vishwakarma matrimonial, matrimonials, matrimony, matrimony services, online Vishwakarma matrimonials, Indian marriage, match making, matchmaker, Vishwakarma profiles, marriage bureau , Vishwakarma marriage bureau, matchmaking services, matrimonial profiles, Vishwakarma bride, Vishwakarma groom, matrimony classified, brides, grooms', 'Vishwakarma Matrimonials ', 'Y', 'vishwakarma-matrimonials.jpg', 'Vishwakarma Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (119, 'Hindu: Brahmin Iyer', 'Brahmin Iyer', 'CASTE', '66', 1, '/matrimonials/iyer-matrimonial/', 'Y', 'L1_CA_119', 'Iyer, also known as Ayyar, Ayyer, Aiyar, or Aiyer, is the name given to Hindu Brahmins of Tamil or Telugu origin. They are followers of the Advaita philosophy propounded by Adi Shankara. Besides Iyer they use surnames like SÃ„Âstri, or Bhattar as well. They are found largely in Tamil Nadu, and also in Andhra Pradesh, Kerela and Karnataka.\n\nThe term &#039;Iyer&#039; originated in the medieval period when different sects of Brahmins living in the then Tamil country organized themselves as a single community. \n', 'Brahmin Iyer Matrimony - Brahmin Iyer Matrimonial - Brahmin Iyer Matrimonials -Brahmin Iyer Marriage - Online Brahmin Iyer Matrimonials - Matrimonial Services', 'Search Brahmin Iyer Matrimony, Brahmin Iyer Matrimonial, Brahmin Iyer Matrimonials, Brahmin Iyer Marriage, Brahmin Iyer Matrimonial Profiles in the leading Brahmin Iyer Matrimonials site for Indian and NRI Brahmin Iyer Marriage. Join Free &amp; Add your Brahmin Iyer Matrimonial Profile Now! Find suitable Indian &amp; NRI Brahmin Iyer brides and grooms from our online Brahmin Iyer matrimonial and matchmaking services.', 'Brahmin Iyer matrimony, Brahmin Iyer matrimonials, Brahmin Iyer matrimonial, matrimonials, matrimony, matrimony services, online Brahmin Iyer matrimonials, Indian marriage, match making, matchmaker, Brahmin Iyer profiles, marriage bureau , Brahmin Iyer marriage bureau, matchmaking services, matrimonial profiles, Brahmin Iyer bride, Brahmin Iyer groom, matrimony classified, brides, grooms', 'Brahmin Iyer Matrimonials ', 'Y', 'iyer-matrimonials.jpg', 'Iyer Matrimony\r');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (120, 'Hindu: Vaishnav', 'Vaishnav', 'CASTE', '134', 1, '/matrimonials/vaishnav-matrimonial/', 'Y', 'L1_CA_120', 'Vaishnavism is a tradition of Hinduism, which is distinguished from other schools by its worship of Vishnu or his associated avatars, Rama and Krishna. \n\nAll those follow Vaishnavism are referred to as Vaishnava(s). A huge percentage of Hindus in India are Vaishnavas. The Gaudiya Vaishnava branch of the tradition has, remarkably, increased the awareness of Vaishnavism internationally, primarily through ISKCON. More recently, other organizations are also conducting preaching activities in the West.\n', 'Vaishnav Matrimony - Vaishnav Matrimonial - Vaishnav Matrimonials -Vaishnav Marriage - Online Vaishnav Matrimonials - Matrimonial Services', 'Search Vaishnav Matrimony, Vaishnav Matrimonial, Vaishnav Matrimonials, Vaishnav Marriage, Vaishnav Matrimonial Profiles in the leading Vaishnav Matrimonials site for Indian and NRI Vaishnav Marriage. Join Free &amp; Add your Vaishnav Matrimonial Profile Now! Find suitable Indian &amp; NRI Vaishnav brides and grooms from our online Vaishnav matrimonial and matchmaking services.', 'Vaishnav matrimony, Vaishnav matrimonials, Vaishnav matrimonial, matrimonials, matrimony, matrimony services, online Vaishnav matrimonials, Indian marriage, match making, matchmaker, Vaishnav profiles, marriage bureau , Vaishnav marriage bureau, matchmaking services, matrimonial profiles, Vaishnav bride, Vaishnav groom, matrimony classified, brides, grooms', 'Vaishnav Matrimonials ', 'Y', 'vaishnav-matrimonials.jpg', 'Vaishnav Matrimony\r');
