INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (122, 'Hindu: Gujjar', 'Gujjar', 'CASTE', '63', 1, '/matrimonials/gujjar-matrimonial/', 'Y', 'L1_CA_122', 'It is believed that Gujjars hailed from Gurjar clan which was primarily placed under Kshatriya and Brahmins. Gujjar is a Hindu caste classified as other backward class in most of Indian states. \n\nGujari, classified under Rajasthani, has traditionally been the basic language of Gujjars. They are mostly settled in Rajasthan, Delhi, Punjab, Himachal Pradesh, Madhya Pradesh and Uttar Pradesh. Gujjars in north India are considered as vote bank by many political parties and are given special benefits. \n', 'Gujjar Matrimony - Gujjar Matrimonial - Gujjar Matrimonials -Gujjar Marriage - Online Gujjar Matrimonials - Matrimonial Services', 'Search Gujjar Matrimony, Gujjar Matrimonial, Gujjar Matrimonials, Gujjar Marriage, Gujjar Matrimonial Profiles in the leading Gujjar Matrimonials site for Indian and NRI Gujjar Marriage. Join Free &amp; Add your Gujjar Matrimonial Profile Now! Find suitable Indian &amp; NRI Gujjar brides and grooms from our online Gujjar matrimonial and matchmaking services.', 'Gujjar matrimony, Gujjar matrimonials, Gujjar matrimonial, matrimonials, matrimony, matrimony services, online Gujjar matrimonials, Indian marriage, match making, matchmaker, Gujjar profiles, marriage bureau , Gujjar marriage bureau, matchmaking services, matrimonial profiles, Gujjar bride, Gujjar groom, matrimony classified, brides, grooms\n\n', 'Gujjar Matrimonials ', 'Y', 'gujjar-matrimonials.jpg', 'Gujjar Matrimony\r');
