INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (152, 'Australia', '', 'COUNTRY', '7', 1, '/australia-matrimony-matrimonials', 'Y', 'L1_CO_152', 'Australia in Southern Hemisphere is a prosperous country being the thirteenth largest economy in the world. Surrounded by Indian and Pacific Ocean, it is the smallest continent of the world also referred to as the Ã¢â‚¬ËœIsland ContinentÃ¢â‚¬â„¢. Australia has no official language or religion but English is spoken by the majority and Christianity followed by about 65% of the population. With a diverse demographic profile comprising English, Irish, Scottish, Italian, etc., the marriage rituals vary largely.', 'Australia NRI Matrimony - Australia NRI Matrimonial - Australia NRI Matrimonials -Australia NRI Marriage - Online Australia NRI Matrimonials - Matrimonial Services', 'Search Australia NRI Matrimony, Australia NRI Matrimonial, Australia NRI Matrimonials, Australia NRI Marriage, Australia NRI Matrimonial Profiles in the leading Australia NRI Matrimonials site for Indian and NRI Australia NRI Marriage. Join Free &amp; Add your Australia NRI Matrimonial Profile Now! Find suitable Indian &amp; NRI Australia NRI brides and grooms from our online Australia NRI matrimonial and matchmaking services.', 'Australia matrimony, Australia matrimonials, Australia matrimonial, matrimonials, matrimony, matrimony services, online Australia matrimonials, Indian marriage, match making, matchmaker, Australia profiles, marriage bureau , Australia marriage bureau, matchmaking services, matrimonial profiles, Australia bride, Australia groom, matrimony classified, brides, grooms', 'Australia Matrimonials', 'Y', 'australia-matrimonials.jpg', 'Australia Matrimony\r');
