INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (187, 'Manglik', '', 'OTHERS', '', 1, '/manglik-matrimony-matrimonials', 'N', 'L1_OT_187', 'Mangliks are the people, who are born with Mangal Dosha or Kuja. It is the dosha of mind and body, which according to astrology occurs, if Mars is in the 2nd, 4th, 7th, 8th, or 12th house in the Vedic astrology. This Dosha is said to be devastating for the marriage future of the Manglik person, which can cause indefinite harm to his spouse. The manglik dosha gets cancelled if two Mangliks marry each other, or he is born on a Tuesday. A ceremony called kumbh viva, also resolves the problem. ', 'Manglik Matrimony - Manglik Matrimonial - Manglik Matrimonials - Manglik Marriage - Online Manglik Matrimonials - Matrimonial Services', 'Search Manglik Matrimony, Manglik Matrimonial, Manglik Matrimonials, Manglik Marriage, Manglik Matrimonial Profiles in the leading Manglik Matrimonials site for Indian and NRI Manglik Marriage. Join Free &amp; Add your Manglik Matrimonial Profile Now! Find suitable Indian &amp; NRI Manglik brides and grooms from our online Manglik matrimonial and matchmaking services.', 'Manglik matrimony, Manglik matrimonials, Manglik matrimonial, matrimonials, matrimony, matrimony services, online Manglik matrimonials, Indian marriage, match making, matchmaker, Manglik profiles, marriage bureau , Manglik marriage bureau, matchmaking services, matrimonial profiles, Manglik bride, Manglik groom, matrimony classified, brides, grooms', 'Manglik Matrimonials', 'N', 'manglik-matrimonials.jpg', 'manglik matrimony\r');
