INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (685, 'Arunachal Pradesh', 'Arunachal Pradesh', 'STATE', 'AR', 1, '/matrimonials/arunachal-pradesh-matrimonial/', 'Y', 'L1_ST_685', 'Arunachal Pradesh in northeast India is also known as theâ€™ Land of Rising Sunâ€™. The most interesting feature of the state is that it has various official languages like Hindi, Assamese, English, Deori and other local languages. A large percentage of the population of AP is animist i.e. they believe that non-human entities are spiritual beings and follow shamanistic-animistic religious traditions like Donyi-Polo and Rangfrah. It has sizeable populations of Hindus, Buddhists and Christians also.', 'Arunachal Pradesh Matrimony - Arunachal Pradesh Matrimonial - Arunachal Pradesh Matrimonials - Arunachal Pradesh Marriage - Online Arunachal Pradesh Matrimonials - Matrimonial Services', 'Search Arunachal Pradesh Matrimony, Arunachal Pradesh Matrimonial, Arunachal Pradesh Matrimonials, Arunachal Pradesh Marriage, Arunachal Pradesh Matrimonial Profiles in the leading Arunachal Pradesh Matrimonials site for Indian and NRI Arunachal Pradesh Marriage. Join Free & Add your Arunachal Pradesh Matrimonial Profile Now! Find suitable Indian & NRI Arunachal Pradesh brides and grooms from our online Arunachal Pradesh matrimonial and matchmaking services.', 'Arunachal Pradesh matrimony, Arunachal Pradesh matrimonials, Arunachal Pradesh matrimonial, matrimonials, matrimony, matrimony services, online Arunachal Pradesh matrimonials, Indian marriage, match making, matchmaker, Arunachal Pradesh profiles, marriage bureau , Arunachal Pradesh marriage bureau, matchmaking services, matrimonial profiles, Arunachal Pradesh bride, Arunachal Pradesh groom, matrimony classified, brides, grooms', 'Arunachal pradesh Matrimonials', 'Y', 'arunachal-pradesh-matrimonials.jpg', 'Arunachal pradesh Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (686, 'Mizoram', '', 'STATE', 'MI', 1, '/matrimonials/mizoram-matrimonial/', 'Y', 'L1_ST_686', 'Mizoram, the 23rd state of India is located in the North Eastern part of India and is one of the seven sister states of the country. The state enjoys a pleasant weather due to hills, rivers and lakes surrounding the place. Ethnic groups of people collectively called as Mizos live in Mizoram and they are further divided into various tribes. The Mizoram matrimonies take place according to social cultures of the different tribes and the rituals carried out in their respective religion and community.', 'Mizoram Matrimony - Mizoram Matrimonial - Mizoram Matrimonials - Mizoram Marriage - Online Mizoram Matrimonials - Matrimonial Services', 'Search Mizoram Matrimony, Mizoram Matrimonial, Mizoram Matrimonials, Mizoram Marriage, Mizoram Matrimonial Profiles in the leading Mizoram Matrimonials site for Indian and NRI Mizoram Marriage. Join Free & Add your Mizoram Matrimonial Profile Now! Find suitable Indian & NRI Mizoram brides and grooms from our online Mizoram matrimonial and matchmaking services.', 'Mizoram matrimony, Mizoram matrimonials, Mizoram matrimonial, matrimonials, matrimony, matrimony services, online Mizoram matrimonials, Indian marriage, match making, matchmaker, Mizoram profiles, marriage bureau , Mizoram marriage bureau, matchmaking services, matrimonial profiles, Mizoram bride, Mizoram groom, matrimony classified, brides, grooms', 'Mizoram Matrimonials', 'Y', 'mizoram-matrimonials.jpg', 'Mizoram Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (687, 'Pondicherry', '', 'STATE', 'PO', 1, '/matrimonials/pondicherry-matrimonial/', 'Y', 'L1_ST_687', 'Pondicherry, now Puducherry, is a union territory that comprises four districts- Pondicherry, Yanam, Karaikal and Mahe. The official languages of Pondicherry are French, Telugu, Tamil and Malayalam as there are 4 different districts and are unconnected. But, Tamil is the most widely spoken language in the union territory. Puducherry comes from a Tamil word and means â€˜new villageâ€™ while Pondicherry was a French name. Pondicherry is famous for a large number of tourist spots and religious places.', 'Pondicherry Matrimony - Pondicherry Matrimonial - Pondicherry Matrimonials - Pondicherry Marriage - Online Pondicherry Matrimonials - Matrimonial Services', 'Search Pondicherry Matrimony, Pondicherry Matrimonial, Pondicherry Matrimonials, Pondicherry Marriage, Pondicherry Matrimonial Profiles in the leading Pondicherry Matrimonials site for Indian and NRI Pondicherry Marriage. Join Free & Add your Pondicherry Matrimonial Profile Now! Find suitable Indian & NRI Pondicherry brides and grooms from our online Pondicherry matrimonial and matchmaking services.', 'Pondicherry matrimony, Pondicherry matrimonials, Pondicherry matrimonial, matrimonials, matrimony, matrimony services, online Pondicherry matrimonials, Indian marriage, match making, matchmaker, Pondicherry profiles, marriage bureau , Pondicherry marriage bureau, matchmaking services, matrimonial profiles, Pondicherry bride, Pondicherry groom, matrimony classified, brides, grooms', 'Pondicherry Matrimonials', 'Y', 'pondicherry-matrimonials.jpg', 'Pondicherry Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (688, 'Sikkim', '', 'STATE', 'SI', 1, '/matrimonials/sikkim-matrimonial/', 'Y', 'L1_ST_688', 'Sikkim matrimonies are the wedding ceremonies of the people living in Sikkim. Considerable numbers of people living in Sikkim are Nepalis and they use Nepali as the language to communicate within their community. Hinduism is dominantly followed in the Sikkim regions, followed by Buddhism. Sikkim matrimonies take place in their respective religious fashion with the flavour of Nepali customs. The marriages are mostly influenced from the Indian culture and celebrated with great pomp and show.   ', 'Sikkim Matrimony - Sikkim Matrimonial - Sikkim Matrimonials - Sikkim Marriage - Online Sikkim Matrimonials - Matrimonial Services', 'Search Sikkim Matrimony, Sikkim Matrimonial, Sikkim Matrimonials, Sikkim Marriage, Sikkim Matrimonial Profiles in the leading Sikkim Matrimonials site for Indian and NRI Sikkim Marriage. Join Free & Add your Sikkim Matrimonial Profile Now! Find suitable Indian & NRI Sikkim brides and grooms from our online Sikkim matrimonial and matchmaking services.', 'Sikkim matrimony, Sikkim matrimonials, Sikkim matrimonial, matrimonials, matrimony, matrimony services, online Sikkim matrimonials, Indian marriage, match making, matchmaker, Sikkim profiles, marriage bureau , Sikkim marriage bureau, matchmaking services, matrimonial profiles, Sikkim bride, Sikkim groom, matrimony classified, brides, grooms', 'Sikkim Matrimonials', 'Y', 'sikkim-matrimonials.jpg', 'Sikkim Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (689, 'Tripura', '', 'STATE', 'TR', 1, '/matrimonials/tripura-matrimonial/', 'Y', 'L1_ST_689', 'Tripura is an Indian state located in the north eastern part of the country. Agriculture forms the main source of income for the Tripura people. Hinduism as a religion is widely practised in the state, and religions like Islam, Christianity and Buddhism are also prevalent. Bengali and Tripuri are the main cultures followed by the people, hence these are the preferred languages spoken. Marriages in Tripura are celebrated according to the respective religion followed by family of the bride and groom. ', 'Tripura Matrimony - Tripura Matrimonial - Tripura Matrimonials - Tripura Marriage - Online Tripura Matrimonials - Matrimonial Services', 'Search Tripura Matrimony, Tripura Matrimonial, Tripura Matrimonials, Tripura Marriage, Tripura Matrimonial Profiles in the leading Tripura Matrimonials site for Indian and NRI Tripura Marriage. Join Free & Add your Tripura Matrimonial Profile Now! Find suitable Indian & NRI Tripura brides and grooms from our online Tripura matrimonial and matchmaking services.', 'Tripura matrimony, Tripura matrimonials, Tripura matrimonial, matrimonials, matrimony, matrimony services, online Tripura matrimonials, Indian marriage, match making, matchmaker, Tripura profiles, marriage bureau , Tripura marriage bureau, matchmaking services, matrimonial profiles, Tripura bride, Tripura groom, matrimony classified, brides, grooms', 'Tripura Matrimonials', 'Y', 'tripura-matrimonials.jpg', 'Tripura Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (690, 'Hindi', 'Hindi', 'MTONGUE', '10', 1, '/matrimonials/hindi-matrimonial/', 'Y', 'L1_MT_690', 'Hindi matrimonial takes place between Hindi speaking people who may be settled in India or abroad. Hindi is the official language of the country and is spoken largely in northern states like Delhi, Uttar Pradesh and Madhya Pradesh. Besides its official status in India, Hindi is widely spoken in Nepal and Mauritius along with in other countries like Canada, Malaysia, Singapore, etc. Hindi matrimonial is performed in a traditional manner with various pre and post wedding rituals being observed.', 'Hindi Matrimony - Hindi Matrimonial - Hindi Matrimonials - Hindi Marriage - Online Hindi Matrimonials - Matrimonial Services', 'Search Hindi Matrimony, Hindi Matrimonial, Hindi Matrimonials, Hindi Marriage, Hindi Matrimonial Profiles in the leading Hindi Matrimonials site for Indian and NRI Hindi Marriage. Join Free & Add your Hindi Matrimonial Profile Now! Find suitable Indian & NRI Hindi brides and grooms from our online Hindi matrimonial and matchmaking services.', 'Hindi matrimony, Hindi matrimonials, Hindi matrimonial, matrimonials, matrimony, matrimony services, online Hindi matrimonials, Indian marriage, match making, matchmaker, Hindi profiles, marriage bureau , Hindi marriage bureau, matchmaking services, matrimonial profiles, Hindi bride, Hindi groom, matrimony classified, brides, grooms', 'Hindi Matrimonials', 'Y', 'hindi-matrimonials.jpg', 'Hindi Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (691, 'NRI ', '', 'COUNTRY', '128', 1, '/nri-matrimony-matrimonials', 'Y', 'L1_CO_691', 'NRI, are the people who are born in India, but are living in different parts of the world. NRIâ€™s in spite of living in foreign countries always want their children to get married to the bride or groom living in India. The cultures and the values of Indian society are always appreciated, respected and also plays a major role in stability of the marriage bond. NRI matrimonies are performed according to the Indian traditions and they look for educated and well mannered partners for their children.', 'NRI Matrimony - NRI Matrimonial - NRI Matrimonials - NRI Marriage - Online NRI Matrimonials - Matrimonial Services', 'Search NRI Matrimony, NRI Matrimonial, NRI Matrimonials, NRI Marriage, NRI Matrimonial Profiles in the leading NRI Matrimonials site for Indian and NRI Marriage. Join Free & Add your NRI Matrimonial Profile Now! Find suitable Indian & NRI brides and grooms from our online NRI matrimonial and matchmaking services.', 'NRI matrimony, NRI matrimonials, NRI matrimonial, matrimonials, matrimony, matrimony services, online NRI matrimonials, Indian marriage, match making, matchmaker, NRI profiles, marriage bureau , NRI marriage bureau, matchmaking services, matrimonial profiles, NRI bride, NRI groom, matrimony classified, brides, grooms', 'NRI Matrimonials', 'Y', 'nri-matrimonials.jpg', 'NRI Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (692, 'Alabama', '', 'CITY', '1', 1, '/matrimonials/alabama-matrimonials/', 'Y', 'L1_CI_692', 'Alabama in USA is bordered by Georgia, Tennessee, Florida, Mississippi and Gulf of Mexico. English being the official language is spoken by more than 95% population of the state. The economical status of Alabama, also known as â€˜The Cotton Stateâ€™ has been improving rapidly. It recognizes various American Indian tribes officially and even has a state Indian Commission. Many people of Indian origin migrate to United States of America for better education and employment and Alabama is one such state.', 'Alabama Matrimony - Alabama Matrimonial - Alabama Matrimonials - Alabama Marriage - Online Alabama Matrimonials - Matrimonial Services', 'Search Alabama Matrimony, Alabama Matrimonial, Alabama Matrimonials, Alabama Marriage, Alabama Matrimonial Profiles in the leading Alabama Matrimonials site for Indian and NRI Alabama Marriage. Join Free & Add your Alabama Matrimonial Profile Now! Find suitable Indian & NRI Alabama brides and grooms from our online Alabama matrimonial and matchmaking services.', 'Alabama matrimony, Alabama matrimonials, Alabama matrimonial, matrimonials, matrimony, matrimony services, online Alabama matrimonials, Indian marriage, match making, matchmaker, Alabama profiles, marriage bureau , Alabama marriage bureau, matchmaking services, matrimonial profiles, Alabama bride, Alabama groom, matrimony classified, brides, grooms', 'Alabama Matrimonials', 'Y', 'alabama-matrimonials.jpg', 'Alabama Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (693, 'Arizona', '', 'CITY', '3', 1, '/matrimonials/arizona-matrimonials/', 'Y', 'L1_CI_693', 'Arizona in US is also called â€˜The Grand Canyon Stateâ€™ or â€˜The Copper Stateâ€™. The name of this state may have been derived from the word â€˜Ali Sonakâ€™ meaning small spring or from â€˜Arida Zonaâ€™ meaning arid zone in Spanish. Phoenix and Tuscan are the two most important cities in Arizona. In earlier times, Arizona had a large population of Indians, so much so, that they outnumbered the natives and many of them later converted to Christianity. It has an entire college on the name of American Indians.', 'Arizona Matrimony - Arizona Matrimonial - Arizona Matrimonials - Arizona Marriage - Online Arizona Matrimonials - Matrimonial Services', 'Search Arizona Matrimony, Arizona Matrimonial, Arizona Matrimonials, Arizona Marriage, Arizona Matrimonial Profiles in the leading Arizona Matrimonials site for Indian and NRI Arizona Marriage. Join Free & Add your Arizona Matrimonial Profile Now! Find suitable Indian & NRI Arizona brides and grooms from our online Arizona matrimonial and matchmaking services.', 'Arizona matrimony, Arizona matrimonials, Arizona matrimonial, matrimonials, matrimony, matrimony services, online Arizona matrimonials, Indian marriage, match making, matchmaker, Arizona profiles, marriage bureau , Arizona marriage bureau, matchmaking services, matrimonial profiles, Arizona bride, Arizona groom, matrimony classified, brides, grooms', 'Arizona Matrimonials', 'Y', 'arizona-matrimonials.jpg', 'Arizona Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (694, 'Arkansas', '', 'CITY', '4', 1, '/matrimonials/arkansas-matrimonials/', 'Y', 'L1_CI_694', 'Arkansas in south of United States has a diverse geography ranging from mountainous regions lowlands along the river. Arkansas is another name for Quapaw Indians, derived from either the French or Sioux word â€˜Akakazeâ€™ meaning â€˜land of downriver peopleâ€™ or â€˜people of the south windâ€™. Little Rock is the capital city of Arkansas.\r\n\r\nArkansas matrimonial is very interesting as the state offers diverse settings for wedding celebrations. There are a large number of options for indoor and outdoor weddings.', 'Arkansas Matrimony - Arkansas Matrimonial - Arkansas Matrimonials - Arkansas Marriage - Online Arkansas Matrimonials - Matrimonial Services', 'Search Arkansas Matrimony, Arkansas Matrimonial, Arkansas Matrimonials, Arkansas Marriage, Arkansas Matrimonial Profiles in the leading Arkansas Matrimonials site for Indian and NRI Arkansas Marriage. Join Free & Add your Arkansas Matrimonial Profile Now! Find suitable Indian & NRI Arkansas brides and grooms from our online Arkansas matrimonial and matchmaking services.', 'Arkansas matrimony, Arkansas matrimonials, Arkansas matrimonial, matrimonials, matrimony, matrimony services, online Arkansas matrimonials, Indian marriage, match making, matchmaker, Arkansas profiles, marriage bureau , Arkansas marriage bureau, matchmaking services, matrimonial profiles, Arkansas bride, Arkansas groom, matrimony classified, brides, grooms', 'Arkansas Matrimonials', 'Y', 'arkansas-matrimonials.jpg', 'Arkansas Matrimony\r\n');
