INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (697, 'Connecticut', '', 'CITY', '7', 1, '/matrimonials/connecticut-matrimonials/', 'Y', 'L1_CI_697', 'Connecticut is in New England region of United States and is named after Connecticut River. Some of the most populated cities in the state are Hartford, Danbury, New Britain, Norwalk, etc. Connecticut is sometimes referred to as â€˜The Nutmeg Stateâ€™, â€˜The Provisions State and even as â€˜The Land of Steady Habitsâ€™. Its residents are often called Connecticuters, Nutmeggers and Yankees. \r\n\r\nOnly those above the age of 18 years are eligible for Connecticut matrimonial as it is the legal age for marriage.', 'Connecticut Matrimony - Connecticut Matrimonial - Connecticut Matrimonials - Connecticut Marriage - Online Connecticut Matrimonials - Matrimonial Services', 'Search Connecticut Matrimony, Connecticut Matrimonial, Connecticut Matrimonials, Connecticut Marriage, Connecticut Matrimonial Profiles in the leading Connecticut Matrimonials site for Indian and NRI Connecticut Marriage. Join Free & Add your Connecticut Matrimonial Profile Now! Find suitable Indian & NRI Connecticut brides and grooms from our online Connecticut matrimonial and matchmaking services.', 'Connecticut matrimony, Connecticut matrimonials, Connecticut matrimonial, matrimonials, matrimony, matrimony services, online Connecticut matrimonials, Indian marriage, match making, matchmaker, Connecticut profiles, marriage bureau , Connecticut marriage bureau, matchmaking services, matrimonial profiles, Connecticut bride, Connecticut groom, matrimony classified, brides, grooms', 'Connecticut Matrimonials', 'Y', 'connecticut-matrimonials.jpg', 'Connecticut Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (698, 'Delaware', '', 'CITY', '8', 1, '/matrimonials/delaware-matrimonials/', 'Y', 'L1_CI_698', 'Delaware in Mid-Atlantic region of US is bordered by New Jersey, Maryland and Pennsylvania. It is divided into 3 countries namely Kent, New Castle and Sussex of which New Castle is quite industrialized. Delaware comes from the name of an English nobleman and Virginiaâ€™s first colonial governor, De La Warr.  English is the most widely spoken language in Delaware while Spanish, French, Chinese and German are also spoken by many. Greenville, North Star, Wilmington and Dover are its important cities.', 'Delaware Matrimony - Delaware Matrimonial - Delaware Matrimonials - Delaware Marriage - Online Delaware Matrimonials - Matrimonial Services', 'Search Delaware Matrimony, Delaware Matrimonial, Delaware Matrimonials, Delaware Marriage, Delaware Matrimonial Profiles in the leading Delaware Matrimonials site for Indian and NRI Delaware Marriage. Join Free & Add your Delaware Matrimonial Profile Now! Find suitable Indian & NRI Delaware brides and grooms from our online Delaware matrimonial and matchmaking services.', 'Delaware matrimony, Delaware matrimonials, Delaware matrimonial, matrimonials, matrimony, matrimony services, online Delaware matrimonials, Indian marriage, match making, matchmaker, Delaware profiles, marriage bureau , Delaware marriage bureau, matchmaking services, matrimonial profiles, Delaware bride, Delaware groom, matrimony classified, brides, grooms', 'Delaware Matrimonials', 'Y', 'delaware-matrimonials.jpg', 'Delaware Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (699, 'District Columbia', '', 'CITY', '9', 1, '/matrimonials/district-columbia-matrimonials/', 'Y', 'L1_CI_699', 'District Columbia, popularly known as Washington, D.C. today is the capital of United States of America. 3.5% population of District Columbia is made up of Asians and less than 0.5% is American Indians. Large numbers of Indians resettle in USA after they move out to take up higher studies or employment.\r\n\r\nDistrict Columbia matrimonial is inter culture many times as Indians marry natives of the region. However, Indians in D.C. prefer marriage with a partner from their country, religion and caste.', 'District Columbia Matrimony - District Columbia Matrimonial - District Columbia Matrimonials - District Columbia Marriage - Online District Columbia Matrimonials - Matrimonial Services', 'Search District Columbia Matrimony, District Columbia Matrimonial, District Columbia Matrimonials, District Columbia Marriage, District Columbia Matrimonial Profiles in the leading District Columbia Matrimonials site for Indian and NRI District Columbia Marriage. Join Free & Add your District Columbia Matrimonial Profile Now! Find suitable Indian & NRI District Columbia brides and grooms from our online District Columbia matrimonial and matchmaking services.', 'District Columbia matrimony, District Columbia matrimonials, District Columbia matrimonial, matrimonials, matrimony, matrimony services, online District Columbia matrimonials, Indian marriage, match making, matchmaker, District Columbia profiles, marriage bureau , District Columbia marriage bureau, matchmaking services, matrimonial profiles, District Columbia bride, District Columbia groom, matrimony classified, brides, grooms', 'District Columbia Matrimonials', 'Y', 'district-columbia-matrimonials.jpg', 'District Columbia Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (700, 'Florida', '', 'CITY', '10', 1, '/matrimonials/florida-matrimonials/', 'Y', 'L1_CI_700', 'Florida is located in southeastern US on the Gulf Coast and surrounded by Gulf of Mexico, Alabama, Georgia and Atlantic Ocean. The culture of Florida reflects multiple influences from African, American, Native American, Anglo-American and Hispanic heritages.\r\n\r\nFlorida matrimonial is solemnized after obtaining a marriage license which should ideally be applied for at least one month before the wedding ceremony. However, it should not be applied for too early since it expires usually in 2 months.', 'Florida Matrimony - Florida Matrimonial - Florida Matrimonials - Florida Marriage - Online Florida Matrimonials - Matrimonial Services', 'Search Florida Matrimony, Florida Matrimonial, Florida Matrimonials, Florida Marriage, Florida Matrimonial Profiles in the leading Florida Matrimonials site for Indian and NRI Florida Marriage. Join Free & Add your Florida Matrimonial Profile Now! Find suitable Indian & NRI Florida brides and grooms from our online Florida matrimonial and matchmaking services.', 'Florida matrimony, Florida matrimonials, Florida matrimonial, matrimonials, matrimony, matrimony services, online Florida matrimonials, Indian marriage, match making, matchmaker, Florida profiles, marriage bureau , Florida marriage bureau, matchmaking services, matrimonial profiles, Florida bride, Florida groom, matrimony classified, brides, grooms', 'Florida Matrimonials', 'Y', 'florida-matrimonials.jpg', 'Florida Matrimony\r\n');
