INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (702, 'Iowa', '', 'CITY', '16', 1, '/matrimonials/iowa-matrimonials/', 'Y', 'L1_CI_702', 'Iowa often referred to as â€˜American Heartlandâ€™ is located in Midwestern United States. It gets this name from an American Indian tribe called Ioway who inhabited the state in times of European exploration. Davenport, Iowa City, Waterloo, Ankeny and Des Moines are among the largest cities in the state of Iowa. \r\n\r\nIowa matrimonial laws permit people above the age of 18 years to tie the nuptial knot lawfully while minors can marry only with the special permission from the judge of District Court.', 'Iowa Matrimony - Iowa Matrimonial - Iowa Matrimonials - Iowa Marriage - Online Iowa Matrimonials - Matrimonial Services', 'Search Iowa Matrimony, Iowa Matrimonial, Iowa Matrimonials, Iowa Marriage, Iowa Matrimonial Profiles in the leading Iowa Matrimonials site for Indian and NRI Iowa Marriage. Join Free & Add your Iowa Matrimonial Profile Now! Find suitable Indian & NRI Iowa brides and grooms from our online Iowa matrimonial and matchmaking services.', 'Iowa matrimony, Iowa matrimonials, Iowa matrimonial, matrimonials, matrimony, matrimony services, online Iowa matrimonials, Indian marriage, match making, matchmaker, Iowa profiles, marriage bureau , Iowa marriage bureau, matchmaking services, matrimonial profiles, Iowa bride, Iowa groom, matrimony classified, brides, grooms', 'Iowa Matrimonials', 'Y', 'iowa-matrimonials.jpg', 'Iowa Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (703, 'Kansas', '', 'CITY', '17', 1, '/matrimonials/kansas-matrimonials/', 'Y', 'L1_CI_703', 'Kansas is believed to be named after Kansas River which was actually called so because of the settlement of Kansas tribe in the region. Kansas matrimonial laws require the persons getting married to obtain a marriage license from the Court. Either of the boy or the girl can file the application for license and wait for three days to receive it. A fee of $50 is also charged in cash and the license is then published in the newspaper. It is valid for a period of 6 months from the date of issuance.', 'Kansas Matrimony - Kansas Matrimonial - Kansas Matrimonials - Kansas Marriage - Online Kansas Matrimonials - Matrimonial Services', 'Search Kansas Matrimony, Kansas Matrimonial, Kansas Matrimonials, Kansas Marriage, Kansas Matrimonial Profiles in the leading Kansas Matrimonials site for Indian and NRI Kansas Marriage. Join Free & Add your Kansas Matrimonial Profile Now! Find suitable Indian & NRI Kansas brides and grooms from our online Kansas matrimonial and matchmaking services.', 'Kansas matrimony, Kansas matrimonials, Kansas matrimonial, matrimonials, matrimony, matrimony services, online Kansas matrimonials, Indian marriage, match making, matchmaker, Kansas profiles, marriage bureau , Kansas marriage bureau, matchmaking services, matrimonial profiles, Kansas bride, Kansas groom, matrimony classified, brides, grooms', 'Kansas Matrimonials', 'Y', 'kansas-matrimonials.jpg', 'Kansas Matrimony\r\n');
