INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (717, 'South Carolina', '', 'CITY', '38', 1, '/matrimonials/south-carolina-matrimonials/', 'Y', 'L1_CI_717', 'South Carolina, a state located in the extreme south bordering Georgia and North Carolina on the south and north respectively. Most of the people living in South Carolina earn their income through agricultural activities and few are into trading and other businesses. About 24% of the people based in South Carolina are Asians, out of which significant number of people are Indians. Christianity is the most widespread religion there; hence South Carolina matrimonies are practised accordingly.', 'South Carolina Matrimony - South Carolina Matrimonial - South Carolina Matrimonials - South Carolina Marriage - Online South Carolina Matrimonials', 'Search South Carolina Matrimony, South Carolina Matrimonial, South Carolina Matrimonials, South Carolina Marriage, South Carolina Matrimonial Profiles in the leading South Carolina Matrimonials site for Indian and NRI South Carolina Marriage. Join Free & Add your South Carolina Matrimonial Profile Now! Find suitable Indian & NRI South Carolina brides and grooms from our online South Carolina matrimonial and matchmaking services.', 'South Carolina matrimony, South Carolina matrimonials, South Carolina matrimonial, matrimonials, matrimony, matrimony services, online South Carolina matrimonials, Indian marriage, match making, matchmaker, South Carolina profiles, marriage bureau , South Carolina marriage bureau, matchmaking services, matrimonial profiles, South Carolina bride, South Carolina groom, matrimony classified, brides, grooms', 'South Carolina Matrimonials', 'Y', 'south-carolina-matrimonials.jpg', 'South Carolina Matrimony\r\n');
