INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (719, 'Texas', '', 'CITY', '41', 1, '/matrimonials/texas-matrimonials/', 'Y', 'L1_CI_719', 'Texas is the state which comes second in number in US in terms of both population and area. English and Spanish are the two major languages spoken by the people of Texas. Indians constitute a very small number in its population. Apache, Tonkawa, Caddo, Lipan, Comanche, Karan- Kawas, are the places where Indian population can be found. Christianity is the main religion followed in Texas, which can be seen practised by many Indians also. Texas matrimonies are therefore performed in the same fashion. ', 'Texas Matrimony - Texas Matrimonial - Texas Matrimonials - Texas Marriage - Online Texas Matrimonials - Matrimonial Services', 'Search Texas Matrimony, Texas Matrimonial, Texas Matrimonials, Texas Marriage, Texas Matrimonial Profiles in the leading Texas Matrimonials site for Indian and NRI Texas Marriage. Join Free & Add your Texas Matrimonial Profile Now! Find suitable Indian & NRI Texas brides and grooms from our online Texas matrimonial and matchmaking services.', 'Texas matrimony, Texas matrimonials, Texas matrimonial, matrimonials, matrimony, matrimony services, online Texas matrimonials, Indian marriage, match making, matchmaker, Texas profiles, marriage bureau , Texas marriage bureau, matchmaking services, matrimonial profiles, Texas bride, Texas groom, matrimony classified, brides, grooms', 'Texas Matrimonials', 'Y', 'texas-matrimonials.jpg', 'Texas Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (720, 'Virginia', '', 'CITY', '44', 1, '/matrimonials/virginia-matrimonials/', 'Y', 'L1_CI_720', 'Virginia, also known as the â€˜Mother of Presidentsâ€™, is a US state located on the Atlantic Coast in Southern part of United States. Indians are present in various tribes in different parts of Virginia following their specific traditions. The Virginia matrimonies of the Indians present there are carried out according to the rituals of the respective tribe or community they belong to. Agriculture, business, government and military jobs are the main sectors, which engage the people of Virginia in work.', 'Virginia Matrimony - Virginia Matrimonial - Virginia Matrimonials - Virginia Marriage - Online Virginia Matrimonials - Matrimonial Services', 'Search Virginia Matrimony, Virginia Matrimonial, Virginia Matrimonials, Virginia Marriage, Virginia Matrimonial Profiles in the leading Virginia Matrimonials site for Indian and NRI Virginia Marriage. Join Free & Add your Virginia Matrimonial Profile Now! Find suitable Indian & NRI Virginia brides and grooms from our online Virginia matrimonial and matchmaking services.', 'Virginia matrimony, Virginia matrimonials, Virginia matrimonial, matrimonials, matrimony, matrimony services, online Virginia matrimonials, Indian marriage, match making, matchmaker, Virginia profiles, marriage bureau , Virginia marriage bureau, matchmaking services, matrimonial profiles, Virginia bride, Virginia groom, matrimony classified, brides, grooms', 'Virginia Matrimonials', 'Y', 'virginia-matrimonials.jpg', 'Virginia Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (721, 'Washington', '', 'CITY', '45', 1, '/matrimonials/washington-matrimonials/', 'Y', 'L1_CI_721', 'Washington popularly known as the state of Washington is located in the North western part of the US. The state is highly developed and its population constitutes of people from varied backgrounds. Washington is hub to the designing and manufacturing of aircrafts and automobiles, computer professionals, telecom, electronics, biotechnology and many other industries. Indians are also present in the state practising respectable professions and their marriage ceremonies are performed in Indian fashion.', 'Washington Matrimony - Washington Matrimonial - Washington Matrimonials - Washington Marriage - Online Washington Matrimonials - Matrimonial Services', 'Search Washington Matrimony, Washington Matrimonial, Washington Matrimonials, Washington Marriage, Washington Matrimonial Profiles in the leading Washington Matrimonials site for Indian and NRI Washington Marriage. Join Free & Add your Washington Matrimonial Profile Now! Find suitable Indian & NRI Washington brides and grooms from our online Washington matrimonial and matchmaking services.', 'Washington matrimony, Washington matrimonials, Washington matrimonial, matrimonials, matrimony, matrimony services, online Washington matrimonials, Indian marriage, match making, matchmaker, Washington profiles, marriage bureau , Washington marriage bureau, matchmaking services, matrimonial profiles, Washington bride, Washington groom, matrimony classified, brides, grooms', 'Washington Matrimonials', 'Y', 'washington-matrimonials.jpg', 'Washington Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (722, 'Christian: Syrian', 'Syrian', 'CASTE', '12', 1, '/matrimonials/syrian-matrimonial/', 'Y', 'L1_CA_722', 'Syrians form an ethnoreligious group that adheres to the churches of Saint Thomas Christian tradition. They are also referred to as Syrian Malabar Nasrani or Mar Thoma Nasrani or Suriyani Christiaanikal or simply Syrian Christians.  They are the descendants of Jewish diaspora in Kerala and follow Hebrew-Syriac Christian tradition which includes both Jewish elements and Hindu customs. \r\n\r\nSyrian matrimonial is based on endogamy as they do not believe in intermarriage with other Christian castes.', 'Syrian Matrimony - Syrian Matrimonial - Syrian Matrimonials - Syrian Marriage - Online Syrian Matrimonials - Matrimonial Services', 'Search Syrian Matrimony, Syrian Matrimonial, Syrian Matrimonials, Syrian Marriage, Syrian Matrimonial Profiles in the leading Syrian Matrimonials site for Indian and NRI Syrian Marriage. Join Free & Add your Syrian Matrimonial Profile Now! Find suitable Indian & NRI Syrian brides and grooms from our online Syrian matrimonial and matchmaking services.', 'Syrian matrimony, Syrian matrimonials, Syrian matrimonial, matrimonials, matrimony, matrimony services, online Syrian matrimonials, Indian marriage, match making, matchmaker, Syrian profiles, marriage bureau , Syrian marriage bureau, matchmaking services, matrimonial profiles, Syrian bride, Syrian groom, matrimony classified, brides, grooms', 'Syrian Matrimonials', 'Y', 'syrian-matrimonials.jpg', 'Syrian Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (723, 'Hindu: Adi Dravida', 'Adi Dravida', 'CASTE', '16', 1, '/matrimonials/adi-dravida-matrimonial/', 'Y', 'L1_CA_723', 'The term Adi Dravida implies ''original inhabitants of Dravida'' where the region of Dravida includes states and union territories in south India. Coined by Periyar Ramasami, the Tamil social activist, it is commonly used in Tamil Nadu to refer to Dalits. The community of Adi Dravida speaks Tamil as their primary language and follows any of the religions from Hinduism, Christianity, Islam and Buddhism. Some of the ethnic groups related to Adi Dravida group are Arunthathiyar, Parayar and Sambavar.', 'Adi Dravida Matrimony - Adi Dravida Matrimonial - Adi Dravida Matrimonials - Adi Dravida Marriage - Online Adi Dravida Matrimonials - Matrimonial Services', 'Search Adi Dravida Matrimony, Adi Dravida Matrimonial, Adi Dravida Matrimonials, Adi Dravida Marriage, Adi Dravida Matrimonial Profiles in the leading Adi Dravida Matrimonials site for Indian and NRI Adi Dravida Marriage. Join Free & Add your Adi Dravida Matrimonial Profile Now! Find suitable Indian & NRI Adi Dravida brides and grooms from our online Adi Dravida matrimonial and matchmaking services.', 'Adi Dravida matrimony, Adi Dravida matrimonials, Adi Dravida matrimonial, matrimonials, matrimony, matrimony services, online Adi Dravida matrimonials, Indian marriage, match making, matchmaker, Adi Dravida profiles, marriage bureau , Adi Dravida marriage bureau, matchmaking services, matrimonial profiles, Adi Dravida bride, Adi Dravida groom, matrimony classified, brides, grooms', 'Adi Dravida Matrimonials', 'Y', 'adi-dravida-matrimonials.jpg', 'Adi Dravida Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (724, 'Hindu: Arya Vysya', 'Arya Vysya', 'CASTE', '19', 1, '/arya-vysya-matrimony-matrimonials', 'Y', 'L1_CA_724', 'Arya Vysya, also known as Komati, is a trading caste from Andhra Pradesh in south India. Besides Andhra Pradesh, they are also settled in the states of Orissa, Tamil Nadu, Karnataka and Maharashtra. Some of the languages spoken by the members of Arya Vysya community are Kannada, Tamil, Telugu and Marathi. Being a trading caste, Arya Vysya are primarily involved in business. Raiwar, Yadawar, Kole, Mahajan, Patra, Rao, Senapati, Chidri, Amman, etc. are among the surnames used by the Arya Vysya.', 'Arya Vysya Matrimony - Arya Vysya Matrimonial - Arya Vysya Matrimonials - Arya Vysya Marriage - Online Arya Vysya Matrimonials - Matrimonial Services', 'Search Arya Vysya Matrimony, Arya Vysya Matrimonial, Arya Vysya Matrimonials, Arya Vysya Marriage, Arya Vysya Matrimonial Profiles in the leading Arya Vysya Matrimonials site for Indian and NRI Arya Vysya Marriage. Join Free & Add your Arya Vysya Matrimonial Profile Now! Find suitable Indian & NRI Arya Vysya brides and grooms from our online Arya Vysya matrimonial and matchmaking services.', 'Arya Vysya matrimony, Arya Vysya matrimonials, Arya Vysya matrimonial, matrimonials, matrimony, matrimony services, online Arya Vysya matrimonials, Indian marriage, match making, matchmaker, Arya Vysya profiles, marriage bureau , Arya Vysya marriage bureau, matchmaking services, matrimonial profiles, Arya Vysya bride, Arya Vysya groom, matrimony classified, brides, grooms', 'Arya Vysya Matrimonials', 'Y', 'arya-vysya-matrimonials.jpg', 'Arya Vysya Matrimony\r\n');
