INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (726, 'Hindu: Bhandari', 'Bhandari', 'CASTE', '22', 1, '/matrimonials/bhandari-matrimonial/', 'Y', 'L1_CA_726', 'Bhandari is a Rajput caste of the sea faring warriors of ancient India. They are mainly settled in Maharashtra, Goa, Karnataka, Andhra Pradesh, Rajasthan, Gujarat and Uttarakhand. The sub communities of Bhandaris are Kitte, Kshatriya, Hetkari, Thale, Devkar, Chaudhary, Shinde and Morey. It is believed that Bhandari comes from a Sanskrit word â€˜Bhandaâ€™ that means â€˜big shipsâ€™ and those who engineered these ships were referred to as Bhandaris. They may follow Hinduism, Sikhism, Jainism or Islam.', 'Bhandari Matrimony - Bhandari Matrimonial - Bhandari Matrimonials - Bhandari Marriage - Online Bhandari Matrimonials - Matrimonial Services', 'Search Bhandari Matrimony, Bhandari Matrimonial, Bhandari Matrimonials, Bhandari Marriage, Bhandari Matrimonial Profiles in the leading Bhandari Matrimonials site for Indian and NRI Bhandari Marriage. Join Free & Add your Bhandari Matrimonial Profile Now! Find suitable Indian & NRI Bhandari brides and grooms from our online Bhandari matrimonial and matchmaking services.', 'Bhandari matrimony, Bhandari matrimonials, Bhandari matrimonial, matrimonials, matrimony, matrimony services, online Bhandari matrimonials, Indian marriage, match making, matchmaker, Bhandari profiles, marriage bureau , Bhandari marriage bureau, matchmaking services, matrimonial profiles, Bhandari bride, Bhandari groom, matrimony classified, brides, grooms', 'Bhandari Matrimonials', 'Y', 'bhandari-matrimonials.jpg', 'Bhandari Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (727, 'Hindu: Billava', 'Billava', 'CASTE', '24', 1, '/matrimonials/billava-matrimonial/', 'Y', 'L1_CA_727', 'Billava, one of the largest Hindu Tulu communities in India, is found in the states of Kerala and Karnataka. The term Billava is a variant of the proto-Dravidian word, Villavars, the warrior caste in ancient times. Billavas usually speak in Tulu but many of them use Kannada as their primary language. They can be classified on the basis of language and culture though the two major groups are Malayali/Thiyya Billavas and Tulu Billavas. Baidya, Gujran, Palan, etc. are among their common surnames.', 'Billava Matrimony - Billava Matrimonial - Billava Matrimonials - Billava Marriage - Online Billava Matrimonials - Matrimonial Services', 'Search Billava Matrimony, Billava Matrimonial, Billava Matrimonials, Billava Marriage, Billava Matrimonial Profiles in the leading Billava Matrimonials site for Indian and NRI Billava Marriage. Join Free & Add your Billava Matrimonial Profile Now! Find suitable Indian & NRI Billava brides and grooms from our online Billava matrimonial and matchmaking services.', 'Billava matrimony, Billava matrimonials, Billava matrimonial, matrimonials, matrimony, matrimony services, online Billava matrimonials, Indian marriage, match making, matchmaker, Billava profiles, marriage bureau , Billava marriage bureau, matchmaking services, matrimonial profiles, Billava bride, Billava groom, matrimony classified, brides, grooms', 'Billava Matrimonials', 'Y', 'billava-matrimonials.jpg', 'Billava Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (728, 'Hindu: Brahmin Anavil', 'Anavil', 'CASTE', '27', 1, '/matrimonials/anavil-brahmin-matrimonial/', 'Y', 'L1_CA_728', 'Anavil Brahmins, the sub caste of Brahmins, get their name from the place called Anaval in the state of Gujarat. Also, it is a combination of â€˜Unâ€™ and â€˜Avilâ€™ meaning not dirty or very pure. It thus emphasizes that Anavil Brahmins have always been considered upright people. Anavil Brahmins are divided into different groups with surnames like Desai, Vashi, Naik and Mehta. Unlike other Brahmin communities in India, Anavils do not practice priesthood; they are instead agriculturists and landowners.', 'Anavil Brahmin Matrimony - Anavil Brahmin Matrimonial - Anavil Brahmin Matrimonials - Anavil Brahmin Marriage - Online Anavil Brahmin Matrimonials - Matrimonial Services', 'Search Anavil Brahmin Matrimony, Anavil Brahmin Matrimonial, Anavil Brahmin Matrimonials, Anavil Brahmin Marriage, Anavil Brahmin Matrimonial Profiles in the leading Anavil Brahmin Matrimonials site for Indian and NRI Anavil Brahmin Marriage. Join Free & Add your Anavil Brahmin Matrimonial Profile Now! Find suitable Indian & NRI Anavil Brahmin brides and grooms from our online Anavil Brahmin matrimonial and matchmaking services.', 'Anavil Brahmin matrimony, Anavil Brahmin matrimonials, Anavil Brahmin matrimonial, matrimonials, matrimony, matrimony services, online Anavil Brahmin matrimonials, Indian marriage, match making, matchmaker, Anavil Brahmin profiles, marriage bureau , Anavil Brahmin marriage bureau, matchmaking services, matrimonial profiles, Anavil Brahmin bride, Anavil Brahmin groom, matrimony classified, brides, grooms', 'Anavil Brahmin Matrimonials', 'Y', 'anavil-brahmin-matrimonials.jpg', 'Anavil Brahmin Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (729, 'Hindu: Brahmin Goswami', 'Goswami', 'CASTE', '34', 1, '/matrimonials/goswami-matrimonial/', 'Y', 'L1_CA_729', 'Goswami is considered to be a Hindu caste and primarily used for those people who choose to become Sanyasis. The term Goswami comes from two words â€˜Goâ€™ and â€˜Swami meaning â€˜master of the sensesâ€™. The title Goswami is usually conferred on those who have renounced social and material ties, taken vows of sannyasa and who live to teach the ways of God. Goswamis are also called Gossains who are further divided into Dandis and Rawanvansis. The surnames used by Goswamis are Giri, Bharati, Sagara, etc.', 'Goswami Matrimony - Goswami Matrimonial - Goswami Matrimonials - Goswami Marriage - Online Goswami Matrimonials - Matrimonial Services', 'Search Goswami Matrimony, Goswami Matrimonial, Goswami Matrimonials, Goswami Marriage, Goswami Matrimonial Profiles in the leading Goswami Matrimonials site for Indian and NRI Goswami Marriage. Join Free & Add your Goswami Matrimonial Profile Now! Find suitable Indian & NRI Goswami brides and grooms from our online Goswami matrimonial and matchmaking services.', 'Goswami matrimony, Goswami matrimonials, Goswami matrimonial, matrimonials, matrimony, matrimony services, online Goswami matrimonials, Indian marriage, match making, matchmaker, Goswami profiles, marriage bureau , Goswami marriage bureau, matchmaking services, matrimonial profiles, Goswami bride, Goswami groom, matrimony classified, brides, grooms', 'Goswami Matrimonials', 'Y', 'goswami-matrimonials.jpg', 'Goswami Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (730, 'Hindu: Brahmin Havyaka', 'Brahmin Havyaka', 'CASTE', '35', 1, '/matrimonials/havyaka-brahmin-matrimonial/', 'Y', 'L1_CA_730', 'Brahmins are divided into Pancha Gauda and Pancha Dravida Brahmins with former belonging to North India and latter to South. Havyaka Brahmins are a sub sect of Hindu Pancha Dravida Brahmins settled in the states of Karnataka and Kerala. Havyaka comes from â€˜Havyagaâ€™ which includes those who perform Havana and Homa. It may be derived from Haigunda, a place that was inhabited by Havyakas. Havigannada, a dialect of Kannada is the primary language of Havyaka Brahmins though not for all Keraliites.', 'Havyaka Brahmin Matrimony - Havyaka Brahmin Matrimonial - Havyaka Brahmin Matrimonials - Havyaka Brahmin Marriage - Online Havyaka Brahmin Matrimonials - Matrimonial Services', 'Search Havyaka Brahmin Matrimony, Havyaka Brahmin Matrimonial, Havyaka Brahmin Matrimonials, Havyaka Brahmin Marriage, Havyaka Brahmin Matrimonial Profiles in the leading Havyaka Brahmin Matrimonials site for Indian and NRI Havyaka Brahmin Marriage. Join Free & Add your Havyaka Brahmin Matrimonial Profile Now! Find suitable Indian & NRI Havyaka Brahmin brides and grooms from our online Havyaka Brahmin matrimonial and matchmaking services.', 'Havyaka Brahmin matrimony, Havyaka Brahmin matrimonials, Havyaka Brahmin matrimonial, matrimonials, matrimony, matrimony services, online Havyaka Brahmin matrimonials, Indian marriage, match making, matchmaker, Havyaka Brahmin profiles, marriage bureau , Havyaka Brahmin marriage bureau, matchmaking services, matrimonial profiles, Havyaka Brahmin bride, Havyaka Brahmin groom, matrimony classified, brides, grooms', 'Havyaka Brahmin Matrimonials', 'Y', 'havyaka-brahmin-matrimonials.jpg', 'Havyaka Brahmin Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (731, 'Hindu: Brahmin Kumaoni', 'Kumaoni', 'CASTE', '40', 1, '/matrimonials/kumaoni-matrimonial/', 'Y', 'L1_CA_731', 'Kumaoni caste derives its name from Kumaon region located in Uttarakhand in northern India. And the name of Kumaon region comes from â€˜Kurmanchalâ€™, the land of tortoise incarnation of Lord Vishnu, Karmavatar. Kumaoni people are settled in the states of Bihar, Assam, UP, Maharashtra, Punjab, Madhya Pradesh, Himachal Pradesh and Delhi. It includes all those people who speak in Kumaoni or any of its 20 dialects while some may speak in Hindi as well. Kumaonis adhere to Hinduism as their religion.', 'Kumaoni Matrimony - Kumaoni Matrimonial - Kumaoni Matrimonials - Kumaoni Marriage - Online Kumaoni Matrimonials - Matrimonial Services', 'Search Kumaoni Matrimony, Kumaoni Matrimonial, Kumaoni Matrimonials, Kumaoni Marriage, Kumaoni Matrimonial Profiles in the leading Kumaoni Matrimonials site for Indian and NRI Kumaoni Marriage. Join Free & Add your Kumaoni Matrimonial Profile Now! Find suitable Indian & NRI Kumaoni brides and grooms from our online Kumaoni matrimonial and matchmaking services.', 'Kumaoni matrimony, Kumaoni matrimonials, Kumaoni matrimonial, matrimonials, matrimony, matrimony services, online Kumaoni matrimonials, Indian marriage, match making, matchmaker, Kumaoni profiles, marriage bureau , Kumaoni marriage bureau, matchmaking services, matrimonial profiles, Kumaoni bride, Kumaoni groom, matrimony classified, brides, grooms', 'Kumaoni Matrimonials', 'Y', 'kumaoni-matrimonials.jpg', 'Kumaoni Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (732, 'Hindu: Brahmin Madhwa', 'Madhwa', 'CASTE', '41', 1, '/matrimonials/madhwa-matrimonial/', 'Y', 'L1_CA_732', 'Madhwa is a community of Brahmins who believe in the doctrine codified by Madhwa Acharya called Dvaita or Dualism. According to this Vedanta philosophy, there is a difference between Ishvara (Supreme God) and Jiva (Subordinate Soul). The members of Madhwa community are Vaishnavites and are usually settled in southern and southeastern India- Kerala, Tamil Nadu, Goa, Andhra Pradesh and Maharashtra. Kannada is spoken by majority of Madhwas but Telugu and Marathi are also common in the community.', 'Madhwa Matrimony - Madhwa Matrimonial - Madhwa Matrimonials - Madhwa Marriage - Online Madhwa Matrimonials - Matrimonial Services', 'Search Madhwa Matrimony, Madhwa Matrimonial, Madhwa Matrimonials, Madhwa Marriage, Madhwa Matrimonial Profiles in the leading Madhwa Matrimonials site for Indian and NRI Madhwa Marriage. Join Free & Add your Madhwa Matrimonial Profile Now! Find suitable Indian & NRI Madhwa brides and grooms from our online Madhwa matrimonial and matchmaking services.', 'Madhwa matrimony, Madhwa matrimonials, Madhwa matrimonial, matrimonials, matrimony, matrimony services, online Madhwa matrimonials, Indian marriage, match making, matchmaker, Madhwa profiles, marriage bureau , Madhwa marriage bureau, matchmaking services, matrimonial profiles, Madhwa bride, Madhwa groom, matrimony classified, brides, grooms', 'Madhwa Matrimonials', 'Y', 'madhwa-matrimonials.jpg', 'Madhwa Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (733, 'Hindu: Brahmin Nagar', 'Nagar', 'CASTE', '43', 1, '/matrimonials/nagar-matrimonial/', 'Y', 'L1_CA_733', 'Nagar is one of the oldest Brahmin communities and historians claim that Nagar Brahmins are Aryans. But there are different stories of their origin as some say they came from Greece, Syria or other regions in proximity to this area. Another interesting account of their origin is based on the literal meaning of â€˜Nagarâ€™ i.e. â€˜people living in mountainous regionsâ€™. Besides these versions of historians, the origin of Nagars is related to mythology as well with different legends and tales being told.', 'Nagar Matrimony - Nagar Matrimonial - Nagar Matrimonials - Nagar Marriage - Online Nagar Matrimonials - Matrimonial Services', 'Search Nagar Matrimony, Nagar Matrimonial, Nagar Matrimonials, Nagar Marriage, Nagar Matrimonial Profiles in the leading Nagar Matrimonials site for Indian and NRI Nagar Marriage. Join Free & Add your Nagar Matrimonial Profile Now! Find suitable Indian & NRI Nagar brides and grooms from our online Nagar matrimonial and matchmaking services.', 'Nagar matrimony, Nagar matrimonials, Nagar matrimonial, matrimonials, matrimony, matrimony services, online Nagar matrimonials, Indian marriage, match making, matchmaker, Nagar profiles, marriage bureau , Nagar marriage bureau, matchmaking services, matrimonial profiles, Nagar bride, Nagar groom, matrimony classified, brides, grooms', 'Nagar Matrimonials', 'Y', 'nagar-matrimonials.jpg', 'Nagar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (734, 'Hindu: Brahmin Smartha', 'Smartha', 'CASTE', '48', 1, '/matrimonials/smartha-matrimonial/', 'Y', 'L1_CA_734', 'Smartha is a denomination of Vedic Hindu religion that accepts all Hindu deities as forms of one i.e. the Brahman. The term â€˜Smartaâ€™ thus refers to all those who follow the Vedas and the Shastras. It literally means â€˜relating to memory, based on tradition, prescribed by traditional law, etc.â€™ in Sanskrit. Most of the Smartha communities are found in south Indian states of Karnataka, Tamil Nadu, Andhra Pradesh and Kerala. Maharashtra and Goa are two other states housing the population of Smartas.', 'Smartha Matrimony - Smartha Matrimonial - Smartha Matrimonials - Smartha Marriage - Online Smartha Matrimonials - Matrimonial Services', 'Search Smartha Matrimony, Smartha Matrimonial, Smartha Matrimonials, Smartha Marriage, Smartha Matrimonial Profiles in the leading Smartha Matrimonials site for Indian and NRI Smartha Marriage. Join Free & Add your Smartha Matrimonial Profile Now! Find suitable Indian & NRI Smartha brides and grooms from our online Smartha matrimonial and matchmaking services.', 'Smartha matrimony, Smartha matrimonials, Smartha matrimonial, matrimonials, matrimony, matrimony services, online Smartha matrimonials, Indian marriage, match making, matchmaker, Smartha profiles, marriage bureau , Smartha marriage bureau, matchmaking services, matrimonial profiles, Smartha bride, Smartha groom, matrimony classified, brides, grooms', 'Smartha Matrimonials', 'Y', 'smartha-matrimonials.jpg', 'Smartha Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (735, 'Hindu: Brahmin Vaidiki', 'Vaidiki', 'CASTE', '49', 1, '/matrimonials/vaidiki-matrimonial/', 'Y', 'L1_CA_735', 'Vaidiki is the community of Smartha Brahmins who speak in Telugu and follow Adi Shankaracharya. The people belonging to this caste believe in Hinduism and are usually found in the state of Andhra Pradesh. Vaidikis, also called Ghanaapaathi are those who have mastered Vedas; in fact, the term Vaidikis comes from the word â€˜Vedasâ€™. Their sub castes include Velanadu, Telaganyulu, Mulakanadu, Kasalnadu, Veginadu, Karanakammalu and Murikinadu. Their family lineage is defined by surnames and gotras.', 'Vaidiki Matrimony - Vaidiki Matrimonial - Vaidiki Matrimonials - Vaidiki Marriage - Online Vaidiki Matrimonials - Matrimonial Services', 'Search Vaidiki Matrimony, Vaidiki Matrimonial, Vaidiki Matrimonials, Vaidiki Marriage, Vaidiki Matrimonial Profiles in the leading Vaidiki Matrimonials site for Indian and NRI Vaidiki Marriage. Join Free & Add your Vaidiki Matrimonial Profile Now! Find suitable Indian & NRI Vaidiki brides and grooms from our online Vaidiki matrimonial and matchmaking services.', 'Vaidiki matrimony, Vaidiki matrimonials, Vaidiki matrimonial, matrimonials, matrimony, matrimony services, online Vaidiki matrimonials, Indian marriage, match making, matchmaker, Vaidiki profiles, marriage bureau , Vaidiki marriage bureau, matchmaking services, matrimonial profiles, Vaidiki bride, Vaidiki groom, matrimony classified, brides, grooms', 'Vaidiki Matrimonials', 'Y', 'vaidiki-matrimonials.jpg', 'Vaidiki Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (736, 'Hindu: Brahmin Viswa', 'Viswa', 'CASTE', '50', 1, '/matrimonials/viswa-brahmin-matrimonial/', 'Y', 'L1_CA_736', 'Viswa Brahmins, also called Visvakarmas, is a community comprising five sub castes namely- carpenters, sculptors, blacksmiths, coppersmiths and goldsmiths. Viswa Brahmins are traditionally the descendants of the sons of Lord Vishwakarma- Manu, Maya, Twashtha, Silpi and Vishwajnya. Viswa Brahmins are classified into 5 gotras- Sanaga, Sanatana, Abhuvana, Pratanan and Suparna- which are further sub divided into 25 upagotras. They are found in MP, HP, AP, UP, Punjab, Bihar and other nearby states.', 'Viswa Brahmin Matrimony - Viswa Brahmin Matrimonial - Viswa Brahmin Matrimonials - Viswa Brahmin Marriage - Online Viswa Brahmin Matrimonials - Matrimonial Services', 'Search Viswa Brahmin Matrimony, Viswa Brahmin Matrimonial, Viswa Brahmin Matrimonials, Viswa Brahmin Marriage, Viswa Brahmin Matrimonial Profiles in the leading Viswa Brahmin Matrimonials site for Indian and NRI Viswa Brahmin Marriage. Join Free & Add your Viswa Brahmin Matrimonial Profile Now! Find suitable Indian & NRI Viswa Brahmin brides and grooms from our online Viswa Brahmin matrimonial and matchmaking services.', 'Viswa Brahmin matrimony, Viswa Brahmin matrimonials, Viswa Brahmin matrimonial, matrimonials, matrimony, matrimony services, online Viswa Brahmin matrimonials, Indian marriage, match making, matchmaker, Viswa Brahmin profiles, marriage bureau , Viswa Brahmin marriage bureau, matchmaking services, matrimonial profiles, Viswa Brahmin bride, Viswa Brahmin groom, matrimony classified, brides, grooms', 'Viswa Brahmin Matrimonials', 'Y', 'viswa-brahmin-matrimonials.jpg', 'Viswa Brahmin Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (737, 'Hindu: Bunt', 'Bunt', 'CASTE', '51', 1, '/matrimonials/bunt-matrimonial/', 'Y', 'L1_CA_737', 'Bunt is a Hindu community, inhabiting southwestern and southern India, of erstwhile feudatory, nobility and gentry. Bunt is a Kshatriya clan that claims its descent from Nagavanshi lineage and is a multilingual caste that mainly speaks in Tulu and Kannada. The word Bunt comes from the Sanskrit word â€˜Bhataâ€™ that means soldier in Tulu language and belongs to â€˜Military Classâ€™ of the Tulu Nadu region. Bunts are sub divided into 4 main divisions- Masadika Bunt, Nad Bunt, Parivara Bunt and Jain Bunt.', 'Bunt Matrimony - Bunt Matrimonial - Bunt Matrimonials - Bunt Marriage - Online Bunt Matrimonials - Matrimonial Services', 'Search Bunt Matrimony, Bunt Matrimonial, Bunt Matrimonials, Bunt Marriage, Bunt Matrimonial Profiles in the leading Bunt Matrimonials site for Indian and NRI Bunt Marriage. Join Free & Add your Bunt Matrimonial Profile Now! Find suitable Indian & NRI Bunt brides and grooms from our online Bunt matrimonial and matchmaking services.', 'Bunt matrimony, Bunt matrimonials, Bunt matrimonial, matrimonials, matrimony, matrimony services, online Bunt matrimonials, Indian marriage, match making, matchmaker, Bunt profiles, marriage bureau , Bunt marriage bureau, matchmaking services, matrimonial profiles, Bunt bride, Bunt groom, matrimony classified, brides, grooms', 'Bunt Matrimonials', 'Y', 'bunt-matrimonials.jpg', 'Bunt Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (738, 'Hindu: Chambhar', 'Chambhar', 'CASTE', '52', 1, '/matrimonials/chambhar-matrimonial/', 'Y', 'L1_CA_738', 'Chambhars form the largest Marathi Scheduled community along with the Mahars. They have been traditionally associated with leather related works but are now taking up different professions. Chambhar, the caste of shoe makers is an important part of Dhangar community that is sub divided into 23 categories. Chambhar are Marathi people and are also referred to as Maharashtrians while their community is sometimes called Marathas. Their important festivals include Hartalka, Kojagari and Ghatsthapna.', 'Chambhar Matrimony - Chambhar Matrimonial - Chambhar Matrimonials - Chambhar Marriage - Online Chambhar Matrimonials - Matrimonial Services', 'Search Chambhar Matrimony, Chambhar Matrimonial, Chambhar Matrimonials, Chambhar Marriage, Chambhar Matrimonial Profiles in the leading Chambhar Matrimonials site for Indian and NRI Chambhar Marriage. Join Free & Add your Chambhar Matrimonial Profile Now! Find suitable Indian & NRI Chambhar brides and grooms from our online Chambhar matrimonial and matchmaking services.', 'Chambhar matrimony, Chambhar matrimonials, Chambhar matrimonial, matrimonials, matrimony, matrimony services, online Chambhar matrimonials, Indian marriage, match making, matchmaker, Chambhar profiles, marriage bureau , Chambhar marriage bureau, matchmaking services, matrimonial profiles, Chambhar bride, Chambhar groom, matrimony classified, brides, grooms', 'Chambhar Matrimonials', 'Y', 'chambhar-matrimonials.jpg', 'Chambhar Matrimony\r\n');
