INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (740, 'Hindu: Chettiar', 'Chettiar', 'CASTE', '54', 1, '/matrimonials/chettiar-matrimonial/', 'Y', 'L1_CA_740', 'Chettiar is the title used by the group that originated from south India and belongs to Vaishya varna of Hindu society. Chettiar makes up for nearly 15% population of Tamil Nadu, becoming the 3rd most dominant clan in the state. The word â€˜Ettiâ€™ comes either from Dravidian usage implying selling and advertising merchandise or from Kannada meaning â€˜collect and donateâ€™. Chettiar community speaks three languages usually, namely- Tamil, Telugu and Kannada. This title is used by various ethnic groups.', 'Chettiar Matrimony - Chettiar Matrimonial - Chettiar Matrimonials - Chettiar Marriage - Online Chettiar Matrimonials - Matrimonial Services', 'Search Chettiar Matrimony, Chettiar Matrimonial, Chettiar Matrimonials, Chettiar Marriage, Chettiar Matrimonial Profiles in the leading Chettiar Matrimonials site for Indian and NRI Chettiar Marriage. Join Free & Add your Chettiar Matrimonial Profile Now! Find suitable Indian & NRI Chettiar brides and grooms from our online Chettiar matrimonial and matchmaking services.', 'Chettiar matrimony, Chettiar matrimonials, Chettiar matrimonial, matrimonials, matrimony, matrimony services, online Chettiar matrimonials, Indian marriage, match making, matchmaker, Chettiar profiles, marriage bureau , Chettiar marriage bureau, matchmaking services, matrimonial profiles, Chettiar bride, Chettiar groom, matrimony classified, brides, grooms', 'Chettiar Matrimonials', 'Y', 'chettiar-matrimonials.jpg', 'Chettiar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (741, 'Hindu: Devanga', 'Devanga', 'CASTE', '57', 1, '/matrimonials/devanga-matrimonial/', 'Y', 'L1_CA_741', 'Devangas have originated from northern Karnataka and are also referred to as â€˜Deva Brahminsâ€™ and â€˜Prakrut Brahminsâ€™. They are largely settled in southern India and in some parts of Madhya Pradesh and Maharashtra as well.\r\n\r\nDevanga matrimonial is based on endogamy i.e. they marry within their community. Their weddings are similar to Hindu marriages and are usually arranged by parents. They consult Sangas for the list of prospective grooms and brides, match horoscopes and finalize the wedding date.\r\n', 'Devanga Matrimony - Devanga Matrimonial - Devanga Matrimonials - Devanga Marriage - Online Devanga Matrimonials - Matrimonial Services', 'Search Devanga Matrimony, Devanga Matrimonial, Devanga Matrimonials, Devanga Marriage, Devanga Matrimonial Profiles in the leading Devanga Matrimonials site for Indian and NRI Devanga Marriage. Join Free & Add your Devanga Matrimonial Profile Now! Find suitable Indian & NRI Devanga brides and grooms from our online Devanga matrimonial and matchmaking services.', 'Devanga matrimony, Devanga matrimonials, Devanga matrimonial, matrimonials, matrimony, matrimony services, online Devanga matrimonials, Indian marriage, match making, matchmaker, Devanga profiles, marriage bureau , Devanga marriage bureau, matchmaking services, matrimonial profiles, Devanga bride, Devanga groom, matrimony classified, brides, grooms', 'Devanga Matrimonials', 'Y', 'devanga-matrimonials.jpg', 'Devanga Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (742, 'Hindu: Dhangar', 'Dhangar', 'CASTE', '58', 1, '/matrimonials/dhangar-matrimonial/', 'Y', 'L1_CA_742', 'Dhangars have originated from Maharashtra and the term literally means â€˜wealthyâ€™. Dhangad and Dhanpal are the other two names given to Dhangars. Even as they are divided into numerous sub castes, they refer to themselves only as Dhangars and not by other names. It is a Kshatriya caste i.e. one out of the three major Kshatriya caste, other two being Rajputs and Marathas. Jejuri is Kuladaivat of Dhangars and popular among them but they also worship forms of Shiva, Vishnu, Parvati and Mahalaxmi.', 'Dhangar Matrimony - Dhangar Matrimonial - Dhangar Matrimonials - Dhangar Marriage - Online Dhangar Matrimonials - Matrimonial Services', 'Search Dhangar Matrimony, Dhangar Matrimonial, Dhangar Matrimonials, Dhangar Marriage, Dhangar Matrimonial Profiles in the leading Dhangar Matrimonials site for Indian and NRI Dhangar Marriage. Join Free & Add your Dhangar Matrimonial Profile Now! Find suitable Indian & NRI Dhangar brides and grooms from our online Dhangar matrimonial and matchmaking services.', 'Dhangar matrimony, Dhangar matrimonials, Dhangar matrimonial, matrimonials, matrimony, matrimony services, online Dhangar matrimonials, Indian marriage, match making, matchmaker, Dhangar profiles, marriage bureau , Dhangar marriage bureau, matchmaking services, matrimonial profiles, Dhangar bride, Dhangar groom, matrimony classified, brides, grooms', 'Dhangar Matrimonials', 'Y', 'dhangar-matrimonials.jpg', 'Dhangar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (743, 'Hindu: Ezhava', 'Ezhavas', 'CASTE', '59', 1, '/matrimonials/ezhava-matrimonial/', 'Y', 'L1_CA_743', 'Ezhavas, the largest Hindu community in Kerala, are believed to be the descendants of Villavar. Villavar founded ancient Tamil Chera Dynasty that had ruled southern part of India once. They usually use occupational surnames such as Vaidyar, Amma, Mudaliyar, Thandan, Achan, Muthaliyar, Nadar, Chekavan and others. Ezhavas may be the followers of Hinduism, Sikhism or Christianity as those originally Hindus had converted their religion during different movements that took place around 19th century.', 'Ezhava Matrimony - Ezhava Matrimonial - Ezhava Matrimonials - Ezhava Marriage - Online Ezhava Matrimonials - Matrimonial Services', 'Search Ezhava Matrimony, Ezhava Matrimonial, Ezhava Matrimonials, Ezhava Marriage, Ezhava Matrimonial Profiles in the leading Ezhava Matrimonials site for Indian and NRI Ezhava Marriage. Join Free & Add your Ezhava Matrimonial Profile Now! Find suitable Indian & NRI Ezhava brides and grooms from our online Ezhava matrimonial and matchmaking services.', 'Ezhava matrimony, Ezhava matrimonials, Ezhava matrimonial, matrimonials, matrimony, matrimony services, online Ezhava matrimonials, Indian marriage, match making, matchmaker, Ezhava profiles, marriage bureau , Ezhava marriage bureau, matchmaking services, matrimonial profiles, Ezhava bride, Ezhava groom, matrimony classified, brides, grooms', 'Ezhava Matrimonials', 'Y', 'ezhava-matrimonials.jpg', 'Ezhava Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (744, 'Hindu: Goud', 'Goud', 'CASTE', '60', 1, '/matrimonials/goud-matrimonial/', 'Y', 'L1_CA_744', 'Goud is one of the largest castes in southwest India primarily in the states of Andhra Pradesh, Orissa, Karnataka and Maharashtra. They are believed to be Somavansh Kshatriyas who adhere to Hinduism and are divided into worshippers of Lord Shiva and Lord Vishnu. Goud is one of the most progressive castes of Andhra Pradesh today and is usually involved in toddy tapping, liquor business, farming and such other modern professions. Earlier, they looked after Soma and Ayurvedic medicine development.', 'Goud Matrimony - Goud Matrimonial - Goud Matrimonials - Goud Marriage - Online Goud Matrimonials - Matrimonial Services', 'Search Goud Matrimony, Goud Matrimonial, Goud Matrimonials, Goud Marriage, Goud Matrimonial Profiles in the leading Goud Matrimonials site for Indian and NRI Goud Marriage. Join Free & Add your Goud Matrimonial Profile Now! Find suitable Indian & NRI Goud brides and grooms from our online Goud matrimonial and matchmaking services.', 'Goud matrimony, Goud matrimonials, Goud matrimonial, matrimonials, matrimony, matrimony services, online Goud matrimonials, Indian marriage, match making, matchmaker, Goud profiles, marriage bureau , Goud marriage bureau, matchmaking services, matrimonial profiles, Goud bride, Goud groom, matrimony classified, brides, grooms', 'Goud Matrimonials', 'Y', 'goud-matrimonials.jpg', 'Goud Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (745, 'Hindu: Gowda', 'Gowda', 'CASTE', '62', 1, '/matrimonials/gowda-matrimonial/', 'Y', 'L1_CA_745', 'Gowda is the title given to a family head in south Indian states of Andhra Pradesh and Karnataka. It is not a caste but a title which is given to the elders or leaders who may belong to any caste. The term Gowda comes from the word â€˜Kavundaâ€™, meaning â€˜cattle breederâ€™ in Kannada. It is used as a surname by people from different castes in Tamil Nadu and Karnataka, especially by those whose ancestors were village or community heads. Some such communities include Lingayat, Golla, Devanga and others.', 'Gowda Matrimony - Gowda Matrimonial - Gowda Matrimonials - Gowda Marriage - Online Gowda Matrimonials - Matrimonial Services', 'Search Gowda Matrimony, Gowda Matrimonial, Gowda Matrimonials, Gowda Marriage, Gowda Matrimonial Profiles in the leading Gowda Matrimonials site for Indian and NRI Gowda Marriage. Join Free & Add your Gowda Matrimonial Profile Now! Find suitable Indian & NRI Gowda brides and grooms from our online Gowda matrimonial and matchmaking services.', 'Gowda matrimony, Gowda matrimonials, Gowda matrimonial, matrimonials, matrimony, matrimony services, online Gowda matrimonials, Indian marriage, match making, matchmaker, Gowda profiles, marriage bureau , Gowda marriage bureau, matchmaking services, matrimonial profiles, Gowda bride, Gowda groom, matrimony classified, brides, grooms', 'Gowda Matrimonials', 'Y', 'gowda-matrimonials.jpg', 'Gowda Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (746, 'Hindu: Brahmin Iyengar', ' Brahmin Iyengar', 'CASTE', '65', 1, '/matrimonials/iyengar-matrimonial/', 'Y', 'L1_CA_746', 'The Hindu Brahmins of Tamil origin are referred to as Iyengars and they believe in the philosophy of Visishtadvaita. They are predominantly settled in Tamil Nadu but are also found in the states of Andhra Pradesh and Karnataka. On the basis of their origin and philosophy, Iyengars are divided into numerous sub sects. \r\n\r\nIyengar matrimonial celebrations include events like Vethalaipakku, Pandalkal, Janwaasam, Kashiyathrai, Oonjal, Piddishuttal, Kanyadaanam, Akshathai, Homam, Saptapadi, Nagoli, etc.\r\n', 'Iyengar Matrimony - Iyengar Matrimonial - Iyengar Matrimonials - Iyengar Marriage - Online Iyengar Matrimonials - Matrimonial Services', 'Search Iyengar Matrimony, Iyengar Matrimonial, Iyengar Matrimonials, Iyengar Marriage, Iyengar Matrimonial Profiles in the leading Iyengar Matrimonials site for Indian and NRI Iyengar Marriage. Join Free & Add your Iyengar Matrimonial Profile Now! Find suitable Indian & NRI Iyengar brides and grooms from our online Iyengar matrimonial and matchmaking services.', 'Iyengar matrimony, Iyengar matrimonials, Iyengar matrimonial, matrimonials, matrimony, matrimony services, online Iyengar matrimonials, Indian marriage, match making, matchmaker, Iyengar profiles, marriage bureau , Iyengar marriage bureau, matchmaking services, matrimonial profiles, Iyengar bride, Iyengar groom, matrimony classified, brides, grooms', 'Iyengar Matrimonials', 'Y', 'iyengar-matrimonials.jpg', 'Iyengar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (747, 'Hindu: Marwari', 'Marwari', 'CASTE', '65', 1, '/matrimonials/marwari-matrimonial/', 'Y', 'L1_CA_747', 'Marwari is an Indo Aryan ethnic group from Rajasthan that primarily speaks in Rajasthani language. According to popular belief, only businessmen are referred to as Marwaris but the term is actually applied to those belonging to the region of Marwar in Rajasthan. They may belong to any profession and may be settled in any part of the country or abroad. Marwaris usually adhere to either Hinduism or Jainism and their main categories include- Agarwals, Maheshwaris, Oswals, Khandelwals and Chowdhrys.', 'Marwari Matrimony - Marwari Matrimonial - Marwari Matrimonials - Marwari Marriage - Online Marwari Matrimonials - Matrimonial Services', 'Search Marwari Matrimony, Marwari Matrimonial, Marwari Matrimonials, Marwari Marriage, Marwari Matrimonial Profiles in the leading Marwari Matrimonials site for Indian and NRI Marwari Marriage. Join Free & Add your Marwari Matrimonial Profile Now! Find suitable Indian & NRI Marwari brides and grooms from our online Marwari matrimonial and matchmaking services.', 'Marwari matrimony, Marwari matrimonials, Marwari matrimonial, matrimonials, matrimony, matrimony services, online Marwari matrimonials, Indian marriage, match making, matchmaker, Marwari profiles, marriage bureau , Marwari marriage bureau, matchmaking services, matrimonial profiles, Marwari bride, Marwari groom, matrimony classified, brides, grooms', 'Marwari Matrimonials', 'Y', 'marwari-matrimonials.jpg', 'Marwari Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (748, 'Hindu: Jatav', 'Jatav', 'CASTE', '72', 1, '/matrimonials/jatav-matrimonial/', 'Y', 'L1_CA_748', 'Jatav is believed to be a Kshatriya caste that claims its lineage from Lord Shiva. They are believed to be the survivors of the battle between Brahmins and Kshatriyas in ancient times. Jatav is a sub caste of Chamar community and is found in northern India in the states of Uttar Pradesh (UP), Rajasthan, Madhya Pradesh (MP), Jammu and Kashmir (J & K), Punjab, Haryana and Delhi. Hindi, Punjabi, Rajasthani and Braj Bhasha are some of the widely spoken languages by the people of Jatav community.', 'Jatav Matrimony - Jatav Matrimonial - Jatav Matrimonials - Jatav Marriage - Online Jatav Matrimonials - Matrimonial Services', 'Search Jatav Matrimony, Jatav Matrimonial, Jatav Matrimonials, Jatav Marriage, Jatav Matrimonial Profiles in the leading Jatav Matrimonials site for Indian and NRI Jatav Marriage. Join Free & Add your Jatav Matrimonial Profile Now! Find suitable Indian & NRI Jatav brides and grooms from our online Jatav matrimonial and matchmaking services.', 'Jatav matrimony, Jatav matrimonials, Jatav matrimonial, matrimonials, matrimony, matrimony services, online Jatav matrimonials, Indian marriage, match making, matchmaker, Jatav profiles, marriage bureau , Jatav marriage bureau, matchmaking services, matrimonial profiles, Jatav bride, Jatav groom, matrimony classified, brides, grooms', 'Jatav Matrimonials', 'Y', 'jatav-matrimonials.jpg', 'Jatav Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (749, 'Hindu: Kamma', 'Kamma', 'CASTE', '73', 1, '/matrimonials/kamma-matrimonial/', 'Y', 'L1_CA_749', 'Kamma is a social group from South India, largely found in Tamil Nadu, Andhra Pradesh and Karnataka. Also known as Kammavaru, they speak mainly in Telugu while some speak in Kannada and Tamil as well. This community follows religions of Hinduism or Buddhism and is settled not only in India but abroad as well. America, Australia, South Africa and UK are some of the countries with considerable population of Kamma people. Some of the common titles used by Kammas are Naidu, Rao Reddy, Chowdary, etc.', 'Kamma Matrimony - Kamma Matrimonial - Kamma Matrimonials - Kamma Marriage - Online Kamma Matrimonials - Matrimonial Services', 'Search Kamma Matrimony, Kamma Matrimonial, Kamma Matrimonials, Kamma Marriage, Kamma Matrimonial Profiles in the leading Kamma Matrimonials site for Indian and NRI Kamma Marriage. Join Free & Add your Kamma Matrimonial Profile Now! Find suitable Indian & NRI Kamma brides and grooms from our online Kamma matrimonial and matchmaking services.', 'Kamma matrimony, Kamma matrimonials, Kamma matrimonial, matrimonials, matrimony, matrimony services, online Kamma matrimonials, Indian marriage, match making, matchmaker, Kamma profiles, marriage bureau , Kamma marriage bureau, matchmaking services, matrimonial profiles, Kamma bride, Kamma groom, matrimony classified, brides, grooms', 'Kamma Matrimonials', 'Y', 'kamma-matrimonials.jpg', 'Kamma Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (750, 'Hindu: Kapu', 'Kapu', 'CASTE', '75', 1, '/matrimonials/kapu-matrimonial/', 'Y', 'L1_CA_750', 'Kapu, also known by the title Naidu is a south Indian caste and is mainly an agrarian community. Other titles used by Kapus are Setti, Hazari, etc. Telaga, Balija, Ontari, Munnuru Kapu and Turpu Kapu are the 5 sub castes that collectively form the Kapu community. Kapu people are settled in various parts of Andhra Pradesh, Kerala, Tamil Nadu, Karnataka, Orissa, Maharashtra and Chattisgarh. Kapus may be Hindus, Christians or Buddhists and their primary languages include Telugu, Kannada and Tamil.', 'Kapu Matrimony - Kapu Matrimonial - Kapu Matrimonials - Kapu Marriage - Online Kapu Matrimonials - Matrimonial Services', 'Search Kapu Matrimony, Kapu Matrimonial, Kapu Matrimonials, Kapu Marriage, Kapu Matrimonial Profiles in the leading Kapu Matrimonials site for Indian and NRI Kapu Marriage. Join Free & Add your Kapu Matrimonial Profile Now! Find suitable Indian & NRI Kapu brides and grooms from our online Kapu matrimonial and matchmaking services.', 'Kapu matrimony, Kapu matrimonials, Kapu matrimonial, matrimonials, matrimony, matrimony services, online Kapu matrimonials, Indian marriage, match making, matchmaker, Kapu profiles, marriage bureau , Kapu marriage bureau, matchmaking services, matrimonial profiles, Kapu bride, Kapu groom, matrimony classified, brides, grooms', 'Kapu Matrimonials', 'Y', 'kapu-matrimonials.jpg', 'Kapu Matrimony\r\n');
