INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (752, 'Hindu: Koli', 'Koli', 'CASTE', '79', 1, '/matrimonials/koli-matrimonial/', 'Y', 'L1_CA_752', 'The ethnic group of Kolis is considered to be settled across India but mostly found in the states of Andhra Pradesh, Gujarat and Maharashtra. Gujarati, Marathi and Koli are some of the languages spoken by Kolis, largely based on the region they live in. Kolis can be either Hindus or Christians and are divided into various sub castes.  Narali Punaw (new business season) and Shimga (Holi) are the two most important festivals for the community of Kolis. Many Koli songs are sung on these occasions.', 'Koli Matrimony - Koli Matrimonial - Koli Matrimonials - Koli Marriage - Online Koli Matrimonials - Matrimonial Services', 'Search Koli Matrimony, Koli Matrimonial, Koli Matrimonials, Koli Marriage, Koli Matrimonial Profiles in the leading Koli Matrimonials site for Indian and NRI Koli Marriage. Join Free & Add your Koli Matrimonial Profile Now! Find suitable Indian & NRI Koli brides and grooms from our online Koli matrimonial and matchmaking services.', 'Koli matrimony, Koli matrimonials, Koli matrimonial, matrimonials, matrimony, matrimony services, online Koli matrimonials, Indian marriage, match making, matchmaker, Koli profiles, marriage bureau , Koli marriage bureau, matchmaking services, matrimonial profiles, Koli bride, Koli groom, matrimony classified, brides, grooms', 'Koli Matrimonials', 'Y', 'koli-matrimonials.jpg', 'Koli Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (753, 'Hindu: Koshti', 'Koshti', 'CASTE', '81', 1, '/matrimonials/koshti-matrimonial/', 'Y', 'L1_CA_753', 'Koshti, a Kshatriya Hindu caste claims descent from the son of Lord Ram, Kush.  The term literally means â€˜raw silkâ€™ and the members of this caste are usually involved in the occupation of weaving clothes. The caste of Koshtis is divided into 15 sub castes, some of them are Devang Koshti, Lingayat Koshti, Halba Koshti, Salewar koshti, Gadhhewal koshti, Patvis koshti, Satsale koshti, Deshkar koshti, Padmashali koshti, etc. They are settled in western India in the states of Gujarat and Maharashtra.', 'Koshti Matrimony - Koshti Matrimonial - Koshti Matrimonials - Koshti Marriage - Online Koshti Matrimonials - Matrimonial Services', 'Search Koshti Matrimony, Koshti Matrimonial, Koshti Matrimonials, Koshti Marriage, Koshti Matrimonial Profiles in the leading Koshti Matrimonials site for Indian and NRI Koshti Marriage. Join Free & Add your Koshti Matrimonial Profile Now! Find suitable Indian & NRI Koshti brides and grooms from our online Koshti matrimonial and matchmaking services.', 'Koshti matrimony, Koshti matrimonials, Koshti matrimonial, matrimonials, matrimony, matrimony services, online Koshti matrimonials, Indian marriage, match making, matchmaker, Koshti profiles, marriage bureau , Koshti marriage bureau, matchmaking services, matrimonial profiles, Koshti bride, Koshti groom, matrimony classified, brides, grooms', 'Koshti Matrimonials', 'Y', 'koshti-matrimonials.jpg', 'Koshti Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (754, 'Hindu: Kunbi', 'Kunbi', 'CASTE', '84', 1, '/matrimonials/kunbi-matrimonial/', 'Y', 'L1_CA_754', 'Kunbi is a south Indian sub caste that is historically associated with agriculture. The term Kunbi comes from the Marathi word â€˜Kunbawaâ€™ meaning â€˜agricultural tillageâ€™. Other derivations are from words like â€˜Kutumbaâ€™ meaning family and â€˜Kunâ€™ or â€˜Kanâ€™ i.e. roots or grain.  Kunbis are also referred to as Kanbis or Kurmis. They are described as independent agricultural people who were robust yet quiet. The caste of Kunbis is sub divided into- Tirale, Maratha, Bawane, Khaire, Khedule and Dhanoje.', 'Kunbi Matrimony - Kunbi Matrimonial - Kunbi Matrimonials - Kunbi Marriage - Online Kunbi Matrimonials - Matrimonial Services', 'Search Kunbi Matrimony, Kunbi Matrimonial, Kunbi Matrimonials, Kunbi Marriage, Kunbi Matrimonial Profiles in the leading Kunbi Matrimonials site for Indian and NRI Kunbi Marriage. Join Free & Add your Kunbi Matrimonial Profile Now! Find suitable Indian & NRI Kunbi brides and grooms from our online Kunbi matrimonial and matchmaking services.', 'Kunbi matrimony, Kunbi matrimonials, Kunbi matrimonial, matrimonials, matrimony, matrimony services, online Kunbi matrimonials, Indian marriage, match making, matchmaker, Kunbi profiles, marriage bureau , Kunbi marriage bureau, matchmaking services, matrimonial profiles, Kunbi bride, Kunbi groom, matrimony classified, brides, grooms', 'Kunbi Matrimonials', 'Y', 'kunbi-matrimonials.jpg', 'Kunbi Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (755, 'Hindu: Kuruba', 'Kuruba', 'CASTE', '86', 1, '/matrimonials/kuruba-matrimonial/', 'Y', 'L1_CA_755', 'Kuruba is a Hindu caste, known by different names like Kumruma, Dhangars, Halumatha, etc. in different regions of the country. They are mainly settled in the state of Karnataka and can be found in Tamil Nadu and Maharashtra as well. The two major languages spoken by the community includes Kuruba and Kannada with Kurubas being the only caste in south India with their own language. The three gotras of Kurubas are Chandeeshwara, Manikya and Aane. They follow Halumatha, a denomination of Hinduism.', 'Kuruba Matrimony - Kuruba Matrimonial - Kuruba Matrimonials - Kuruba Marriage - Online Kuruba Matrimonials - Matrimonial Services', 'Search Kuruba Matrimony, Kuruba Matrimonial, Kuruba Matrimonials, Kuruba Marriage, Kuruba Matrimonial Profiles in the leading Kuruba Matrimonials site for Indian and NRI Kuruba Marriage. Join Free & Add your Kuruba Matrimonial Profile Now! Find suitable Indian & NRI Kuruba brides and grooms from our online Kuruba matrimonial and matchmaking services.', 'Kuruba matrimony, Kuruba matrimonials, Kuruba matrimonial, matrimonials, matrimony, matrimony services, online Kuruba matrimonials, Indian marriage, match making, matchmaker, Kuruba profiles, marriage bureau , Kuruba marriage bureau, matchmaking services, matrimonial profiles, Kuruba bride, Kuruba groom, matrimony classified, brides, grooms', 'Kuruba Matrimonials', 'Y', 'kuruba-matrimonials.jpg', 'Kuruba Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (756, 'Hindu: Kushwaha', 'Kushwaha', 'CASTE', '87', 1, '/matrimonials/kushwaha-matrimonial/', 'Y', 'L1_CA_756', 'Kushwahas are believed to be the descendants of Maurya dynasty and are settled in the states of Bihar, Uttar Pradesh, Madhya Pradesh, West Bengal, Assam, Punjab and Gujarat. People belonging to the caste of Kushwahas believe in Hinduism and are divided into two sects- Shaktitva and Bhaktitva. It is largely an agricultural caste whose members are generally involved in farming and agricultural business. Some of the Kushwaha surnames are Maurya, Kushwaha, Mehta, Morya, Kushwah, Mahto and others.', 'Kushwaha Matrimony - Kushwaha Matrimonial - Kushwaha Matrimonials - Kushwaha Marriage - Online Kushwaha Matrimonials - Matrimonial Services', 'Search Kushwaha Matrimony, Kushwaha Matrimonial, Kushwaha Matrimonials, Kushwaha Marriage, Kushwaha Matrimonial Profiles in the leading Kushwaha Matrimonials site for Indian and NRI Kushwaha Marriage. Join Free & Add your Kushwaha Matrimonial Profile Now! Find suitable Indian & NRI Kushwaha brides and grooms from our online Kushwaha matrimonial and matchmaking services.', 'Kushwaha matrimony, Kushwaha matrimonials, Kushwaha matrimonial, matrimonials, matrimony, matrimony services, online Kushwaha matrimonials, Indian marriage, match making, matchmaker, Kushwaha profiles, marriage bureau , Kushwaha marriage bureau, matchmaking services, matrimonial profiles, Kushwaha bride, Kushwaha groom, matrimony classified, brides, grooms', 'Kushwaha Matrimonials', 'Y', 'kushwaha-matrimonials.jpg', 'Kushwaha Matrimony\r\n');
