INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (758, 'Hindu: Lohana', 'Lohana', 'CASTE', '90', 1, '/matrimonials/lohana-matrimonial/', 'Y', 'L1_CA_758', 'Lohana is an Indo Aryan ethnic group that is believed to trace its lineage to warrior king Surya. Some believe they are the descendants of the sons of Lord Rama- Lava and Kush- those who originated from Lava are called Lohanas and those from Kush are Kushwahas. Lava is portrayed as a great warrior in Ramayana. Kshatriya Lohanas from Loharghat were referred to as Loharanas that meant â€˜master of swordsâ€™. These Raguvanshi Kshatriyas are today settled in Gujarat, Maharashtra, Rajasthan and Delhi.', 'Lohana Matrimony - Lohana Matrimonial - Lohana Matrimonials - Lohana Marriage - Online Lohana Matrimonials - Matrimonial Services', 'Search Lohana Matrimony, Lohana Matrimonial, Lohana Matrimonials, Lohana Marriage, Lohana Matrimonial Profiles in the leading Lohana Matrimonials site for Indian and NRI Lohana Marriage. Join Free & Add your Lohana Matrimonial Profile Now! Find suitable Indian & NRI Lohana brides and grooms from our online Lohana matrimonial and matchmaking services.', 'Lohana matrimony, Lohana matrimonials, Lohana matrimonial, matrimonials, matrimony, matrimony services, online Lohana matrimonials, Indian marriage, match making, matchmaker, Lohana profiles, marriage bureau , Lohana marriage bureau, matchmaking services, matrimonial profiles, Lohana bride, Lohana groom, matrimony classified, brides, grooms', 'Lohana Matrimonials', 'Y', 'lohana-matrimonials.jpg', 'Lohana Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (759, 'Hindu: Maheshwari', 'Maheshwari', 'CASTE', '91', 1, '/matrimonials/maheshwari-matrimonial/', 'Y', 'L1_CA_759', 'The community of Maheshwaris has originated from the state of Rajasthan in western India and is now found throughout north India. It is a sub group of Marwaris and a business community of Vaishnavaas. The people belonging to this community follow Lord Shiva, in fact, the term Maheshwari is derived from the word â€˜Maheshâ€™ which is another name for the God. This community is divided into Hindus (Meswari) and Jains (Shravaks) and further classified in six sections- Didu, Paukar, Dhakad, Patwa, etc.', 'Maheshwari Matrimony - Maheshwari Matrimonial - Maheshwari Matrimonials - Maheshwari Marriage - Online Maheshwari Matrimonials - Matrimonial Services', 'Search Maheshwari Matrimony, Maheshwari Matrimonial, Maheshwari Matrimonials, Maheshwari Marriage, Maheshwari Matrimonial Profiles in the leading Maheshwari Matrimonials site for Indian and NRI Maheshwari Marriage. Join Free & Add your Maheshwari Matrimonial Profile Now! Find suitable Indian & NRI Maheshwari brides and grooms from our online Maheshwari matrimonial and matchmaking services.', 'Maheshwari matrimony, Maheshwari matrimonials, Maheshwari matrimonial, matrimonials, matrimony, matrimony services, online Maheshwari matrimonials, Indian marriage, match making, matchmaker, Maheshwari profiles, marriage bureau , Maheshwari marriage bureau, matchmaking services, matrimonial profiles, Maheshwari bride, Maheshwari groom, matrimony classified, brides, grooms', 'Maheshwari Matrimonials', 'Y', 'maheshwari-matrimonials.jpg', 'Maheshwari Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (760, 'Hindu: Mahisya', 'Mahisya', 'CASTE', '92', 1, '/matrimonials/mahisya-matrimonial/', 'Y', 'L1_CA_760', 'Mahisya caste comprises Bengali Hindu people who are largely found in the states of West Bengal and Orissa. The status of Mahisyas lies between Kshatriya and Vaishya Varnas of Hindu society. It is believed that the children born of Kshatriya father and Vaishya mother are referred to as Mahishyas. They were traditionally laborers and tenant farmers but are now majorly employed in the business and service sectors. Biswas, Santra, Mondal and Samanta are among the common surnames found in Mahisyas.', 'Mahisya Matrimony - Mahisya Matrimonial - Mahisya Matrimonials - Mahisya Marriage - Online Mahisya Matrimonials - Matrimonial Services', 'Search Mahisya Matrimony, Mahisya Matrimonial, Mahisya Matrimonials, Mahisya Marriage, Mahisya Matrimonial Profiles in the leading Mahisya Matrimonials site for Indian and NRI Mahisya Marriage. Join Free & Add your Mahisya Matrimonial Profile Now! Find suitable Indian & NRI Mahisya brides and grooms from our online Mahisya matrimonial and matchmaking services.', 'Mahisya matrimony, Mahisya matrimonials, Mahisya matrimonial, matrimonials, matrimony, matrimony services, online Mahisya matrimonials, Indian marriage, match making, matchmaker, Mahisya profiles, marriage bureau , Mahisya marriage bureau, matchmaking services, matrimonial profiles, Mahisya bride, Mahisya groom, matrimony classified, brides, grooms', 'Mahisya Matrimonials', 'Y', 'mahisya-matrimonials.jpg', 'Mahisya Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (761, 'Hindu: Mali', 'Mali', 'CASTE', '93', 1, '/matrimonials/mali-matrimonial/', 'Y', 'L1_CA_761', 'Mali is a Hindu caste that derived its name from their occupation of gardening and is found in north India. They are also referred to as â€˜Phul Maliâ€™ and this comes from their job of growing flowers in the gardens. The origin of the word Mali comes from a Sanskrit word â€˜Malaâ€™ meaning â€˜garlandâ€™ but there can be different kinds of Malis based on the tasks they undertake. Baghban, Kuta Mali, Sasia Mali, Jadon Mali, etc. are some of the names given to Malis according to the work they are engaged in.', 'Mali Matrimony - Mali Matrimonial - Mali Matrimonials - Mali Marriage - Online Mali Matrimonials - Matrimonial Services', 'Search Mali Matrimony, Mali Matrimonial, Mali Matrimonials, Mali Marriage, Mali Matrimonial Profiles in the leading Mali Matrimonials site for Indian and NRI Mali Marriage. Join Free & Add your Mali Matrimonial Profile Now! Find suitable Indian & NRI Mali brides and grooms from our online Mali matrimonial and matchmaking services.', 'Mali matrimony, Mali matrimonials, Mali matrimonial, matrimonials, matrimony, matrimony services, online Mali matrimonials, Indian marriage, match making, matchmaker, Mali profiles, marriage bureau , Mali marriage bureau, matchmaking services, matrimonial profiles, Mali bride, Mali groom, matrimony classified, brides, grooms', 'Mali Matrimonials', 'Y', 'mali-matrimonials.jpg', 'Mali Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (762, 'Hindu: Maurya', 'Maurya', 'CASTE', '96', 1, '/matrimonials/maurya-matrimonial/', 'Y', 'L1_CA_762', 'The caste of Mauryas belongs to Kshatriya varna of Hinduism and is largely an agricultural community. Mauryas are believed to be settled mostly in north Indian states of Bihar, Uttar Pradesh and Madhya Pradesh. Among the other Kshatriya castes Mauryas are allied with are- Kashi, Shakya, Bhagirathi and Sagarvanshi. Kushwaha, Maurya, Singh, Mahto, Saini, Morya, Mehta, Prasad, Hardia, Verma, Rana, Dhaka, Vadiya, Chaudhary, Panjiyara and Mandal are some of the titles used by people of Maurya caste.', 'Maurya Matrimony - Maurya Matrimonial - Maurya Matrimonials - Maurya Marriage - Online Maurya Matrimonials - Matrimonial Services', 'Search Maurya Matrimony, Maurya Matrimonial, Maurya Matrimonials, Maurya Marriage, Maurya Matrimonial Profiles in the leading Maurya Matrimonials site for Indian and NRI Maurya Marriage. Join Free & Add your Maurya Matrimonial Profile Now! Find suitable Indian & NRI Maurya brides and grooms from our online Maurya matrimonial and matchmaking services.', 'Maurya matrimony, Maurya matrimonials, Maurya matrimonial, matrimonials, matrimony, matrimony services, online Maurya matrimonials, Indian marriage, match making, matchmaker, Maurya profiles, marriage bureau , Maurya marriage bureau, matchmaking services, matrimonial profiles, Maurya bride, Maurya groom, matrimony classified, brides, grooms', 'Maurya Matrimonials', 'Y', 'maurya-matrimonials.jpg', 'Maurya Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (763, 'Hindu: Menon', 'Menon', 'CASTE', '97', 1, '/matrimonials/menon-matrimonial/', 'Y', 'L1_CA_763', 'Menon is an honorific hereditary title that was used as an affix to the name of some members belonging to Kiryathi and Akattu Charna classes. It is considered to be a Kshatriya subdivision of the Nair caste that originated from the south Indian state of Kerala.  They believe in Hinduism and speak Malayalam as their main language. \r\n\r\nSome of the prominent Menon families are Thottakkat, Chanayil, Kuruppathu, etc. Menon matrimonial is usually arranged in royal families of Cochin and Malabar only.', 'Menon Matrimony - Menon Matrimonial - Menon Matrimonials - Menon Marriage - Online Menon Matrimonials - Matrimonial Services', 'Search Menon Matrimony, Menon Matrimonial, Menon Matrimonials, Menon Marriage, Menon Matrimonial Profiles in the leading Menon Matrimonials site for Indian and NRI Menon Marriage. Join Free & Add your Menon Matrimonial Profile Now! Find suitable Indian & NRI Menon brides and grooms from our online Menon matrimonial and matchmaking services.', 'Menon matrimony, Menon matrimonials, Menon matrimonial, matrimonials, matrimony, matrimony services, online Menon matrimonials, Indian marriage, match making, matchmaker, Menon profiles, marriage bureau , Menon marriage bureau, matchmaking services, matrimonial profiles, Menon bride, Menon groom, matrimony classified, brides, grooms', 'Menon Matrimonials', 'Y', 'menon-matrimonials.jpg', 'Menon Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (764, 'Hindu: Mudaliar', 'Mudaliar', 'CASTE', '98', 1, '/matrimonials/mudaliar-matrimonial/', 'Y', 'L1_CA_764', 'The title of Mudaliar is used by various Tamil castes both in India and abroad. It comes from the word â€˜Mudaliâ€™ in Tamil which was used for persons of first rank, usually bureaucratic and army officers. Mudaliar then typically means first ones or even first citizens. Mudali clans or Thondaimandalam are divided into 24 Kottams and many of them have migrated to countries like Sri Lanka, Singapore and Malaysia. Gatti Mudaliar, Nanjil Mudali, Arcot Mudaliar, Kerala Mudailar are some of the castes.', 'Mudaliar Matrimony - Mudaliar Matrimonial - Mudaliar Matrimonials - Mudaliar Marriage - Online Mudaliar Matrimonials - Matrimonial Services', 'Search Mudaliar Matrimony, Mudaliar Matrimonial, Mudaliar Matrimonials, Mudaliar Marriage, Mudaliar Matrimonial Profiles in the leading Mudaliar Matrimonials site for Indian and NRI Mudaliar Marriage. Join Free & Add your Mudaliar Matrimonial Profile Now! Find suitable Indian & NRI Mudaliar brides and grooms from our online Mudaliar matrimonial and matchmaking services.', 'Mudaliar matrimony, Mudaliar matrimonials, Mudaliar matrimonial, matrimonials, matrimony, matrimony services, online Mudaliar matrimonials, Indian marriage, match making, matchmaker, Mudaliar profiles, marriage bureau , Mudaliar marriage bureau, matchmaking services, matrimonial profiles, Mudaliar bride, Mudaliar groom, matrimony classified, brides, grooms', 'Mudaliar Matrimonials', 'Y', 'mudaliar-matrimonials.jpg', 'Mudaliar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (765, 'Hindu: Mudaliar Arcot', 'Mudaliar Arcot', 'CASTE', '99', 1, '/matrimonials/mudaliar-arcot-matrimonial/', 'Y', 'L1_CA_765', 'Mudaliar Arcot, a sub caste of Vellalars is also known as Thuluva Vellalar or Tuluva or Tulumar. They are believed to be the immigrants from Tulunad in South Canara in Karnataka. Arcot Mudaliar is a prominent caste in Mudaliars of the states of Tamil Nadu and Andhra Pradesh. They can be found in Vellore, Thiruvallur and Kanchipuram districts of Thondaimandalam regions of Tamil Nadu in large numbers. People belonging to Mudaliar Arcot community speak Tamil and Kannada as their primary language.', 'Mudaliar Arcot Matrimony - Mudaliar Arcot Matrimonial - Mudaliar Arcot Matrimonials - Mudaliar Arcot Marriage - Online Mudaliar Arcot Matrimonials - Matrimonial Services', 'Search Mudaliar Arcot Matrimony, Mudaliar Arcot Matrimonial, Mudaliar Arcot Matrimonials, Mudaliar Arcot Marriage, Mudaliar Arcot Matrimonial Profiles in the leading Mudaliar Arcot Matrimonials site for Indian and NRI Mudaliar Arcot Marriage. Join Free & Add your Mudaliar Arcot Matrimonial Profile Now! Find suitable Indian & NRI Mudaliar Arcot brides and grooms from our online Mudaliar Arcot matrimonial and matchmaking services.', 'Mudaliar Arcot matrimony, Mudaliar Arcot matrimonials, Mudaliar Arcot matrimonial, matrimonials, matrimony, matrimony services, online Mudaliar Arcot matrimonials, Indian marriage, match making, matchmaker, Mudaliar Arcot profiles, marriage bureau , Mudaliar Arcot marriage bureau, matchmaking services, matrimonial profiles, Mudaliar Arcot bride, Mudaliar Arcot groom, matrimony classified, brides, grooms', 'Mudaliar Arcot Matrimonials', 'Y', 'mudaliar-arcot-matrimonials.jpg', 'Mudaliar Arcot Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (766, 'Hindu: Mogaveera', 'Mogaveera', 'CASTE', '100', 1, '/matrimonials/mogaveera-matrimonial/', 'Y', 'L1_CA_766', 'Mogaveera, the major fishing community, forms one of the largest Tulu communities in coastal Karnataka. Mogaveeras are known by different names such as Marakalas, Bovis, Mogeyar, etc. and speak various languages like Kannada, Konkani and Tulu. They usually are in professions related to fishermen, boatmen, palanquin bearers, porters, oil pressing, agriculture, etc. Sapaliga, Ganiga and Bovi are the three main sub communities of Mogaveeras that are classified on the basis of their occupations.', 'Mogaveera Matrimony - Mogaveera Matrimonial - Mogaveera Matrimonials - Mogaveera Marriage - Online Mogaveera Matrimonials - Matrimonial Services', 'Search Mogaveera Matrimony, Mogaveera Matrimonial, Mogaveera Matrimonials, Mogaveera Marriage, Mogaveera Matrimonial Profiles in the leading Mogaveera Matrimonials site for Indian and NRI Mogaveera Marriage. Join Free & Add your Mogaveera Matrimonial Profile Now! Find suitable Indian & NRI Mogaveera brides and grooms from our online Mogaveera matrimonial and matchmaking services.', 'Mogaveera matrimony, Mogaveera matrimonials, Mogaveera matrimonial, matrimonials, matrimony, matrimony services, online Mogaveera matrimonials, Indian marriage, match making, matchmaker, Mogaveera profiles, marriage bureau , Mogaveera marriage bureau, matchmaking services, matrimonial profiles, Mogaveera bride, Mogaveera groom, matrimony classified, brides, grooms', 'Mogaveera Matrimonials', 'Y', 'mogaveera-matrimonials.jpg', 'Mogaveera Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (767, 'Hindu: Nadar', 'Nadar', 'CASTE', '101', 1, '/matrimonials/nadar-matrimonial/', 'Y', 'L1_CA_767', 'The term Nadar stands for â€˜those who rule the landâ€™ in Tamil and is among the prominent castes in Tamil Nadu. They are believed to be the entrepreneurial caste of south India and make up for about 12% population of Tamil Nadu. Nadar is regarded as a powerful community, politically as well as financially.  They believe in the faiths of Hinduism, Christianity and Ayyavazhi (another Hindu sect in South India). Their sub castes include Karukkupattaiyathar, Mel-nattar, Nattathi, Kodikal and Kalla.', 'Nadar Matrimony - Nadar Matrimonial - Nadar Matrimonials - Nadar Marriage - Online Nadar Matrimonials - Matrimonial Services', 'Search Nadar Matrimony, Nadar Matrimonial, Nadar Matrimonials, Nadar Marriage, Nadar Matrimonial Profiles in the leading Nadar Matrimonials site for Indian and NRI Nadar Marriage. Join Free & Add your Nadar Matrimonial Profile Now! Find suitable Indian & NRI Nadar brides and grooms from our online Nadar matrimonial and matchmaking services.', 'Nadar matrimony, Nadar matrimonials, Nadar matrimonial, matrimonials, matrimony, matrimony services, online Nadar matrimonials, Indian marriage, match making, matchmaker, Nadar profiles, marriage bureau , Nadar marriage bureau, matchmaking services, matrimonial profiles, Nadar bride, Nadar groom, matrimony classified, brides, grooms', 'Nadar Matrimonials', 'Y', 'nadar-matrimonials.jpg', 'Nadar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (768, 'Hindu: Naidu', 'Naidu', 'CASTE', '102', 1, '/matrimonials/naidu-matrimonial/', 'Y', 'L1_CA_768', 'Naidu is a Telugu derivation of the Sanskrit word â€˜Nayakaâ€™ which means leader. This title is used by social groups chiefly in south India in the states of Tamil Nadu, Andhra Pradesh, Kerala, Karnataka, Orissa, Maharashtra and Chattisgarh. \r\n\r\nNaidu matrimonial celebrations include various pre and post wedding customs that are full of symbolism. With emphasis on spirituality, wedding rites are performed by purohits. Madhuparkam, Mangalsutra, Kanyadaan and Saptapadi are some of the wedding ceremonies.', 'Naidu Matrimony - Naidu Matrimonial - Naidu Matrimonials - Naidu Marriage - Online Naidu Matrimonials - Matrimonial Services', 'Search Naidu Matrimony, Naidu Matrimonial, Naidu Matrimonials, Naidu Marriage, Naidu Matrimonial Profiles in the leading Naidu Matrimonials site for Indian and NRI Naidu Marriage. Join Free & Add your Naidu Matrimonial Profile Now! Find suitable Indian & NRI Naidu brides and grooms from our online Naidu matrimonial and matchmaking services.', 'Naidu matrimony, Naidu matrimonials, Naidu matrimonial, matrimonials, matrimony, matrimony services, online Naidu matrimonials, Indian marriage, match making, matchmaker, Naidu profiles, marriage bureau , Naidu marriage bureau, matchmaking services, matrimonial profiles, Naidu bride, Naidu groom, matrimony classified, brides, grooms', 'Naidu Matrimonials', 'Y', 'naidu-matrimonials.jpg', 'Naidu Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (769, 'Hindu: Nambiar', 'Nambiar', 'CASTE', '104', 1, '/matrimonials/nambiar-matrimonial/', 'Y', 'L1_CA_769', 'Nambiar is a title that dignifies some endogamous communities of Nairs in Kerala. This word comes from a Malayalam term â€˜Nambukaâ€™ (trust) or â€˜Nambuâ€™ (truth) meaning those who are trusted. This term is affixed by those who were the feudal estate owners, leaders of militias or were from landed gentry.\r\n\r\nNambiar matrimonial follow matrilineal system of inheritance and live in units called Tharavadus.  Some of their general customs are pulikudi, KÄthukuthu, VidyÄrambham, TÄlikettu, Sambandham, etc.', 'Nambiar Matrimony - Nambiar Matrimonial - Nambiar Matrimonials - Nambiar Marriage - Online Nambiar Matrimonials - Matrimonial Services', 'Search Nambiar Matrimony, Nambiar Matrimonial, Nambiar Matrimonials, Nambiar Marriage, Nambiar Matrimonial Profiles in the leading Nambiar Matrimonials site for Indian and NRI Nambiar Marriage. Join Free & Add your Nambiar Matrimonial Profile Now! Find suitable Indian & NRI Nambiar brides and grooms from our online Nambiar matrimonial and matchmaking services.', 'Nambiar matrimony, Nambiar matrimonials, Nambiar matrimonial, matrimonials, matrimony, matrimony services, online Nambiar matrimonials, Indian marriage, match making, matchmaker, Nambiar profiles, marriage bureau , Nambiar marriage bureau, matchmaking services, matrimonial profiles, Nambiar bride, Nambiar groom, matrimony classified, brides, grooms', 'Nambiar Matrimonials', 'Y', 'nambiar-matrimonials.jpg', 'Nambiar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (770, 'Hindu: Nepali', 'Nepali', 'CASTE', '106', 1, '/matrimonials/nepali-matrimonial/', 'Y', 'L1_CA_770', 'Nepali people are descendents of migrants from Greater Nepal, Tibet, India, Burma and Yunnan. Some of the widely spoken languages in Nepal are Nepali, Maithili, Bhojpuri, Tharu, Tamang and others like Gurung, Magar, Awadhi, Rai, Limbu, Bajjika, etc. Nepali is the official language of Nepalese and is closest to Sanskrit. Nepali people largely follow Hinduism and Buddhism with 80% population of Nepali being made up by Hindus. The total population of Nepalis is around 35 million across the world.', 'Nepali Matrimony - Nepali Matrimonial - Nepali Matrimonials - Nepali Marriage - Online Nepali Matrimonials - Matrimonial Services', 'Search Nepali Matrimony, Nepali Matrimonial, Nepali Matrimonials, Nepali Marriage, Nepali Matrimonial Profiles in the leading Nepali Matrimonials site for Indian and NRI Nepali Marriage. Join Free & Add your Nepali Matrimonial Profile Now! Find suitable Indian & NRI Nepali brides and grooms from our online Nepali matrimonial and matchmaking services.', 'Nepali matrimony, Nepali matrimonials, Nepali matrimonial, matrimonials, matrimony, matrimony services, online Nepali matrimonials, Indian marriage, match making, matchmaker, Nepali profiles, marriage bureau , Nepali marriage bureau, matchmaking services, matrimonial profiles, Nepali bride, Nepali groom, matrimony classified, brides, grooms', 'Nepali Matrimonials', 'Y', 'nepali-matrimonials.jpg', 'Nepali Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (771, 'Hindu: Padmashali', 'Padmashali', 'CASTE', '108', 1, '/matrimonials/padmashali-matrimonial/', 'Y', 'L1_CA_771', 'Padmashali is the social group of Telugu weavers, settled in south India in states of Andhra Pradesh and Karnataka. It is considered to be the third largest community in AP and its members are involved in the occupation of weaving. This group traces its origin to Brugu Maharshi followed by Bhakta Markandeya, the one who won life from Yama. The cultural practices of Padmashalis are based on Vedic principles and it is believed that their art of weaving came from Ayoni Putra, Sri Bhavana Maharshi.', 'Padmashali Matrimony - Padmashali Matrimonial - Padmashali Matrimonials - Padmashali Marriage - Online Padmashali Matrimonials - Matrimonial Services', 'Search Padmashali Matrimony, Padmashali Matrimonial, Padmashali Matrimonials, Padmashali Marriage, Padmashali Matrimonial Profiles in the leading Padmashali Matrimonials site for Indian and NRI Padmashali Marriage. Join Free & Add your Padmashali Matrimonial Profile Now! Find suitable Indian & NRI Padmashali brides and grooms from our online Padmashali matrimonial and matchmaking services.', 'Padmashali matrimony, Padmashali matrimonials, Padmashali matrimonial, matrimonials, matrimony, matrimony services, online Padmashali matrimonials, Indian marriage, match making, matchmaker, Padmashali profiles, marriage bureau , Padmashali marriage bureau, matchmaking services, matrimonial profiles, Padmashali bride, Padmashali groom, matrimony classified, brides, grooms', 'Padmashali Matrimonials', 'Y', 'padmashali-matrimonials.jpg', 'Padmashali Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (772, 'Hindu: Patil', 'Patil', 'CASTE', '112', 1, '/matrimonials/patil-matrimonial/', 'Y', 'L1_CA_772', 'The title â€˜Patilâ€™ is used by people living in Maharashtra, Karnataka and Andhra Pradesh. This surname is used by Somvanshi Kshatriyas; Deshasta Brahmins and Karhade Brahmins along with their sub castes and others. The members of Patil caste speak mainly in Kannada and Marathi languages. In earlier times, Patils owned about 40% land in a village and acted as revenue officers as well as judicial heads. Some Patils may be the descendants of King Lava while others come from Suryanvanshi Kshatriyas.', 'Patil Matrimony - Patil Matrimonial - Patil Matrimonials - Patil Marriage - Online Patil Matrimonials - Matrimonial Services', 'Search Patil Matrimony, Patil Matrimonial, Patil Matrimonials, Patil Marriage, Patil Matrimonial Profiles in the leading Patil Matrimonials site for Indian and NRI Patil Marriage. Join Free & Add your Patil Matrimonial Profile Now! Find suitable Indian & NRI Patil brides and grooms from our online Patil matrimonial and matchmaking services.', 'Patil matrimony, Patil matrimonials, Patil matrimonial, matrimonials, matrimony, matrimony services, online Patil matrimonials, Indian marriage, match making, matchmaker, Patil profiles, marriage bureau , Patil marriage bureau, matchmaking services, matrimonial profiles, Patil bride, Patil groom, matrimony classified, brides, grooms', 'Patil Matrimonials', 'Y', 'patil-matrimonials.jpg', 'Patil Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (773, 'Hindu: Pillai', 'Pillai', 'CASTE', '114', 1, '/matrimonials/pillai-matrimonial/', 'Y', 'L1_CA_773', 'Pillai is a feudal community that has originated from Tamil Nadu and Kerala and is divided into various sub castes. Some Pillai sub castes are Cherakula Vellular, Karkarthar, Karuneegar, Nanjil Vellalar, Nattampadi Vellalar, Paiyur Kottai Vellalar, Saiva Vellalar, Chozhia Vellalar and few others. They may follow Hinduism, Christianity or Saiva Siddhantam (Saivite Hindu School). The term Vellalar implies â€˜landlordsâ€™, â€˜agricultureâ€™ and â€˜lord of the cloudsâ€™ in Tamil according to different sources.', 'Pillai Matrimony - Pillai Matrimonial - Pillai Matrimonials - Pillai Marriage - Online Pillai Matrimonials - Matrimonial Services', 'Search Pillai Matrimony, Pillai Matrimonial, Pillai Matrimonials, Pillai Marriage, Pillai Matrimonial Profiles in the leading Pillai Matrimonials site for Indian and NRI Pillai Marriage. Join Free & Add your Pillai Matrimonial Profile Now! Find suitable Indian & NRI Pillai brides and grooms from our online Pillai matrimonial and matchmaking services.', 'Pillai matrimony, Pillai matrimonials, Pillai matrimonial, matrimonials, matrimony, matrimony services, online Pillai matrimonials, Indian marriage, match making, matchmaker, Pillai profiles, marriage bureau , Pillai marriage bureau, matchmaking services, matrimonial profiles, Pillai bride, Pillai groom, matrimony classified, brides, grooms', 'Pillai Matrimonials', 'Y', 'pillai-matrimonials.jpg', 'Pillai Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (774, 'Hindu: Prajapati', 'Prajapati', 'CASTE', '115', 1, '/matrimonials/prajapati-matrimonial/', 'Y', 'L1_CA_774', 'Prajapati is a Hindu caste found in the states of north India- Himachal Pradesh, Punjab, Uttar Pradesh, Haryana, Gujarat, Maharashtra, Rajasthan, Bihar and Madhya Pradesh. Prajapatis are also referred to as â€˜Kumharsâ€™ that literally means potter and are believed to have descended from a Hindu deity, Prajapati. Prajapati or the â€˜Lord of Creaturesâ€™ is the son of God Brahma and is identified with Lord Vishnu and Shiva as well. Prajapati matrimony is based on gotra exogamy and community endogamy.', 'Prajapati Matrimony - Prajapati Matrimonial - Prajapati Matrimonials - Prajapati Marriage - Online Prajapati Matrimonials - Matrimonial Services', 'Search Prajapati Matrimony, Prajapati Matrimonial, Prajapati Matrimonials, Prajapati Marriage, Prajapati Matrimonial Profiles in the leading Prajapati Matrimonials site for Indian and NRI Prajapati Marriage. Join Free & Add your Prajapati Matrimonial Profile Now! Find suitable Indian & NRI Prajapati brides and grooms from our online Prajapati matrimonial and matchmaking services.', 'Prajapati matrimony, Prajapati matrimonials, Prajapati matrimonial, matrimonials, matrimony, matrimony services, online Prajapati matrimonials, Indian marriage, match making, matchmaker, Prajapati profiles, marriage bureau , Prajapati marriage bureau, matchmaking services, matrimonial profiles, Prajapati bride, Prajapati groom, matrimony classified, brides, grooms', 'Prajapati Matrimonials', 'Y', 'prajapati-matrimonials.jpg', 'Prajapati Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (775, 'Hindu: Reddy', 'Reddy', 'CASTE', '119', 1, '/matrimonials/reddy-matrimonial/', 'Y', 'L1_CA_775', 'Reddy is a south Indian social group, found predominantly in Andhra Pradesh along with other states like Tamil Nadu, Karnataka, Kerala and Maharashtra. Telugu, Tamil and Kannada are the three main languages spoken by members of Reddy community. Reddys have a long tradition of headman ship in villages and this continues even today as they actively get involved in local, state and national politics. Many businessmen and politicians in south India, particularly Andhra Pradesh are Reddys by caste.', 'Reddy Matrimony - Reddy Matrimonial - Reddy Matrimonials - Reddy Marriage - Online Reddy Matrimonials - Matrimonial Services', 'Search Reddy Matrimony, Reddy Matrimonial, Reddy Matrimonials, Reddy Marriage, Reddy Matrimonial Profiles in the leading Reddy Matrimonials site for Indian and NRI Reddy Marriage. Join Free & Add your Reddy Matrimonial Profile Now! Find suitable Indian & NRI Reddy brides and grooms from our online Reddy matrimonial and matchmaking services.', 'Reddy matrimony, Reddy matrimonials, Reddy matrimonial, matrimonials, matrimony, matrimony services, online Reddy matrimonials, Indian marriage, match making, matchmaker, Reddy profiles, marriage bureau , Reddy marriage bureau, matchmaking services, matrimonial profiles, Reddy bride, Reddy groom, matrimony classified, brides, grooms', 'Reddy Matrimonials', 'Y', 'reddy-matrimonials.jpg', 'Reddy Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (776, 'Hindu: Sadgope', 'Sadgope', 'CASTE', '120', 1, '/matrimonials/sadgope-matrimonial/', 'Y', 'L1_CA_776', 'Sadgope is a Bengali Hindu caste, known by different names in different parts of the country. For instance- they are called Dhangar in Maharashtra, Ahirs in north India, Idayan and Konar in Tamil Nadu, Yadava and Kurubas in Andhra Pradesh and Karnataka, etc. Sadgope is largely the community of landlords. Along with other allied castes, they account for nearly one-tenth population of the country and use Bangla as mother tongue.\r\n\r\nSadgope matrimonial is endogamous and they practice gotra exogamy.', 'Sadgope Matrimony - Sadgope Matrimonial - Sadgope Matrimonials - Sadgope Marriage - Online Sadgope Matrimonials - Matrimonial Services', 'Search Sadgope Matrimony, Sadgope Matrimonial, Sadgope Matrimonials, Sadgope Marriage, Sadgope Matrimonial Profiles in the leading Sadgope Matrimonials site for Indian and NRI Sadgope Marriage. Join Free & Add your Sadgope Matrimonial Profile Now! Find suitable Indian & NRI Sadgope brides and grooms from our online Sadgope matrimonial and matchmaking services.', 'Sadgope matrimony, Sadgope matrimonials, Sadgope matrimonial, matrimonials, matrimony, matrimony services, online Sadgope matrimonials, Indian marriage, match making, matchmaker, Sadgope profiles, marriage bureau , Sadgope marriage bureau, matchmaking services, matrimonial profiles, Sadgope bride, Sadgope groom, matrimony classified, brides, grooms', 'Sadgope Matrimonials', 'Y', 'sadgope-matrimonials.jpg', 'Sadgope Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (777, 'Hindu: Shimpi', 'Shimpi', 'CASTE', '122', 1, '/matrimonials/shimpi-matrimonial/', 'Y', 'L1_CA_777', 'The term Shimpi literally means â€˜tailorâ€™ and is a caste of those who tailor clothes; divided into Jain, Marathi and Telugu Shimpis. Jain Shimpis belong to the Setval caste; Marathi Shimpis are often Lingayats and Telugu division usually comprises Vaishnavas. With migration of Shimpis to different regions came their mingling with people from other castes. As they learned their language, eating habits and lifestyle; Shimpi matrimonial could also be arranged with people from other communities.', 'Shimpi Matrimony - Shimpi Matrimonial - Shimpi Matrimonials - Shimpi Marriage - Online Shimpi Matrimonials - Matrimonial Services', 'Search Shimpi Matrimony, Shimpi Matrimonial, Shimpi Matrimonials, Shimpi Marriage, Shimpi Matrimonial Profiles in the leading Shimpi Matrimonials site for Indian and NRI Shimpi Marriage. Join Free & Add your Shimpi Matrimonial Profile Now! Find suitable Indian & NRI Shimpi brides and grooms from our online Shimpi matrimonial and matchmaking services.', 'Shimpi matrimony, Shimpi matrimonials, Shimpi matrimonial, matrimonials, matrimony, matrimony services, online Shimpi matrimonials, Indian marriage, match making, matchmaker, Shimpi profiles, marriage bureau , Shimpi marriage bureau, matchmaking services, matrimonial profiles, Shimpi bride, Shimpi groom, matrimony classified, brides, grooms', 'Shimpi Matrimonials', 'Y', 'shimpi-matrimonials.jpg', 'Shimpi Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (778, 'Hindu: Somvanshi', 'Somvanshi', 'CASTE', '124', 1, '/matrimonials/somvanshi-matrimonial/', 'Y', 'L1_CA_778', 'Somvanshi, one of the three Kshatriya Vanshis are also known as Chandravanshi Kshatriyas. Other two Vanshis are Agnivanshi and Suryavanshi. Somvanshi Kshatriyas are the descendants of Moon and belong to lunar dynasty (Chandra Vansha). This community is today based largely in the states of Maharashtra, Uttar Pradesh, Manipur and Uttaranchal. Being a part of the Kshatriya Varna in Hindu society, it is a community of warriors. They are usually involved in agriculture, defense and other services.', 'Somvanshi Matrimony - Somvanshi Matrimonial - Somvanshi Matrimonials - Somvanshi Marriage - Online Somvanshi Matrimonials - Matrimonial Services', 'Search Somvanshi Matrimony, Somvanshi Matrimonial, Somvanshi Matrimonials, Somvanshi Marriage, Somvanshi Matrimonial Profiles in the leading Somvanshi Matrimonials site for Indian and NRI Somvanshi Marriage. Join Free & Add your Somvanshi Matrimonial Profile Now! Find suitable Indian & NRI Somvanshi brides and grooms from our online Somvanshi matrimonial and matchmaking services.', 'Somvanshi matrimony, Somvanshi matrimonials, Somvanshi matrimonial, matrimonials, matrimony, matrimony services, online Somvanshi matrimonials, Indian marriage, match making, matchmaker, Somvanshi profiles, marriage bureau , Somvanshi marriage bureau, matchmaking services, matrimonial profiles, Somvanshi bride, Somvanshi groom, matrimony classified, brides, grooms', 'Somvanshi Matrimonials', 'Y', 'somvanshi-matrimonials.jpg', 'Somvanshi Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (779, 'Hindu: Sonar', 'Sonar', 'CASTE', '125', 1, '/matrimonials/sonar-matrimonial/', 'Y', 'L1_CA_779', 'Sonars, also known as Swarnkars are the goldsmiths both literally and professionally. It is traditionally the community of goldsmiths but people from Sonar caste are entering different professions today. Sonars are usually divided into two segments- Hindu Sonars and Sikh Sonars- further divided into gotras. Some of the common surnames of Sunars include Shah, Bagga, Babbar, Verma, Seth, Soni, Bhutani and many others.\r\nSonar matrimonial is apparently based on endogamy and they practice clan exogamy.', 'Sonar Matrimony - Sonar Matrimonial - Sonar Matrimonials - Sonar Marriage - Online Sonar Matrimonials - Matrimonial Services', 'Search Sonar Matrimony, Sonar Matrimonial, Sonar Matrimonials, Sonar Marriage, Sonar Matrimonial Profiles in the leading Sonar Matrimonials site for Indian and NRI Sonar Marriage. Join Free & Add your Sonar Matrimonial Profile Now! Find suitable Indian & NRI Sonar brides and grooms from our online Sonar matrimonial and matchmaking services.', 'Sonar matrimony, Sonar matrimonials, Sonar matrimonial, matrimonials, matrimony, matrimony services, online Sonar matrimonials, Indian marriage, match making, matchmaker, Sonar profiles, marriage bureau , Sonar marriage bureau, matchmaking services, matrimonial profiles, Sonar bride, Sonar groom, matrimony classified, brides, grooms', 'Sonar Matrimonials', 'Y', 'sonar-matrimonials.jpg', 'Sonar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (780, 'Hindu: Sutar', 'Sutar', 'CASTE', '127', 1, '/matrimonials/sutar-matrimonial/', 'Y', 'L1_CA_780', 'The term â€˜Sutarâ€™ comes from a Sanskrit word â€˜Sootradharâ€™ and they are the offspring of Lord Vishwakarma. The main occupation of this Hindu community is carpentry; they are pure vegetarians and avoid consumption of alcohol. Suthars are majorly found in the states of Madhya Pradesh, Rajasthan, Gujarat and Maharashtra in India. Mistris and Kadias in Gujarat are usually grouped under the community of Sutars. Hindi, Marathi, Marwari and Gujarati are spoken commonly by the members of Sutar community.', 'Sutar Matrimony - Sutar Matrimonial - Sutar Matrimonials - Sutar Marriage - Online Sutar Matrimonials - Matrimonial Services', 'Search Sutar Matrimony, Sutar Matrimonial, Sutar Matrimonials, Sutar Marriage, Sutar Matrimonial Profiles in the leading Sutar Matrimonials site for Indian and NRI Sutar Marriage. Join Free & Add your Sutar Matrimonial Profile Now! Find suitable Indian & NRI Sutar brides and grooms from our online Sutar matrimonial and matchmaking services.', 'Sutar matrimony, Sutar matrimonials, Sutar matrimonial, matrimonials, matrimony, matrimony services, online Sutar matrimonials, Indian marriage, match making, matchmaker, Sutar profiles, marriage bureau , Sutar marriage bureau, matchmaking services, matrimonial profiles, Sutar bride, Sutar groom, matrimony classified, brides, grooms', 'Sutar Matrimonials', 'Y', 'sutar-matrimonials.jpg', 'Sutar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (781, 'Hindu: Swarnkar', 'Swarnkar', 'CASTE', '128', 1, '/matrimonials/swarnkar-matrimonial/', 'Y', 'L1_CA_781', 'Swarnkar is primarily a Hindu caste but there are many Sikh Swarnkars as well. This term literally means â€˜goldsmithsâ€™. The people of this community are also known as Sunar or Sonar and have originated from north India. Swarnkars are divided into numerous groupings, both territorial and non territorial. Swarnakrs are traditionally goldsmiths but some of them are today the landowners, cultivators, moneylenders, etc. Mairs and Tanks are the two primary tribes of goldsmiths in the present times.', 'Swarnkar Matrimony - Swarnkar Matrimonial - Swarnkar Matrimonials - Swarnkar Marriage - Online Swarnkar Matrimonials - Matrimonial Services', 'Search Swarnkar Matrimony, Swarnkar Matrimonial, Swarnkar Matrimonials, Swarnkar Marriage, Swarnkar Matrimonial Profiles in the leading Swarnkar Matrimonials site for Indian and NRI Swarnkar Marriage. Join Free & Add your Swarnkar Matrimonial Profile Now! Find suitable Indian & NRI Swarnkar brides and grooms from our online Swarnkar matrimonial and matchmaking services.', 'Swarnkar matrimony, Swarnkar matrimonials, Swarnkar matrimonial, matrimonials, matrimony, matrimony services, online Swarnkar matrimonials, Indian marriage, match making, matchmaker, Swarnkar profiles, marriage bureau , Swarnkar marriage bureau, matchmaking services, matrimonial profiles, Swarnkar bride, Swarnkar groom, matrimony classified, brides, grooms', 'Swarnkar Matrimonials', 'Y', 'swarnkar-matrimonials.jpg', 'Swarnkar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (782, 'Hindu: Thevar', 'Thevar', 'CASTE', '130', 1, '/matrimonials/thevar-matrimonial/', 'Y', 'L1_CA_782', 'Thevar is a Sanskrit word that literally means â€˜aristocratsâ€™. Thevar people together form a group called Mukkulathor which consists of three clans namely- Agamudaiyar, Maravar and Kallar. With an estimated population of around 20 million; Thevars are found in the states of Tamil Nadu and Chattisgarh in India. They are also settled in countries like Sri Lanka, Singapore, Canada and Malaysia.\r\n\r\nLike various other Hindu communities in India, Thevar matrimonial is also based on the concept of endogamy.', 'Thevar Matrimony - Thevar Matrimonial - Thevar Matrimonials - Thevar Marriage - Online Thevar Matrimonials - Matrimonial Services', 'Search Thevar Matrimony, Thevar Matrimonial, Thevar Matrimonials, Thevar Marriage, Thevar Matrimonial Profiles in the leading Thevar Matrimonials site for Indian and NRI Thevar Marriage. Join Free & Add your Thevar Matrimonial Profile Now! Find suitable Indian & NRI Thevar brides and grooms from our online Thevar matrimonial and matchmaking services.', 'Thevar matrimony, Thevar matrimonials, Thevar matrimonial, matrimonials, matrimony, matrimony services, online Thevar matrimonials, Indian marriage, match making, matchmaker, Thevar profiles, marriage bureau , Thevar marriage bureau, matchmaking services, matrimonial profiles, Thevar bride, Thevar groom, matrimony classified, brides, grooms', 'Thevar Matrimonials', 'Y', 'thevar-matrimonials.jpg', 'Thevar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (783, 'Hindu: Thiyya', 'Thiyya', 'CASTE', '131', 1, '/matrimonials/thiyya-matrimonial/', 'Y', 'L1_CA_783', 'Thiyyas, also known as Ezhavas and Billavas, form the largest Hindu community in the state of Kerala. Thiyyas are originally Hindus but many of them had converted into Christians and Sikhs in 1920s. Ezhavas are believed to be a martial race historically as many served in the armed forces of important kings in Calicut, Travancore and Cochin. Besides this, Thiyyas have been involved in Ayurveda, Toxicology (visha chikitsa), coconut trading, farming, arrack brewing, distillery and toddy tapping.', 'Thiyya Matrimony - Thiyya Matrimonial - Thiyya Matrimonials - Thiyya Marriage - Online Thiyya Matrimonials - Matrimonial Services', 'Search Thiyya Matrimony, Thiyya Matrimonial, Thiyya Matrimonials, Thiyya Marriage, Thiyya Matrimonial Profiles in the leading Thiyya Matrimonials site for Indian and NRI Thiyya Marriage. Join Free & Add your Thiyya Matrimonial Profile Now! Find suitable Indian & NRI Thiyya brides and grooms from our online Thiyya matrimonial and matchmaking services.', 'Thiyya matrimony, Thiyya matrimonials, Thiyya matrimonial, matrimonials, matrimony, matrimony services, online Thiyya matrimonials, Indian marriage, match making, matchmaker, Thiyya profiles, marriage bureau , Thiyya marriage bureau, matchmaking services, matrimonial profiles, Thiyya bride, Thiyya groom, matrimony classified, brides, grooms', 'Thiyya Matrimonials', 'Y', 'thiyya-matrimonials.jpg', 'Thiyya Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (784, 'Hindu: Vaish', 'Vaish', 'CASTE', '133', 1, '/matrimonials/vaish-matrimonial/', 'Y', 'L1_CA_784', 'Vaish, one of the four varnas of Hinduism, is the community of money lenders, land owners and traders. Some of the castes under Vaish are that of Agarwals, Khandelwals, Varshneys, Mathurs, Rastogis, Aroras, Lohanas, Oswals, Maheshwaris, Ambanis, Sarabhais and many others. They are believed to be the â€˜dvijasâ€™ i.e. twice born according to the classical theory. Mathur Vaishya and Punjabi Vaishya are among the many sub castes of Vaishyas. Vaish matrimonial allows marriage with the community only.', 'Vaish Matrimony - Vaish Matrimonial - Vaish Matrimonials - Vaish Marriage - Online Vaish Matrimonials - Matrimonial Services', 'Search Vaish Matrimony, Vaish Matrimonial, Vaish Matrimonials, Vaish Marriage, Vaish Matrimonial Profiles in the leading Vaish Matrimonials site for Indian and NRI Vaish Marriage. Join Free & Add your Vaish Matrimonial Profile Now! Find suitable Indian & NRI Vaish brides and grooms from our online Vaish matrimonial and matchmaking services.', 'Vaish matrimony, Vaish matrimonials, Vaish matrimonial, matrimonials, matrimony, matrimony services, online Vaish matrimonials, Indian marriage, match making, matchmaker, Vaish profiles, marriage bureau , Vaish marriage bureau, matchmaking services, matrimonial profiles, Vaish bride, Vaish groom, matrimony classified, brides, grooms', 'Vaish Matrimonials', 'Y', 'vaish-matrimonials.jpg', 'Vaish Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (785, 'Hindu: Vaishya', 'Vaishya', 'CASTE', '136', 1, '/matrimonials/vaishya-matrimonial/', 'Y', 'L1_CA_785', 'Vaishyas, belongs to one of the four Varnas of the Hindu religion, which has played an eminent role in the evolution of trading concepts and capitalism in India. Vaishyas are divided into various sub- castes like Aggarwal, Khandelwal, Mathur, Arora, Lohana, Varshneys Arya Vysyas, Ambanis, Oswals, etc. The Vaishya matrimonies are performed according to the Hindu traditions and rituals. Vaishya families like Baniya or Aggarwals look for marriage match for their children in their Vaishya community only.', 'Vaishya Matrimony - Vaishya Matrimonial - Vaishya Matrimonials - Vaishya Marriage - Online Vaishya Matrimonials - Matrimonial Services', 'Search Vaishya Matrimony, Vaishya Matrimonial, Vaishya Matrimonials, Vaishya Marriage, Vaishya Matrimonial Profiles in the leading Vaishya Matrimonials site for Indian and NRI Vaishya Marriage. Join Free & Add your Vaishya Matrimonial Profile Now! Find suitable Indian & NRI Vaishya brides and grooms from our online Vaishya matrimonial and matchmaking services.', 'Vaishya matrimony, Vaishya matrimonials, Vaishya matrimonial, matrimonials, matrimony, matrimony services, online Vaishya matrimonials, Indian marriage, match making, matchmaker, Vaishya profiles, marriage bureau , Vaishya marriage bureau, matchmaking services, matrimonial profiles, Vaishya bride, Vaishya groom, matrimony classified, brides, grooms', 'Vaishya Matrimonials', 'Y', 'vaishya-matrimonials.jpg', 'Vaishya Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (786, 'Hindu: Vanniyar', 'Vanniyar', 'CASTE', '138', 1, '/matrimonials/vanniyar-matrimonial/', 'Y', 'L1_CA_786', 'Vanniyar is a south Indian social group that primarily lives in the states of Tamil Nadu, Karnataka, Kerala and Andhra Pradesh. They primarily speak Tamil but depending on the place they live in, Vanniayrs also speak Kannada, Telugu and Malayalam. The term Vanniyar is derived from â€˜Vanniâ€™ that means fire and even strength in Tamil. Some of the titles used by members of this community are Padayatchi, Reddiar, Naicker, Palli and various others. They are considered to be well organized socially.', 'Vanniyar Matrimony - Vanniyar Matrimonial - Vanniyar Matrimonials - Vanniyar Marriage - Online Vanniyar Matrimonials - Matrimonial Services', 'Search Vanniyar Matrimony, Vanniyar Matrimonial, Vanniyar Matrimonials, Vanniyar Marriage, Vanniyar Matrimonial Profiles in the leading Vanniyar Matrimonials site for Indian and NRI Vanniyar Marriage. Join Free & Add your Vanniyar Matrimonial Profile Now! Find suitable Indian & NRI Vanniyar brides and grooms from our online Vanniyar matrimonial and matchmaking services.', 'Vanniyar matrimony, Vanniyar matrimonials, Vanniyar matrimonial, matrimonials, matrimony, matrimony services, online Vanniyar matrimonials, Indian marriage, match making, matchmaker, Vanniyar profiles, marriage bureau , Vanniyar marriage bureau, matchmaking services, matrimonial profiles, Vanniyar bride, Vanniyar groom, matrimony classified, brides, grooms', 'Vanniyar Matrimonials', 'Y', 'vanniyar-matrimonials.jpg', 'Vanniyar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (787, 'Hindu: Varshney', 'Varshney', 'CASTE', '139', 1, '/matrimonials/varshney-matrimonial/', 'Y', 'L1_CA_787', 'The group of Varshney people belongs to the caste of Vaishyas and is known as Barahseni. They are the progenies of Sri Akrurji Maharaj and are primarily based in Uttar Pradesh. This term was first recorded in the epic, Mahabharata when Arjuna used it for Vasudev Krishna. Varshney has been the community of businessmen and landowners traditionally but can now be found in different professions. Besides Varshni, many people use Gupta as their surname. Mathura is connected culturally to Varshneys.', 'Varshney Matrimony - Varshney Matrimonial - Varshney Matrimonials - Varshney Marriage - Online Varshney Matrimonials - Matrimonial Services', 'Search Varshney Matrimony, Varshney Matrimonial, Varshney Matrimonials, Varshney Marriage, Varshney Matrimonial Profiles in the leading Varshney Matrimonials site for Indian and NRI Varshney Marriage. Join Free & Add your Varshney Matrimonial Profile Now! Find suitable Indian & NRI Varshney brides and grooms from our online Varshney matrimonial and matchmaking services.', 'Varshney matrimony, Varshney matrimonials, Varshney matrimonial, matrimonials, matrimony, matrimony services, online Varshney matrimonials, Indian marriage, match making, matchmaker, Varshney profiles, marriage bureau , Varshney marriage bureau, matchmaking services, matrimonial profiles, Varshney bride, Varshney groom, matrimony classified, brides, grooms', 'Varshney Matrimonials', 'Y', 'varshney-matrimonials.jpg', 'Varshney Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (788, 'Hindu: Veerashaiva', 'Veerashaiva', 'CASTE', '140', 1, '/matrimonials/veerashaiva-matrimonial/', 'Y', 'L1_CA_788', 'Veerashaiva is now called Lingayatism after Vishwaguru Basavanna revived the religion in 12th century and introduced the â€˜wearing of Shivalingaâ€™. It is a Shaivite denomination in Hinduism and is different from the religion primarily in propounding monotheism. Veerashaivas are known by this name in northern India and as Lingayats in other parts of the country. Lingayat is derived from the word â€˜Lingavanthaâ€™ meaning â€˜one who wears Lingaâ€™ in Kannada. Like Veerashaiva, Lingayats worship Ishtalinga.', 'Veerashaiva Matrimony - Veerashaiva Matrimonial - Veerashaiva Matrimonials - Veerashaiva Marriage - Online Veerashaiva Matrimonials - Matrimonial Services', 'Search Veerashaiva Matrimony, Veerashaiva Matrimonial, Veerashaiva Matrimonials, Veerashaiva Marriage, Veerashaiva Matrimonial Profiles in the leading Veerashaiva Matrimonials site for Indian and NRI Veerashaiva Marriage. Join Free & Add your Veerashaiva Matrimonial Profile Now! Find suitable Indian & NRI Veerashaiva brides and grooms from our online Veerashaiva matrimonial and matchmaking services.', 'Veerashaiva matrimony, Veerashaiva matrimonials, Veerashaiva matrimonial, matrimonials, matrimony, matrimony services, online Veerashaiva matrimonials, Indian marriage, match making, matchmaker, Veerashaiva profiles, marriage bureau , Veerashaiva marriage bureau, matchmaking services, matrimonial profiles, Veerashaiva bride, Veerashaiva groom, matrimony classified, brides, grooms', 'Veerashaiva Matrimonials', 'Y', 'veerashaiva-matrimonials.jpg', 'Veerashaiva Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (789, 'Hindu: Vellalar', 'Vellalar', 'CASTE', '141', 1, '/matrimonials/vellalar-matrimonial/', 'Y', 'L1_CA_789', 'Vellalar, the Tamil aristocratic caste of agricultural landlords, is divided into various sub castes. Some of the titles used by Vellalars are Gounder, Mudaliar, Pillai and various others. The word â€˜Vellalarâ€™ has various derivations, so it may mean â€˜Lord of the floodsâ€™ or â€˜People of Velâ€™ according to different theories. Tamil and Malayalam are the main languages spoken by Vellalars in India as well as Sri Lanka. \r\n\r\nVellalar matrimonial is usually not arranged between the sub castes but within them.', 'Vellalar Matrimony - Vellalar Matrimonial - Vellalar Matrimonials - Vellalar Marriage - Online Vellalar Matrimonials - Matrimonial Services', 'Search Vellalar Matrimony, Vellalar Matrimonial, Vellalar Matrimonials, Vellalar Marriage, Vellalar Matrimonial Profiles in the leading Vellalar Matrimonials site for Indian and NRI Vellalar Marriage. Join Free & Add your Vellalar Matrimonial Profile Now! Find suitable Indian & NRI Vellalar brides and grooms from our online Vellalar matrimonial and matchmaking services.', 'Vellalar matrimony, Vellalar matrimonials, Vellalar matrimonial, matrimonials, matrimony, matrimony services, online Vellalar matrimonials, Indian marriage, match making, matchmaker, Vellalar profiles, marriage bureau , Vellalar marriage bureau, matchmaking services, matrimonial profiles, Vellalar bride, Vellalar groom, matrimony classified, brides, grooms', 'Vellalar Matrimonials', 'Y', 'vellalar-matrimonials.jpg', 'Vellalar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (790, 'Hindu: Vysya', 'Vysya', 'CASTE', '145', 1, '/matrimonials/vysya-matrimonial/', 'Y', 'L1_CA_790', 'Vysyas are also called Vaishyas or Vanikas and are believed to have originated from the Creator Lord Brahma. The term â€˜Vaishyaâ€™ is used for those who are traders by profession as well as for those belonging to the third Varna of Hindu social order. People belonging to Vysya as a Varna follow only Hinduism but when classified on the basis of occupation;, they may be Hindus, Sikhs or even Jains. Vysyas earlier comprised merchants and artisans but then eventually became money lenders and traders.', 'Vysya Matrimony - Vysya Matrimonial - Vysya Matrimonials - Vysya Marriage - Online Vysya Matrimonials - Matrimonial Services', 'Search Vysya Matrimony, Vysya Matrimonial, Vysya Matrimonials, Vysya Marriage, Vysya Matrimonial Profiles in the leading Vysya Matrimonials site for Indian and NRI Vysya Marriage. Join Free & Add your Vysya Matrimonial Profile Now! Find suitable Indian & NRI Vysya brides and grooms from our online Vysya matrimonial and matchmaking services.', 'Vysya matrimony, Vysya matrimonials, Vysya matrimonial, matrimonials, matrimony, matrimony services, online Vysya matrimonials, Indian marriage, match making, matchmaker, Vysya profiles, marriage bureau , Vysya marriage bureau, matchmaking services, matrimonial profiles, Vysya bride, Vysya groom, matrimony classified, brides, grooms', 'Vysya Matrimonials', 'Y', 'vysya-matrimonials.jpg', 'Vysya Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (791, 'Sikh: Gursikh', 'Gursikh', 'CASTE', '155', 1, '/matrimonials/gursikh-matrimonial/', 'Y', 'L1_CA_791', 'Gursikh, as commonly understood, are Sikhs fully devoted to Gurus. The word Sikh stands for â€˜learnersâ€™ and Guru for the one who â€˜dispels darkness of ignoranceâ€™.  They may be Amritdhari or non Amritdhari but are required to walk on the path described by the Guru. \r\n\r\nIn Gursikhs, matrimony is arranged by parents of the couple and is performed in a Gurudwara. Various pre and post wedding customs like Shagun, Choora, Vatna, Gharoli, Milni, Doli, etc. are observed during the matrimonial celebrations.', 'Gursikh Matrimony - Gursikh Matrimonial - Gursikh Matrimonials - Gursikh Marriage - Online Gursikh Matrimonials - Matrimonial Services', 'Search Gursikh Matrimony, Gursikh Matrimonial, Gursikh Matrimonials, Gursikh Marriage, Gursikh Matrimonial Profiles in the leading Gursikh Matrimonials site for Indian and NRI Gursikh Marriage. Join Free & Add your Gursikh Matrimonial Profile Now! Find suitable Indian & NRI Gursikh brides and grooms from our online Gursikh matrimonial and matchmaking services.', 'Gursikh matrimony, Gursikh matrimonials, Gursikh matrimonial, matrimonials, matrimony, matrimony services, online Gursikh matrimonials, Indian marriage, match making, matchmaker, Gursikh profiles, marriage bureau , Gursikh marriage bureau, matchmaking services, matrimonial profiles, Gursikh bride, Gursikh groom, matrimony classified, brides, grooms', 'Gursikh Matrimonials', 'Y', 'gursikh-matrimonials.jpg', 'Gursikh Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (792, 'Sikh: Ramgarhia', 'Ramgarhia', 'CASTE', '160', 1, '/matrimonials/ramgarhia-matrimonial/', 'Y', 'L1_CA_792', 'Ramgarhia is an ethnic tribe that is believed to be named after Sardar Jassa Singh Ramgarhia, the leader of the Ramgarhia Misl. The term â€˜Garhâ€™ stands for fort and â€˜Ramâ€™ is the Lord, therefore, Ramgarhia means â€˜Custodians of the Castle of Godâ€™ or â€˜Builders of the Fortâ€™. This community originated from the state of Punjab in North India and its members speak in Punjabi, Hindi, English as well as other regional languages. This clan is usually considered to be the most orthodox follower of the Guru.', 'Ramgarhia Matrimony - Ramgarhia Matrimonial - Ramgarhia Matrimonials - Ramgarhia Marriage - Online Ramgarhia Matrimonials - Matrimonial Services', 'Search Ramgarhia Matrimony, Ramgarhia Matrimonial, Ramgarhia Matrimonials, Ramgarhia Marriage, Ramgarhia Matrimonial Profiles in the leading Ramgarhia Matrimonials site for Indian and NRI Ramgarhia Marriage. Join Free & Add your Ramgarhia Matrimonial Profile Now! Find suitable Indian & NRI Ramgarhia brides and grooms from our online Ramgarhia matrimonial and matchmaking services.', 'Ramgarhia matrimony, Ramgarhia matrimonials, Ramgarhia matrimonial, matrimonials, matrimony, matrimony services, online Ramgarhia matrimonials, Indian marriage, match making, matchmaker, Ramgarhia profiles, marriage bureau , Ramgarhia marriage bureau, matchmaking services, matrimonial profiles, Ramgarhia bride, Ramgarhia groom, matrimony classified, brides, grooms', 'Ramgarhia Matrimonials', 'Y', 'ramgarhia-matrimonials.jpg', 'Ramgarhia Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (793, 'Sikh: Saini', 'Saini', 'CASTE', '161', 1, '/matrimonials/saini-matrimonial/', 'Y', 'L1_CA_793', 'Saini or Shoorsaini is a warrior caste of Rajput descent and found mainly in Punjab, Himachal Pradesh, Jammu and Kashmir and Haryana. Sainis can be either Hindus or Sikhs but both respect each otherâ€™s traditions- Sanatani Vedic past and priests of Hindus and Gurus of Sikhs. Their main languages include Hindi, Punjabi and their various dialects.\r\nSaini matrimony allows marriage between Hindus and Sikhs where Hindu Sainis marry according to Vedic rituals or Arya Samaj and Sikhs wed in Anand Karaj.\r\n', 'Saini Matrimony - Saini Matrimonial - Saini Matrimonials - Saini Marriage - Online Saini Matrimonials - Matrimonial Services', 'Search Saini Matrimony, Saini Matrimonial, Saini Matrimonials, Saini Marriage, Saini Matrimonial Profiles in the leading Saini Matrimonials site for Indian and NRI Saini Marriage. Join Free & Add your Saini Matrimonial Profile Now! Find suitable Indian & NRI Saini brides and grooms from our online Saini matrimonial and matchmaking services.', 'Saini matrimony, Saini matrimonials, Saini matrimonial, matrimonials, matrimony, matrimony services, online Saini matrimonials, Indian marriage, match making, matchmaker, Saini profiles, marriage bureau , Saini marriage bureau, matchmaking services, matrimonial profiles, Saini bride, Saini groom, matrimony classified, brides, grooms', 'Saini Matrimonials', 'Y', 'saini-matrimonials.jpg', 'Saini Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (794, 'Hindu: Mallah', 'Mallah', 'CASTE', '164', 1, '/matrimonials/mallah-matrimonial/', 'Y', 'L1_CA_794', 'Mallah is a Hindu community found mainly in the states of north india like Bihar, Uttar Pradesh, etc. The people of this caste are found in Pakistan as well but are Muslims. Mallah is believed to mean â€˜motion of movingâ€™ in Arabic, like wings of a bird. Mallahs are traditionally the boatmen of north and east India but many are now involved in cultivation. Also known as Mandaji and Machua; Mallahs claim descent from Hindu God Nisadh. The sub-castes of Mallahs are Dhoar, Parbattikurin and Semeri.', 'Mallah Matrimony - Mallah Matrimonial - Mallah Matrimonials - Mallah Marriage - Online Mallah Matrimonials - Matrimonial Services', 'Search Mallah Matrimony, Mallah Matrimonial, Mallah Matrimonials, Mallah Marriage, Mallah Matrimonial Profiles in the leading Mallah Matrimonials site for Indian and NRI Mallah Marriage. Join Free & Add your Mallah Matrimonial Profile Now! Find suitable Indian & NRI Mallah brides and grooms from our online Mallah matrimonial and matchmaking services.', 'Mallah matrimony, Mallah matrimonials, Mallah matrimonial, matrimonials, matrimony, matrimony services, online Mallah matrimonials, Indian marriage, match making, matchmaker, Mallah profiles, marriage bureau , Mallah marriage bureau, matchmaking services, matrimonial profiles, Mallah bride, Mallah groom, matrimony classified, brides, grooms', 'Mallah Matrimonials', 'Y', 'mallah-matrimonials.jpg', 'Mallah Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (795, 'Hindu: Shah', 'Shah', 'CASTE', '165', 1, '/matrimonials/shah-matrimonial/', 'Y', 'L1_CA_795', 'Shah is an Indian surname in Gujarati language and Kutchi language that is used by Hindu, Jain and Muslim communities. Shah surname usually represents the Bania caste in Jain and Hindu communities. It is also a shorter form of â€˜Shahryarâ€™ and is often used in names with a political or aristocratic meaning. It is interesting to note that Shah also applies to the Emperors of Iran (Persia) before the Islamic revolution. \r\nShah matrimonial is often arranged by parents and within the community only.', 'Shah Matrimony - Shah Matrimonial - Shah Matrimonials - Shah Marriage - Online Shah Matrimonials - Matrimonial Services', 'Search Shah Matrimony, Shah Matrimonial, Shah Matrimonials, Shah Marriage, Shah Matrimonial Profiles in the leading Shah Matrimonials site for Indian and NRI Shah Marriage. Join Free & Add your Shah Matrimonial Profile Now! Find suitable Indian & NRI Shah brides and grooms from our online Shah matrimonial and matchmaking services.', 'Shah matrimony, Shah matrimonials, Shah matrimonial, matrimonials, matrimony, matrimony services, online Shah matrimonials, Indian marriage, match making, matchmaker, Shah profiles, marriage bureau , Shah marriage bureau, matchmaking services, matrimonial profiles, Shah bride, Shah groom, matrimony classified, brides, grooms', 'Shah Matrimonials', 'Y', 'shah-matrimonials.jpg', 'Shah Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (796, 'Hindu: Dhobi', 'Dhobi', 'CASTE', '166', 1, '/matrimonials/dhobi-matrimonial/', 'Y', 'L1_CA_796', 'The caste of Dhobis is found in various north Indian states and Maharashtra and they are believed to specialize in washing clothes. The term Dhobi is arrived from Hindi word â€˜Dhonaâ€™ that literally means â€˜to washâ€™. It is interesting to note that people belonging to this caste adapt themselves to the customs of the place they reside in. For instance, the primary language of Dhobis is Hindi in north India; Gujarati in Gujarat and Marathi in Maharashtra. Dhobi matrimony is usually based on endogamy.', 'Dhobi Matrimony - Dhobi Matrimonial - Dhobi Matrimonials - Dhobi Marriage - Online Dhobi Matrimonials - Matrimonial Services', 'Search Dhobi Matrimony, Dhobi Matrimonial, Dhobi Matrimonials, Dhobi Marriage, Dhobi Matrimonial Profiles in the leading Dhobi Matrimonials site for Indian and NRI Dhobi Marriage. Join Free & Add your Dhobi Matrimonial Profile Now! Find suitable Indian & NRI Dhobi brides and grooms from our online Dhobi matrimonial and matchmaking services.', 'Dhobi matrimony, Dhobi matrimonials, Dhobi matrimonial, matrimonials, matrimony, matrimony services, online Dhobi matrimonials, Indian marriage, match making, matchmaker, Dhobi profiles, marriage bureau , Dhobi marriage bureau, matchmaking services, matrimonial profiles, Dhobi bride, Dhobi groom, matrimony classified, brides, grooms', 'Dhobi Matrimonials', 'Y', 'dhobi-matrimonials.jpg', 'Dhobi Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (797, 'Hindu: Mukkulathor', 'Mukkulathor', 'CASTE', '200', 1, '/matrimonials/kalar-matrimonial/', 'Y', 'L1_CA_797', 'Mukkulathor (people of the three clans) is made up of the Thevar (aristocrats) people and Kalar is one of the three groups, other two being Maravar and Agamudaiyar. Kallar literally means brave people and these people are called by different names. Thevar women in Tamil Nadu are generally addressed as â€˜Nachiyarâ€™.\r\n\r\nKalar matrimonial celebrations follow rituals like saakchhya gandh and shalmaudi (engagement), Kuldev and Mata Murai worship, sulagna lagana, recitation of mangalstak and various others.', 'Kalar Matrimony - Kalar Matrimonial - Kalar Matrimonials - Kalar Marriage - Online Kalar Matrimonials - Matrimonial Services', 'Search Kalar Matrimony, Kalar Matrimonial, Kalar Matrimonials, Kalar Marriage, Kalar Matrimonial Profiles in the leading Kalar Matrimonials site for Indian and NRI Kalar Marriage. Join Free & Add your Kalar Matrimonial Profile Now! Find suitable Indian & NRI Kalar brides and grooms from our online Kalar matrimonial and matchmaking services.', 'Kalar matrimony, Kalar matrimonials, Kalar matrimonial, matrimonials, matrimony, matrimony services, online Kalar matrimonials, Indian marriage, match making, matchmaker, Kalar profiles, marriage bureau , Kalar marriage bureau, matchmaking services, matrimonial profiles, Kalar bride, Kalar groom, matrimony classified, brides, grooms', 'Kalar Matrimonials', 'Y', 'kalar-matrimonials.jpg', 'Kalar Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (798, 'Sikh: Kamboj', 'Kamboj', 'CASTE', '157', 1, '/matrimonials/kamboj-matrimonial/', 'Y', 'L1_CA_798', 'Kamboj is an ethnic group from Punjab that is mainly found in India and Pakistan. Many people from this caste use Kamboj and Kamboh as their surname both in India and Pakistan; be they Hindu, Muslim or Sikh. Punjabi, Hindi and Urdu are the main languages spoken by Kambojs and Kambohs whose population is estimated to be 1.5 million approximately. Hindu Kambojs are believed to be related to Rajputs; Sikh Kambojs claim descent from Raja Karan and Muslim Kambojs have come from Kai dynasty of Persia.', 'Kamboj Matrimony - Kamboj Matrimonial - Kamboj Matrimonials - Kamboj Marriage - Online Kamboj Matrimonials - Matrimonial Services', 'Search Kamboj Matrimony, Kamboj Matrimonial, Kamboj Matrimonials, Kamboj Marriage, Kamboj Matrimonial Profiles in the leading Kamboj Matrimonials site for Indian and NRI Kamboj Marriage. Join Free & Add your Kamboj Matrimonial Profile Now! Find suitable Indian & NRI Kamboj brides and grooms from our online Kamboj matrimonial and matchmaking services.', 'Kamboj matrimony, Kamboj matrimonials, Kamboj matrimonial, matrimonials, matrimony, matrimony services, online Kamboj matrimonials, Indian marriage, match making, matchmaker, Kamboj profiles, marriage bureau , Kamboj marriage bureau, matchmaking services, matrimonial profiles, Kamboj bride, Kamboj groom, matrimony classified, brides, grooms', 'Kamboj Matrimonials', 'Y', 'kamboj-matrimonials.jpg', 'Kamboj Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (799, 'Hindu: Brahmin Kashmiri Pandit', 'Kashmiri Pandit', 'CASTE', '38', 1, '/matrimonials/kashmiri-pandit-matrimonial/', 'Y', 'L1_CA_799', 'Kashmiri Pandit is the sect of Hindu Brahmins who have originated from the Indian state of Kashmir. They are believed to be the descendants of Proto- Rigvedic people and have surnames like Atal, Bindroo, Bakhshi, Ganju, Kaul, Bhatt, Mattoo, Handu, Shivpuri, etc. Kashmiri Pandits follow the Hindu philosophy of Kashmir Shaivism, the school of Shiva philosophy with origins in Himalayas. Some of their important festivals are Shivaratri, Janmashtmi, Diwali, Ganesh Chaturthi, Dussehra, Navroz, etc.', 'Kashmiri Pandit Matrimony - Kashmiri Pandit Matrimonial - Kashmiri Pandit Matrimonials - Kashmiri Pandit Marriage - Online Kashmiri Pandit Matrimonials', 'Search Kashmiri Pandit Matrimony, Kashmiri Pandit Matrimonial, Kashmiri Pandit Matrimonials, Kashmiri Pandit Marriage, Kashmiri Pandit Matrimonial Profiles in the leading Kashmiri Pandit Matrimonials site for Indian and NRI Kashmiri Pandit Marriage. Join Free & Add your Kashmiri Pandit Matrimonial Profile Now! Find suitable Indian & NRI Kashmiri Pandit brides and grooms from our online Kashmiri Pandit matrimonial and matchmaking services.', 'Kashmiri Pandit matrimony, Kashmiri Pandit matrimonials, Kashmiri Pandit matrimonial, matrimonials, matrimony, matrimony services, online Kashmiri Pandit matrimonials, Indian marriage, match making, matchmaker, Kashmiri Pandit profiles, marriage bureau , Kashmiri Pandit marriage bureau, matchmaking services, matrimonial profiles, Kashmiri Pandit bride, Kashmiri Pandit groom, matrimony classified, brides, grooms', 'Kashmiri Pandit Matrimonials', 'Y', 'kashmiri-pandit-matrimonials.jpg', 'Kashmiri Pandit Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (800, 'Hindu: Brahmin Rigvedi', 'Rigvedi', 'CASTE', '45', 1, '/matrimonials/rigvedi-matrimonial/', 'Y', 'L1_CA_800', 'Rigvedi are the people mostly belonging to the Brahmin caste of Hindus. Two main castes, of which Rigvedis are said to be its part, are Deshastha Brhamin and Yajurvedi. The word Rigvedi comes from Rigveda which is one among the four religious texts or Veda of Hinduism. Rigvedi matrimonies occur between their specific castes and they are popularly known to be the oldest of the Brahmins in India.  Rigvedi matrimonies are same as of other Brahmin matrimonies, with the cultural influence of the region. ', 'Rigvedi Matrimony - Rigvedi Matrimonial - Rigvedi Matrimonials - Rigvedi Marriage - Online Rigvedi Matrimonials - Matrimonial Services', 'Search Rigvedi Matrimony, Rigvedi Matrimonial, Rigvedi Matrimonials, Rigvedi Marriage, Rigvedi Matrimonial Profiles in the leading Rigvedi Matrimonials site for Indian and NRI Rigvedi Marriage. Join Free & Add your Rigvedi Matrimonial Profile Now! Find suitable Indian & NRI Rigvedi brides and grooms from our online Rigvedi matrimonial and matchmaking services.', 'Rigvedi matrimony, Rigvedi matrimonials, Rigvedi matrimonial, matrimonials, matrimony, matrimony services, online Rigvedi matrimonials, Indian marriage, match making, matchmaker, Rigvedi profiles, marriage bureau , Rigvedi marriage bureau, matchmaking services, matrimonial profiles, Rigvedi bride, Rigvedi groom, matrimony classified, brides, grooms', 'Rigvedi Matrimonials', 'Y', 'rigvedi-matrimonials.jpg', 'Rigvedi Matrimony\r\n');
INSERT INTO `COMMUNITY_PAGES_TMP` VALUES (801, 'Hindu: Vokkaliga', 'Vokkaliga', 'CASTE', '144', 1, '/matrimonials/vokaliga-matrimonial/', 'Y', 'L1_CA_801', 'Vokaliga is a social group orignially from Old Mysore in Karnataka and is found in Tamil Nadu and Andhra Pradesh as well. Vokkaliga means â€˜one who tills the landâ€™ in Kannada and people belonging to this caste are referred to as Okkaligars also. They have names like Gowda, Gounder, Gowder, Rao, Reddy, Naicker and Naidu. Vokaliga Gowda, a significant socio-economic group, is known for its prosperity through agriculture.\r\n\r\nVokaliga matrimonial are usually arranged by elders of the family or community.', 'Vokkaliga Matrimony - Vokkaliga Matrimonial - Vokkaliga Matrimonials - Vokkaliga Marriage - Online Vokkaliga Matrimonials - Matrimonial Services', 'Search Vokkaliga Matrimony, Vokkaliga Matrimonial, Vokkaliga Matrimonials, Vokkaliga Marriage, Vokkaliga Matrimonial Profiles in the leading Vokkaliga Matrimonials site for Indian and NRI Vokkaliga Marriage. Join Free & Add your Vokkaliga Matrimonial Profile Now! Find suitable Indian & NRI Vokkaliga brides and grooms from our online Vokkaliga matrimonial and matchmaking services.', 'Vokkaliga matrimony, Vokkaliga matrimonials, Vokkaliga matrimonial, matrimonials, matrimony, matrimony services, online Vokkaliga matrimonials, Indian marriage, match making, matchmaker, Vokkaliga profiles, marriage bureau , Vokkaliga marriage bureau, matchmaking services, matrimonial profiles, Vokkaliga bride, Vokkaliga groom, matrimony classified, brides, grooms', 'Vokkaliga Matrimonials', 'Y', 'vokkaliga-matrimonials.jpg', 'Vokkaliga Matrimony\r\n');
