use newjs;

CREATE TABLE `COMMUNITY_PAGES_TMP` (
  `ID` int(10) NOT NULL auto_increment,
  `LABEL_NAME` varchar(60) default NULL,
  `SMALL_LABEL` varchar(60) NOT NULL,
  `TYPE` varchar(10) NOT NULL,
  `VALUE` varchar(10) NOT NULL,
  `LEVEL` int(10) NOT NULL,
  `URL` tinytext NOT NULL,
  `ACTIVE` varchar(1) NOT NULL default 'Y',
  `SOURCE` varchar(10) NOT NULL,
  `CONTENT` text NOT NULL,
  `TITLE` text NOT NULL,
  `DESCRIPTION` text NOT NULL,
  `KEYWORDS` text NOT NULL,
  `H1_TAG` text,
  `FOLLOW` enum('Y','N') default NULL,
  `IMG_URL` text NOT NULL,
  `ALT_TAG` text NOT NULL,
  PRIMARY KEY  (`ID`)
);


DROP TABLE `COMMUNITY_PAGES`;
ALTER TABLE `COMMUNITY_PAGES_TMP` RENAME `COMMUNITY_PAGES`;

